INSERT INTO "gamequestions" ("QuestionID", "Difficulty", "Type", "Question", "Answer1", "Answer2", "Answer3", "Answer4", "CorrectAnswer", "CategoryID", "SubcategoryID", "AdditionalCategoryID", "AdditionalSubcategoryID", "MoreInformation", "Pronunciation", "QuestionCreator", "Comments", "TimesAnswered", "LastDateAnswered") VALUES
(1, 4, 1, 'Кое од овие геометриски тела има два пара|еднакви соседни страни?', 'трапез', 'правоаголник', 'трапезоид', 'делтоид', 4, 6, 3, 0, 0, 'Дијагоналите на делтоид се меѓусебно нормални. Делтоид е четириаголник каде што двата парови на соседни страни се исти.', '', 'John Doe', '', 1, NULL),
(2, 3, 1, 'Која боја произлегува со правилно|мешање на сина и жолта?', 'портокалова', 'црвена', 'зелена', 'кафена', 3, 1, 3, 0, 0, 'Oсновни бои во сончевиот спектар се црвената, жолтата и сината - наречени примарни бои. Секундарните бои се добиваат со мешање на примарните. Зелената (секундарна) боја е добиена од мешање на двете примарни бои: сина и жолта.', '', 'John Doe', '', 1, '2020-03-19 18:52:32'),
(3, 3, 1, 'Кое е другото име за вреднувач на литературната,|научната и моралната вредност?', 'критичар', 'статичар', 'матичар', 'физичар', 1, 4, 0, 0, 0, 'Критика е образложена оцена на некое дело, работа, постапка, или збир од оцени во одредена област. Критиката може да биде објективна или субјективна, аналитичка или импресионистичка, апсолутна или иманентна и сл. Оценувач, вреднувач на литературната, научната, моралната вредност го нарекуваме критичар.', NULL, 'John Doe', NULL, 1, '2020-03-14 15:37:13'),
(4, 4, 1, 'Која билка се користи за приготвување песто сос?', 'оригано', 'босилок', 'магдонос', 'тимјан', 2, 19, 7, 0, 0, '', '', 'John Doe', '', 1, '2020-03-29 00:35:42'),
(5, 2, 1, 'Огромните џиновски бранови ги нарекуваме уште и...', 'суоми', 'наоми', 'цунами', 'ријами', 3, 12, 0, 0, 0, 'Цунами (јапонски:- пристанишен бран) (津 „цу“, пристаниште; 波 „нами“ - бран) е природна појава на огромни бранови кои потекнуваат од земјотрес или вулканско избувнување. Повеќето цунами се случуваат во Тихиот Океан, но најсмртоносното цунами во историјата на човештвото се случило во индискиот океан во близина на Индонезија, на 26 декември, 2004 при што починале околу 300.000 луѓе.', '', 'John Doe', '', 1, '2020-03-07 11:39:15'),
(6, 3, 1, 'Кој од овие градови е главен,|а воедно и најголем во Романија?', 'Темишвар', 'Крајова', 'Букурешт', 'Констанца', 3, 2, 1, 0, 0, 'На Унгарија главен град е Будимпешта. На Чешка е главен град Прага. На Латвија главен град е Рига. Букурешт за Романија претставува нејзин културен, економски и политички центар и е наjголем град на Балканот, коj за прв пат се споменува во 1459, а е главен град од 1862 г.', NULL, 'John Doe', NULL, 1, '2020-02-29 19:23:06'),
(7, 4, 1, 'Која земја-членка на Европската Унија|е најмала по површина?', 'Малта', 'Луксембург', 'Литванија', 'Летонија', 1, 2, 1, 0, 0, 'By surface area, France is the biggest EU country and Malta the smallest.', NULL, 'John Doe', NULL, 1, '2020-03-14 15:27:42'),
(8, 3, 1, 'Која боја се наоѓа во средина на државното знаме|на Италијанската Република?', 'црвена', 'жолта', 'зелена', 'бела', 4, 2, 1, 0, 0, 'Во средината на државното знаме на Италијанската Република се наоѓа белата боја, а останатите се црвената и зелената.', NULL, 'John Doe', NULL, 1, '2020-03-07 16:39:44'),
(9, 5, 1, 'Кој век ја „памти“ Четвртата крстоносна војна?', '11 век', '13 век', '15 век', '17 век', 2, 3, 1, 0, 0, 'Четврта крстоносна војна (1202 - 1204 година) првично имала за цел освојување на Ерусалим преку, контролираниот од муслиманите, Египет. Поради недостаток на пари, крстоносците заклучиле дека е потребно прво да се освои Задар, па Цариград и со тоа да се разбие Византија.', NULL, 'John Doe', NULL, 1, NULL),
(10, 4, 1, 'Каде се наоѓа главното седиште на|светската организација УНЕСКО?', 'Берлин', 'Париз', 'Њујорк', 'Брисел', 2, 2, 1, 0, 0, 'УНEСКO (англиски: United Nations Educational, Scientific and Cultural Organization) Основната цел на Организацијата е да придонесува за мирот и стабилноста промовирајќи соработка меѓу Основана на 16 ноември 1946 год.', NULL, 'John Doe', NULL, 1, NULL),
(11, 1, 1, 'Според една боемска народна песна, „Павле ми пие...“', 'вино ем ракија', 'виски ем мартини', 'пиво ем текила', 'вотка ем мастика', 1, 0, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-04-04 13:02:06'),
(12, 3, 1, 'Во повеќето автомобили, темпоматот автоматски|се исклучува кога...', 'свирите', 'вклучувате светла', 'газите на сопирачката', 'гасите радио', 3, 17, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(13, 2, 1, 'Какви се цените на производите ако тие се пониски од|производната заради освојување нови пазари?', 'клиринг', 'лизинг', 'холдинг', 'дампинг', 4, 16, 3, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-01-18 19:20:01'),
(14, 2, 1, 'Полиграфот е детектор за...', 'лаги', 'чад', 'злато', 'бојни отрови', 1, 7, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-10 18:54:56'),
(15, 2, 1, 'Која турска кованица се користи за оној што го|сменил мислењето, односно се покајал?', 'дограмаџија', 'пишманаџија', 'кираџија', 'кондураџија', 2, 5, 3, 0, 0, '', '', 'John Doe', '', 1, '2020-03-19 18:52:08'),
(16, 2, 1, 'Каков е автомобилот што работи и на бензин и на струја?', 'морбиден', 'луциден', 'хибриден', 'фригиден', 3, 17, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(17, 3, 1, 'Како е „наречен трамвајот“ на Елија Казан во кој|главен „патник“ е Марлон Брандо?', 'волја', 'мерак', 'страст', 'желба', 4, 8, 1, 0, 0, 'Марлон Брандо Џуниор е двократен оскаровец, икона на филмската уметност низ целата должина на својата повеќе од половина век долга кариера. „Трамвајот наречен желба“ е исто познат и под името „Пајтонот наречен желба“', NULL, 'John Doe', NULL, 1, '2020-03-27 19:27:41'),
(18, 4, 1, 'Познатиот американски филмски актер Џони Деп во филмот|„Беше еднаш во Мексико“ ја толкува улогата на...', 'Ел Мариачи', 'Николас', 'Лоренцо', 'Шелдон', 4, 8, 4, 0, 0, 'Беше еднаш во Мексико е акционен филм од 2003. во режија на Роберт Родригез. Главни улоги: Антонио Бандерас, Салма Хајек и Џони Деп. Антони Бандерас ја толкува улогата на Ел Маријачи, Енрике Иглесијас на Лоренцо, Хулио Оскар Мехосо на Николас. Џони Деп го толкува Шелдон Сандс.', NULL, 'John Doe', NULL, 1, '2020-03-22 18:35:23'),
(19, 5, 1, 'Кој ја толкува главната улога во романтичната комедија|Love Actually, под режисерската палка на Ричард Кертис?', 'Хју Грант', 'Мет Дејмон', 'Том Хенкс', 'Вуди Ален', 1, 8, 6, 0, 0, 'Кира Кристина Најтли е родена на 26 март 1985 година. Таа почна филмска кариера на својата 17-та година. Најдобро е позната по улогата во филмот Bend It Like A Beckham и триологијата на Пирати од Карибите како Елизабет Свон. Кира Најтли е втората глумица, неамериканка, (после Камерон Дијаз) која најмногу е платена за своите филмови. Таа, исто така, се појавува во филмот од 2004, Кралот Артур.', '', 'John Doe', '', 1, NULL),
(20, 4, 1, 'Познатата „перестројка“ во некогашната СССР|се случи во времето на…', 'Андреј Громико', 'Василиј Кузнецов', 'Михаил Горбачов', 'Јуриј Андропов', 3, 3, 1, 0, 0, 'Перестројка е поим кој се користи во советската економска и социјална политика од 1987 година. Самиот збор перестројка значи престројување. Перестројката се случува во времето на Михаил Горбачов.', NULL, 'John Doe', NULL, 1, NULL),
(21, 3, 1, 'Која држава „се фали“ со еден од најпопуларните десерти тирамису?', 'Франција', 'Белгија', 'Италија', 'Португалија', 3, 19, 7, 0, 0, 'Тирамису е италијански десерт којшто се приготвува со пишкоти, натопени со кафе еспресо, сирење маскарпоне (меко, слатко и кремасто, вид на слатка павлака), јајца, шеќер, вино марсала или рум и какао. Различни извори наведуваат дека овој десерт настанал во градот Тревизо, од рацете на слаткарот Роберто Лингваното. Согласно други верзии, десертот тирамису настанал во Сиена (град во Тоскана), во чест на војводата Козимо III во прилика не една негова посета на градот.', '', 'John Doe', '', 1, NULL),
(22, 4, 1, 'Во својот живот чилеанскиот писател Пабло Неруда станува|близок соработник со социјалистичкиот претседател...', 'Јан Марајнисен', 'Салвадор Аљенде', 'Хуго Чавез', 'Џорџ Орвел', 2, 3, 1, 0, 0, 'Пабло Неруда (12 јули 1904 – 23 септември 1973) е псевдонимот, а подоцна и официјалното име на чилеанскиот писател и комунист Рикардо Елиесер Нефтали Рејес Басоалто. Неговите дела се преведени на многу јазици. Неруда бил близок соработник на социјалистичкиот претседател Салвадор Аљенде.', NULL, 'John Doe', NULL, 1, NULL),
(23, 4, 1, 'Во која област Габриел Гарсија Маркес|е добитник на Нобелова награда?', 'мир', 'економија', 'физика', 'литература', 4, 4, 1, 0, 0, 'Габриел Хозе Гарсија Маркес (роден на 6 март, 1928) е колумбиски писател, новинар, политички активист. Роден во Аракатака, северна Колумбија. Нобеловата награда за литература ја добива во 1982 година.', NULL, 'John Doe', NULL, 1, '2020-03-08 16:06:04'),
(24, 5, 1, 'Кој европски град му го позајмува името на математичкиот метод за|предвидувањето на сложените математички состави?', 'Милано', 'Барселона', 'Монте Карло', 'Стокхолм', 3, 6, 0, 0, 0, 'Монте Карло методи го предвидуваат однесувањето на сложените математички состави. Се користат во економијата за да се пресмета работниот ризик. Овие математички методи се измислени во Лос Аламос, во државната лабараторија на САД, недолго после Втората Светска Војна', NULL, 'John Doe', NULL, 1, '2020-04-13 14:48:33'),
(25, 4, 1, 'Кое е значењето на старословенскиот збор глаголи,|по кое е наречена најстарата позната словенска азбука?', 'зборува', 'чита', 'пишува', 'црта', 1, 5, 3, 0, 0, 'Глаголското писмо или глаголица (ранохристијанска азбука) е најстарата позната словенска азбука. Била создадена од Св. Кирил (827-869) и Св. Методиј (826-885) во 855 или околу 862–863 за преведување на Библијата и други книги на словенските јазици. Глаголицата има 41 буква, но нивниот број малку варира во подоцнежните верзии.', '', 'John Doe', '', 1, NULL),
(26, 4, 1, 'Кај колку природни словенски јазици се употребува|кириличната азбука?', '4', '6', '8', '10', 2, 5, 0, 0, 0, 'Современата кирилица е составена од Свети Климент Охридски и Свети Наум Охридски, од Охрид, тогаш во Царство Бугариjа, кои ја преобразиле и поедноставиле тогашната глаголица и новата видоизменета азбука во чест на Свети Кирил го добила името кирилица. Кирилица е азбука што се употребува за пишување кај шест природни словенски јазици: (белоруски, бугарски, македонски, руски, српски и украински)', NULL, 'John Doe', NULL, 1, NULL),
(27, 4, 1, 'На која фамилија животни припаѓа жабата?', 'влечуги', 'инсекти', 'мршојадци', 'водоземци', 4, 12, 0, 0, 0, 'Влечуги/влекачи/рептили — група на ‘рбетни животни во која спаѓаат змиите, гуштерите, желките итн. Мршојадците се месојади што се хранат со месо кое е веќе мртво кои го крадат месото од мртвиот плен на други животни Жабата е водоземец од редот Анура (Anura), односно безопашести водоземци.', NULL, 'John Doe', NULL, 1, NULL),
(28, 3, 1, 'Како се нарекува цврстиот површински слој на Земјата?', 'литосфера', 'биосфера', 'атмосфера', 'хидросфера', 1, 2, 0, 0, 0, 'Биосферата го претставува живиот свет, атмосферата воздушниот слој, а хидросферата водениот слој. Литосферата ја претставува горната тврда карпеста обвивка на Земјата на длабочина од 10 метри до 120 километри.', NULL, 'John Doe', NULL, 1, NULL),
(29, 3, 1, 'Мршојадци се оние животни кои се хранат со...', 'брза храна', 'тавче-гравче', 'мртво месо', 'шеќер во прав', 3, 12, 0, 0, 0, 'Мршојадци се животни што се хранат со мртво месо.', NULL, 'John Doe', NULL, 1, NULL),
(30, 2, 1, 'Која е единица за маса на драги камења и бисери|што изнесува 200 милиграми?', 'вебер', 'карат', 'фарад', 'кандела', 2, 6, 2, 0, 0, 'За волумен (зафатнина) се користат кубни сантиметри/метри/километри, за површина (плоштина) квадратни сантиметри/метри/километри, за должина милиметри, сантиметри, метри, километри итн. Карат е единица за скапоцени камења.', '', 'John Doe', '', 1, '2020-02-29 19:13:39'),
(31, 4, 1, 'На кое соединение е базирано стаклото?', 'јаглероден оксид', 'калциум сулфат', 'цинк оксид', 'силициум диоксид', 4, 7, 3, 0, 0, 'Поимот стакло во секојдневна употреба се однесува на специфичен тип на стакло што е базирано на силициум диоксид и се користи како материјал за различни објекти, контејнери и декорации. Стакло било откриено околу 3.000 година п. н. е во Египет. Во почетокот технологијата не можела да овозможи произведување на чисто стакло.', NULL, 'John Doe', NULL, 1, NULL),
(32, 3, 1, 'Која од наведениве птици не лета?', 'гулабот', 'орелот', 'врапчето', 'кивито', 4, 12, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(33, 3, 1, 'На колку црни полиња се позиционирани|белите шаховски фигури на почетокот на играта?', '8', '12', '16', '32', 1, 19, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-01-18 19:26:52'),
(34, 2, 1, 'Невозможното ќе се случи кога врбата ќе роди...', 'рибизли', 'грозје', 'круши', 'банани', 2, 4, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(35, 6, 1, 'Кој е буквалниот превод на јапонскиот збор „карате“,|боречката вештина која датира од 16 век?', 'важен удар', 'обелен образ', 'празна рака', 'борбен став', 3, 5, 3, 0, 0, 'Карате е јапонска боречка вештина која ги користи сите делови на телото со цел за самоодбрана. Зборот на јапонски значи празна рака. Се појавува во 16 век во древна Јапонија.', '', 'John Doe', '', 1, NULL),
(36, 1, 1, 'Се верува дека светлото е секогаш на крајот на...', 'денот', 'тунелот', 'улицата', 'екранот', 2, 4, 6, 0, 0, '', '', 'John Doe', '', 1, NULL),
(37, 3, 1, '„Амадеус“, филм на Милош Форман,|го опишува животот на...', 'Моцарт', 'Бах', 'Штраус', 'Вагнер', 1, 8, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-07 11:31:43'),
(38, 1, 1, 'Како популарно се нарекува возилото кое ги крева|непрописно паркираните автомобили?', 'куче', 'маче', 'прасе', 'пајак', 4, 17, 1, 0, 0, '', '', 'John Doe', '', 1, NULL),
(39, 2, 1, 'За оној кој ништо не работи, а постојано приговара, велиме дека „продава“...', 'искуство', 'магла', 'град', 'чад', 2, 4, 4, 0, 0, '', '', 'John Doe', '', 1, '2020-04-11 11:05:36'),
(40, 4, 1, 'Кое дрво претставува проблем на Малиот Принц,|јунак од истоимената книга?', 'еукалиптус', 'баобаб', 'бука', 'секвоја', 2, 4, 3, 0, 0, '', '', 'John Doe', '', 1, NULL),
(41, 3, 1, 'Акупунктура е метод на лечење со...', 'игли', 'масажа', 'лековити билки', 'термални води', 1, 7, 2, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-01-18 13:31:31'),
(42, 4, 1, 'Од која област води потекло ананасот?', 'Австралија', 'Азија', 'Јужна Америка', 'Африка', 3, 12, 0, 0, 0, 'Во 1943, Кристофер Колумбо за прв пат видел растенија од овој вид во Гваделупе, Франција Ананасот води потекло од Јужна Америка', NULL, 'John Doe', NULL, 1, NULL),
