(271, 5, 1, 'Во која битка во 1526 година Турците издвоиле победа|над Унгарија и со тоа престанала да постои како држава?', 'Битка на Крбавско поле', 'Битка кај Сигетвар', 'Битка на Лебово поле', 'Мохачка битка', 4, 0, 0, 0, 0, 'Во 1001 година Унгарците го прифатиле христијанството и кнезот Иштван I се крунисал во крал. Во 1526 година за време на Мохачката битка Турците издвоиле победа над Унгарија и со тоа престанала да постои како држава. Територијата на Унгарија била поделена на три дела од кои: еден дел целосно потпаднал под власт на Турција, друг под власт на Хабсбуршка монархија и третиот бил полунезависна држава во вазалски однос со Турција. ', '', 'John Doe', '', 1, NULL),
