(294, 4, 1, 'Која група на живи суштсетва одговара на|стручниот термин во биологијата амфибија?', 'сунѓери', 'водоземци', 'влекачи', 'членконоги', 2, 12, -1, 0, 0, 'Влекачи (лат. Reptilia) — група на ‘рбетни животни во која спаѓаат змиите, гуштерите, желките, крокодилите, туатарата, како и бројни изумрени фосилни видови. Членконогите (лат. Arthropoda) се најголемиот и најразновидниот животински тип. Водоземците (науч. Amphibia) се ектотермни (ладнокрвни) животни кои метаморфозираат од јувенилна водна форма до возрасна единка или до педоморфа која задржува некои од јувенилните карактеристики.', '', 'John Doe', '', 1, NULL),
