(357, 6, 1, 'Пред да стане претседател на САД, Џорџ Буш Јуниор| бил гувернер на сојузната држава...', 'Арканзас', 'Тексас', 'Калифорнија', 'Флорида', 2, 0, 0, 0, 0, 'Џорџ Буш е роден на 6 јули 1946 во Њу Хејвн, Конектикат. Тој е син на бившиот претседател Џорџ Херберт Вокер Буш. Братот на Џорџ Буш - Џеб Буш бил избран за гувернер на Флорида во 1999 година . Младиот Џорџ Буш растел во тексашките градови Мидленд и Хјустон, заедно со Џеб, Нил, Марвин и Дороти Буш. Учел во академијата „Филипс“ во државата Масачусетс, а потоа завршил историја на универзитетот „Јеил“ во 1968 година. Во универзитетот, тој бил член на студентското братство „Делта Капа Епсилон“, како и на тајното друштво „Череп и коски“. Џорџ Буш бил избран за гувернер на Тексас во 1995 година и таа должност ја извршувал до 2000 година. Џорџ Буш е оженет со Лора Буш и има две ќерки близначки - Барбара и Џена.', '', 'John Doe', '', 1, NULL),
