(954, 7, 1, 'Двата Тавана од Хаки-пашините конаци од Дебар, кои денес|се наоѓаат во Етнолошкиот музеј во Скопје се дело на...', 'Мирче Деспотов', 'Алексо Мирчев', 'Нестор Алексиев Мирчевски', 'Глиша Костиќ', 1, 0, 0, 0, 0, 'В Дебър изгражда и казармите и заедно с майстор Алексо Черпеналоски – беговите конаци, а в Тетово – конаците на Хакъ паши и Абдурахман паша Тетовски в Тетовското кале на Балтепе. Двата тавана на Хакинпашовите конаци с размери 6 на 8 m са запазени в Музея на град Скопие – направени са от чам, а резбите и корнизите са от липа. И в двата тавана са използвани растителни елементи и има бароково влияние, като линиите са изящни и уравновесени, а декорацията не е претрупана. На 80 години се връща в родното си село, където умира. Синовете му Коста Мирчев и Алекси Мирчев работят с него. Внуците му Нестор Алексиев и Лазар Алексиев също са видни резбари.', '', 'John Doe', '', 1, NULL),
