(2121, 6, 1, 'Која афричка држава има исто име|со нејзиниот главен град?', 'Свазиленд', 'Малави', 'Џабути', 'Мозамбик', 3, 0, 0, 0, 0, 'Република Џибути — држава во Источна Африка. Државата се граничи со Еритреја на север, Етиопија на запад и југ и со Сомалија на југозапад. На исток државата излегува на Црвеното Море, поточно на Аденскиот Залив и на значајниот проток Баб ел-Мандеб. Вкупната површина на Џибути изнесува 23.200 км² со вкупно население од 864.000 жители. Главен град на државата е истоимениот град Џибути.', NULL, 'John Doe', NULL, 1, NULL),
(2122, 5, 1, 'Карнофобија е необјаснет страв од...', 'кловнови', 'месо', 'автомобили', 'гласна музика', 2, 0, 0, 0, 0, 'Carnophobia (from karno, Latin for meat) is the fear of meat. Carnophobia is often due to traumatic experiences involving meat, like suffering a severe illness after consuming meat, went on a traumatic trip to a slaughterhouse or butcher shop, had an accident while preparing meat, and adverse reaction to images or advertising for or against meat products.', NULL, 'John Doe', NULL, 1, '2020-02-08 18:15:47'),
(2123, 6, 1, 'Кој уметник од импресионизмот сликал|балерини бидејќи биле добро продавани?', 'Клод Моне', 'Едгар Дега', 'Берта Моризо', 'Пјер Огист Реноар', 2, 1, 2, 0, 0, 'n many subsequent paintings dancers were shown backstage or in rehearsal, emphasizing their status as professionals doing a job. From 1870 Degas increasingly painted ballet subjects, partly because they sold well and provided him with needed income after his brother''s debts had left the family bankrupt.', '', 'John Doe', '', 1, NULL),
(2124, 4, 1, 'Како во математика се вика правата чии криви|и се приближуваат но не ја допираат?', 'синусоида', 'асимптота', 'хипербола', 'тангента', 2, 0, 0, 0, 0, 'Асимптота — права во математиката чие растојание од дадена крива, при ограничено или бесконечно продолжување на двете линии, се повеќе се намалува, т.е., се стреми кон нула. Двете линии во ваков математички случај никогаш не се сечат. ', NULL, 'John Doe', NULL, 1, NULL),
(2125, 5, 1, 'Кои припадници на животинскиот свет|се „кријат“ во латинскиот назив лепидоптера?', 'пеперутки', 'гуштери', 'змии', 'паразити', 1, 0, 0, 0, 0, 'Пеперугите (лат. Lepidoptera) образуваат голем ред на инсекти кој ги вбројува во себе молците и дневните пеперуги. Ова е еден од најбогатите со видови ред во светот чии претставници можат да се најдат речиси секаде. Обединува повеќе од 180 000 видови распоредени во 128 фамилии и 47 надфамилии. Името доаѓа од старогрчките зборови λεπίδος (лушпа) и πτερόν (крило). ', NULL, 'John Doe', NULL, 1, '2020-01-18 13:27:31'),
(2126, 6, 1, 'Кој ја игра главната улога на агентот|Мајк Бенинг во филмот „Падот на Олимп“?', 'Расел Кроу', 'Хју Џекмен', 'Морган Фриман', 'Жерард Батлер', 4, 0, 0, 0, 0, 'Од режисерот Антоан Фукo доаѓа „Olympus has fallen”. „Падот на Олимп” е приказна за поранешен агент на тајната служба (Жерард Батлер) кој повторно ќе се најде во служба на претседателот на САД (Арон Екхарт), овој пат сосема случајно, откако ќе биде сведок на падот на Олимп (шифра за освојување на Белата Куќа од страна на терористи).', NULL, 'John Doe', NULL, 1, NULL),
(2127, 5, 1, 'Коe е најголемо австралиско езеро?', 'Фром', 'Барл', 'Амадеус', 'Ер', 4, 0, 0, 0, 0, 'Езерото Ер (англиски: Lake Eyre, на јазикот на домородците: Kati-tanda) е, во ретки случаи кога е полно, најголемо езеро во Австралија (и државата и континентот). Се наоѓа на околу 15 метри под нивото на морето и по тоа е најниска точка во Австралија. Максималната површина на езерото изнесува 9.500 -{km²}-. Ова солено еезеро се наоѓа во центарот на басенот на езерото Ер.', '', 'John Doe', '', 1, NULL),
(2128, 5, 1, 'Во која пештера се наоѓа праисториската|слика „Ранетиот бизон“?', 'Алтамира', 'Кантабриа', 'Ел Кастиљо', 'Ел Соплао', 1, 0, 0, 0, 0, 'Рањени бизон је праисторијска слика у Алтамири, Шпанија, настала између 15000. и 10000. п. н. е.', NULL, 'John Doe', NULL, 1, NULL),
(2129, 5, 1, 'Која река поминува низ Верона?', 'Адиџе', 'Верона', 'Соча', 'Брента', 1, 0, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL);
