(2130, 6, 1, 'Кој спорт натпреварите ги одржува на|„Гери Вебер“ стадионот?', 'кошарка', 'фудбал', 'тенис', 'ракомет', 3, 0, 0, 0, 0, 'Gerry Weber Stadion is an indoor sports arena, located in Halle, North Rhine-Westphalia, in Germany. The capacity of the arena is 12,300 people and it opened in 1993. It hosts the Gerry Weber Open every year in June. It is one of the few grass court tennis tournaments around.', '', 'John Doe', '', 1, NULL),
(2131, 5, 1, 'За кој континент ему птиците се важен|културен симбол?', 'Африка', 'Азија', 'Австралија', 'Јужна Америка', 3, 0, 0, 0, 0, 'Ему — најголемата птица на Австралија е единствениот останат вид од родот ему (Dromaius). Емуто е важен културен симбол на Австралија и фигурира на државниот грб и разни монети на австралискиот долар. ', '', 'John Doe', '', 1, NULL),
(2132, 7, 1, 'Која година Жан Валжан го украде лебот?', '1795', '1848', '1871', '1907', 1, 0, 0, 0, 0, 'Жан Валжан (француски: Jean Valjean) — протагонистот на романот Клетници на Виктор Иго. Иго го опишува животот на Валжан откако е ослободен од затвор, каде служи казна за кражба на леб. In the winter of 1795, when resources were scarce, Valjean stole a loaf of bread from a local baker by breaking the window.', NULL, 'John Doe', NULL, 1, '2020-01-19 13:02:59'),
(2133, 6, 1, 'Кој научник на суд морал да го докаже|својот патент за вулканизација?', 'Чарлс Гудјиар', 'Харви Фајрстоун', 'Џон Данлоп', 'Андре Мишелин', 1, 0, 0, 0, 0, 'Hancock claimed to have invented vulcanization independently, and received a British patent, initiated in 1843, but finalized in 1844. In 1855, in the last of three patent disputes with fellow British rubber pioneer, Stephen Moulton, Hancock''s patent was challenged with the claim that Hancock had copied Goodyear. Goodyear attended the trial.', '', 'John Doe', '', 1, NULL),
(2134, 6, 1, 'Во кој век избил големиот пожар во Рим|за кој бил осомничен царот Нерон?', 'во 1. век', 'во 2. век', 'во 3. век', 'во 4. век', 1, 0, 0, 0, 0, 'Велики римски пожар (лат. Magnum Incendium Romae) је разорни пожар који је захватио град Рим у ноћи између 18. и 19. јула 64. године нове ере. Пожар је изазвао велику штету у уништио је већи део античког града пре него што је стављен под контролу, након шест дана. Поједини антички извори кривили су императора Нерона за пожар, док су га други хвалили због организовања мера за спречавање ширења пожара и помоћи жртвама.', NULL, 'John Doe', NULL, 1, NULL),
(2135, 5, 1, 'Кое е најширокото семејство на|слатководни риби?', 'крапови', 'сомови', 'пастрмки', 'штуки', 1, 0, 0, 0, 0, 'The Cyprinidae (крапови, шарани) are the family of freshwater fishes, collectively called cyprinids, that includes the carps, the true minnows, and their relatives (for example, the barbs and barbels). Also commonly called the \"carp family\", or \"minnow family\", Cyprinidae is the largest known fish family and the largest vertebrate animal family in general, with about 3,000 living and extinct species in about 370 genera.', '', 'John Doe', '', 1, NULL),
