(2199, 4, 1, 'Како се нарекува графичката техника за печатење|од дрвени матрици за добивање отпечаток?', 'пирографија', 'калиграфија', 'ксилографија', 'литографија', 3, 0, 0, 0, 0, 'Дрворез (или ксилографија) е графичка техника со висок притисок на дрвени плочи кои сечат со специјални ножеви по должината на влакната на дрвените панели.', NULL, 'John Doe', NULL, 1, NULL),
(2200, 5, 1, 'Каде европските истражувачи ги откриле кикириките?', 'Африка', 'Јужна Америка', 'Азија', 'Австралија', 2, 0, 0, 0, 0, 'The peanut plant probably originated in Peru or Brazil in South America. No fossil records prove this, but people in South America made pottery in the shape of peanuts or decorated jars with peanuts as far back as 3,500 years ago. European explorers first discovered peanuts in Brazil.', NULL, 'John Doe', NULL, 1, NULL),
(2201, 5, 1, 'Која ајкула може да живее до пет века?', 'гренландска ајкула', 'бела ајкула', 'тигар ајкула', 'чекан ајкула', 1, 0, 0, 0, 0, 'The Greenland Shark Is The Longest Living Vertebrate Known To Science. Scientists have long suspected that the elusive Greenland sharks lived for a long time. It turns out they were right! A new study has revealed that the world''s second largest carnivorous fish may have a lifespan of as long as 400 years.', NULL, 'John Doe', NULL, 1, NULL),
(2202, 5, 1, 'Римската империја ги делела слободните луѓе|на патриции и...', 'семити', 'романи', 'робови', 'плебејци', 4, 0, 0, 0, 0, 'Населението го сочинувале слободни и неслободни луѓе. Слободните се делеле на патриции и плебејци.', NULL, 'John Doe', NULL, 1, NULL),
(2203, 5, 1, 'Кој симбол го има знамето на Шкотска?', 'двоглав лав', 'тврдина', 'Андреин крст', 'ѕвезда', 3, 0, 0, 0, 0, 'Според христијанската легенда, маченикот Апостол Андреја, заштитник на Шкотска, бил распнат на крст со облик на буквата Х кај Патра во Ахаја. Оваа иконографија првпат се јавува во земјата во 1180 г. за време на кралот Вилијам I и на печатите на старателите на Шкотска од 1286 г. Употребата на Андреиниот крст, наречен и салтир или накосен крст (crux decussata) во упростен облик без распетие започнала кон крајот на XIV век. Во јуни 1385 г., Парламентот на Шкотска решил шкотските војници што служеле во Франција да го носат овој крст напред и одзади, како обележје на земјата од каде дошле', NULL, 'John Doe', NULL, 1, NULL),
(2204, 6, 1, 'Во најстарото кино во светот се прикажани|првите филмови на браќата...', 'Рајт', 'Грин', 'Манаки', 'Лимиер', 4, 0, 0, 0, 0, 'Најстарото кино во светот „Еден“ во Франција, бил кино и театар каде бројни француски ѕвезди прв пат играле во него. Браќата Огист и Луј Лимијер, во киното, го прикажале својот прв филм пред 250 гледачи на 21 март 1899.', NULL, 'John Doe', NULL, 1, NULL),
(2205, 6, 1, 'Во кој град пред четири века излезе првото|женско списание „Лејдис Мекјури“?', 'Лондон', 'Париз', 'Рим', 'Берлин', 1, 0, 0, 0, 0, '1693. — Џон Дантон у Лондону објавио први женски часопис, Лејдис Меркури. The Ladies'' Mercury was a periodical published for four weeks by The Athenian Society and its founder John Dunton. Its first issue was published in London on 27 February 1693', NULL, 'John Doe', NULL, 1, NULL),
(2206, 4, 1, 'Кое од наведените грчки пристаништа излегува |на Јонското Море?', 'Кавала', 'Игуменица', 'Пиреа', 'Солун', 2, 0, 0, 0, 0, 'Igoumenitsa is the chief port of Thesprotia and Epirus, and one of the largest passenger ports of Greece, connecting northwestern Mainland Greece with the Ionian Islands and Italy.', NULL, 'John Doe', NULL, 1, NULL),
(2207, 4, 1, 'Името чевличе му припаѓа на|едноклеточниот организам...', 'опалина', 'парамециум', 'амеба', 'ѕвонче', 2, 0, 0, 0, 0, 'Парамециум, попознат како чевличе, го добил овој назив, заради неговиот облик, како чевла. Обвиткан е со таканаречени иглички, или трепки, со чија помош, тој се движи со сите одеднаш во еден правец. Парамециумот живее најчесто во барите каде што има распаднати листови, и живее и во некои други одредени слатки води.', NULL, 'John Doe', NULL, 1, NULL),
(2208, 4, 1, 'Од кој океан е дел Црвеното море?', 'Јужен океан', 'Тихи океан', 'Индиски океан', 'Атлантски океан', 3, 0, 0, 0, 0, 'Црвеното Море се наоѓа помеѓу Азија и Африка. На север се граничи со Суецкиoт залив, кој го поврзува ова море со Средоземното Море, на југ со Индискиот Океан, на запад со Египет, Судан, Еритреја и Џибути a на исток со Јемен и Саудиска Арабија. Иако Црвеното Море е познато по својата природна убавина, со долги корални гребени, тоа е исто така и значаен пат за танкери со нафта и други бродови кои патуваат низ Суецкиот Канал.', NULL, 'John Doe', NULL, 1, NULL),
(2209, 6, 1, 'Зборот карат кој е мерна единица за дијамантите|потекнува од францускиот јазик и значи мешунка од...', 'боранија', 'рогач', 'грав', 'грашак', 2, 0, 0, 0, 0, 'Во минатото, секоја земја имала свој карат и се користел претежно за злато, но од 1570-тите почнал да се користи за изразување на тежината на дијаманти. Поимот „карат“ потекнува од француски: carat, кој е пак изведен од арапски: قيراط (кират), от старогрчки: κεράτιον (кератион) — мешунка од рогач (Ceratonia siliqua), со чии семки се мерела тежината.', NULL, 'John Doe', NULL, 1, NULL),
(2210, 5, 1, 'Во која држава се наоѓа седиштето на главниот|судски орган на Обединетите Нации?', 'Холандија', 'Велика Британија', 'Белгија', 'Романија', 1, 0, 0, 0, 0, 'Меѓународниот суд за правда е главниот судски орган на Обединетите Нации. Седиштето на овој суд се наоѓа во Палатата на мирот во Хаг, Холандија. Основан е во 1945 година според одредбите на Повелбата на Обединетите Нации, а започнал со работа во 1946 година, како наследник на Постојаниот суд за меѓународно право. Статусот меѓународен суд на правдата е сличен со статутот на неговиот претходник и е главен конструктивен документ кој ја утврдува и регулира работата на судот.', NULL, 'John Doe', NULL, 1, NULL),
