(2213, 6, 1, 'Која година премиерно во земјата на творецот|беше промовиран VHS системот?', '1969', '1976', '1987', '1992', 2, 0, 0, 0, 0, 'The Video Home System (VHS) is a standard for consumer-level analog video recording on tape cassettes. Developed by Victor Company of Japan (JVC) in the early 1970s, it was released in Japan in late 1976 and in the United States in early 1977.', NULL, 'John Doe', NULL, 1, NULL),
(2214, 5, 1, 'Кое е името на најпрочуениот борец кој ги гонеше|нацистите по Втората светска војна?', 'Алојз Брунер', 'Ире Левин', 'Симон Визентал', 'Бруно Крајски', 3, 0, 0, 0, 0, 'After the war, Wiesenthal dedicated most of his life to tracking down and gathering information on fugitive Nazi war criminals so that they could be brought to trial. In 1947 he co-founded the Jewish Historical Documentation Centre in Linz, Austria, where he and others gathered information for future war crime trials and aided refugees in their search for lost relatives. ', NULL, 'John Doe', NULL, 1, NULL),
(2215, 4, 1, 'Каде бил роден познатиот романописец|Марсел Пруст?', 'Австрија', 'Франција', 'Шпанија', 'Германија', 2, 0, 0, 0, 0, 'Марсел Пруст (10 јули 1871, Отеј, FR - 18 ноември 1922, Париз, Франција) — француски романописец, критичар и есеист, најпознат како автор на монументалното прозно дело Во потрага по изгубеното време. Тој се смета од страна на критичарите и писателите за еден од највлијателните писатели од 20 век.', NULL, 'John Doe', NULL, 1, NULL),
(2216, 4, 1, 'На кој елемент му припаѓа зодијачкиот знак бик?', 'оган', 'вода', 'воздух', 'земја', 4, 0, 0, 0, 0, 'Земјени знаци: Бикот е оној што сее. Девицата ги негува билките, ги одржува во живот. Јарецот организира маркетинг за продажба.', NULL, 'John Doe', NULL, 1, NULL),
(2217, 5, 1, 'Чија покраина се Оркинските острови?', 'Ирска', 'Шкотска', 'Данска', 'Норвешка', 2, 0, 0, 0, 0, 'Оркниски Острови или Оркни е архипелаг составен од еден поголем и седумнаесет помали острови оддалечени околу 10 километри од северниот брег на Шкотска. Имињата на сите поголеми острови завршуваат на ay, што на старонордиски значи „остров“. На островите во 2005 г. живееле 19.590 жители.', '', 'John Doe', '', 1, NULL),
(2218, 3, 1, 'Како се вика гуштерот кој може да ја „менува бојата“?', 'камелеон', 'саламандер', 'камелот', 'игуана', 1, 0, 0, 0, 0, 'Unlike other animals that change color, such as the squid and octopus, chameleons do not modify their hues by accumulating or dispersing pigments within their skin cells, the researchers found. Instead, the lizards rely on structural changes that affect how light reflects off their skin, the researchers said.', NULL, 'John Doe', NULL, 1, '2020-03-30 00:23:05'),
(2219, 4, 1, 'Ако графитот е еден од најмеките минерали на Земјата,|кој друг има ист состав како графитот, а е најцврст?', 'лорандит', 'кварц', 'дијамант', 'рубин', 3, 7, 3, 0, 0, 'Графитот и дијамантот се направени од јаглеродни атоми, но тие се меѓусебно различни во поврзувањето на овие атоми. Дијамантските атоми се поврзани со тридимензионална структура и целиот кристал е огромна молекула. Во овој кристал, атомите се врзани со силни врски, па дијамантот е најсилен од сите минерали.', '', 'John Doe', '', 1, NULL),
(2220, 6, 1, 'На кој историски лик е портретот на|насловната страна на „Малата црвена книга“?', 'Пол Пот', 'Хо Ши Мин', 'Мао Це Тунг', 'Фидел Кастро', 3, 0, 0, 0, 0, 'Quotations from Chairman Mao Tse-tung is a book of statements from speeches and writings by Mao Zedong, published from 1964 to about 1976 and widely distributed during the Cultural Revolution. The most popular versions were printed in small sizes that could be easily carried and were bound in bright red covers, becoming commonly known in the West as the Little Red Book.', NULL, 'John Doe', NULL, 1, NULL),
(2221, 5, 1, 'Која држава има знаме каде жолтата боја ја претставува пченицата,|зелената шумата, а црвената крвта пролиена во борбите за татковината?', 'Латвија', 'Литванија', 'Романија', 'Бугарија', 2, 2, 1, 0, 0, 'Латвија-црвено,бело,цвено; Литванија-жолта,зелена,црвена; Романија-сина,жолта,црвена', NULL, 'John Doe', NULL, 1, '2020-03-20 20:18:11'),
(2222, 7, 1, 'Тоа за кое Енио Мориконе е за филмовите на Серџо Леоне,|Анџело Бадаламенти е за филмовите на...', 'Џим Џармуш', 'Дејвид Финчер', 'Кристофер Нолан', 'Дејвид Линч', 4, 9, 0, 0, 0, 'Angelo Badalamenti (1937) is an American composer, best known for his work scoring films for director David Lynch, notably Blue Velvet, the Twin Peaks saga, The Straight Story and Mulholland Drive. Badalamenti received the 1990 Grammy Award for Best Pop Instrumental Performance for his \"Twin Peaks Theme\", and has received a Lifetime Achievement Award from the World Soundtrack Awards and the Henry Mancini Award from the American Society of Composers, Authors and Publishers.', NULL, 'John Doe', NULL, 1, NULL),
(2223, 6, 1, 'На кој јазик зборот „wiki“ значи „брзо“?', 'маорски', 'ирски', 'хавајски', 'шведски', 3, 5, 3, 0, 0, 'The term \"wiki\" comes from the Hawaiian phrase, \"wiki wiki,\" which means \"super fast.\"', NULL, 'John Doe', NULL, 1, NULL),
(2224, 6, 1, 'Која постапка не е наречена по оној кој ја измислил?', 'галванизација', 'месмеризација', 'вакцинација', 'дагеротипија', 3, 7, 0, 0, 0, 'Smallpox vaccine, the first successful vaccine to be developed, was introduced by Edward Jenner in 1796. Masmerism is the therapeutic system of F. A. Mesmer. Galvanization is the process of applying a protective zinc coating to steel or iron, to prevent rusting. It was named in English via French from the name of Italian scientist Luigi Galvani. The Daguerreotype process was the first publicly available photographic process invented by Louis-Jacques-Mandé Daguerre.', NULL, 'John Doe', NULL, 1, '2020-03-25 19:10:04'),
(2225, 7, 1, 'Под кој прекар бил познат убиецот|во романот „Авантурите на Том Соер“?', 'Дебелиот Бак', 'Црвениот Џо', 'Валканиот Џон', 'Стариот Лук', 2, 4, 2, 0, 0, 'After Tom Sawyer witnesses the murder of Doctor Robinson and the framing of Muff Potter, Huck Finn overhears Injun Joe plotting the mutilation of Widow Douglas. Towards the end of the book, Tom sees Injun Joe inside the cave, but Injun Joe is unable to see Tom''s face.', '', 'John Doe', '', 1, '2020-01-06 15:13:12'),
(2226, 5, 1, 'Како Италијанците го нарекуваат кодот на честа чија|главна одлика е важноста на молкот?', 'баста', 'ора', 'фермата', 'омерта', 4, 5, 5, 0, 0, 'Omertà is a code of honor that places importance on silence, non-cooperation with authorities, and non-interference in the illegal actions of others. It originated and remains common in Southern Italy, where banditry or brigandage and Mafia-type criminal organizations are strong.', NULL, 'John Doe', NULL, 1, '2020-03-25 18:42:44'),
(2227, 4, 1, 'Кој е насловот на ремек делото на|Публија Овидија Назон?', 'Метаморфози', 'Реформи', 'Рецесии', 'Приватизации', 1, 4, 4, 0, 0, 'Публије Овидије Назон био је један од тројице најпознатијих песника Августовог доба, такозваног златног века римске књижевности — поред Хорација и Вергилија. Најбоље и највеће дело су му Metamorphoses u 15 књига. Овај низ етиолошких легенди, који почињо оријенталним и грчким мотивима и завршава апотеозом Јулија Цезара, даје према узору александријског песника Калимаха, објашњења преображајима разних митских личности. ', '', 'John Doe', '', 1, '2020-03-08 16:01:06'),
(2228, 6, 1, 'Која битка во Втората светска војна, траела|5 месеци, 1 седмица и 3 дена?', 'Битката кај Курск', 'Московската битка', 'Севастополската опсада', 'Сталинградската битка', 4, 3, 1, 0, 0, 'Сталинградската битка е најкрвавата битка во историјата на човештвото. Таа се водела во градот Сталинград, денешен Волгоград, во југозападна Русија, помеѓу Советскиот Сојуз и Нацистичка Германија, во периодот од 28 јули 1942 до 2 февруари 1943, кога се случувале најголемите пресвртници во Втората Светска Војна.', NULL, 'John Doe', NULL, 1, NULL),
(2229, 5, 1, 'Џон Белуши го глуми Џејк Блус, а Ден Акројд|неговиот брат...', 'Елвуд', 'Елрој', 'Елвис', 'Елиот', 1, 8, 3, 0, 0, 'The Blues Brothers Band continues to tour today, both with and without Aykroyd. The band features original members Cropper and Marini, along with vocalist Eddie Floyd. Aykroyd sometimes performs as Elwood, along with Belushi''s younger brother Jim Belushi, who plays \"Brother Zee\" on stage. They are most frequently backed by The Sacred Hearts Band.', NULL, 'John Doe', NULL, 1, '2020-03-25 18:40:41'),
