(2231, 4, 1, 'Кој е целосниот назив на ТВ-серијата|чиј поштенски број е 90210?', 'Округот Оринџ', 'Беверли Хилс', 'Мелроуз Плејс', 'Округот Доусон', 2, 20, 1, 0, 0, 'The show follows the lives of a group of friends living in the upscale and star-studded community of Beverly Hills, California as they transition from high school to college and into the adult world. The \"90210\" in the title refers to one of the city''s five ZIP codes.', NULL, 'John Doe', NULL, 1, NULL),
(2232, 4, 1, 'Што треба крвната група А+ да избегнува|според популарната исхрана по крвни групи?', 'кромид и праз', 'скуша и сардина', 'говедско и свинско', 'лимони и цитрони', 3, 7, 2, 0, 0, 'D''Adamo recommends that people with type A blood eat plenty of fish, including salmon, sea or rainbow trout, red snapper, cod and mackerel. Chicken and poultry can be eaten up to two times a week, but D''Adamo says to avoid all beef, pork, game meats and shellfish.', NULL, 'John Doe', NULL, 1, '2020-03-25 19:20:56'),
(2233, 5, 1, 'Кралот на која монархија|припаѓа на династијата Бурбон?', 'Обединето Кралство', 'Шпанија', 'Норвешка', 'Данска', 2, 3, 1, 0, 0, 'Felipe VI (born 30 January 1968) is the King of Spain. He ascended to the throne on 19 June 2014 following the abdication of his father, King Juan Carlos I. His full baptismal name, Felipe Juan Pablo Alfonso de Todos los Santos, consists of the names of the first Bourbon King of Spain (Felipe V), his grandfathers (Infante Juan of Spain and King Paul of Greece), his great-grandfather King Alfonso XIII of Spain, and de Todos los Santos as is customary among the Bourbons.', NULL, 'John Doe', NULL, 1, '2020-03-07 16:46:55'),
(2234, 5, 1, '„Секој има добар план додека не го добие првиот|удар по глава!“, е позната реченица на...', 'Доналд Трамп', 'Никола Тесла', 'Мајк Тајсон', 'Хари Труман', 3, 4, 5, 0, 0, 'When Mike Tyson was asked by a reporter whether he was worried about Evander Holyfield and his fight plan he answered; “Everyone has a plan until they get punched in the mouth.”', NULL, 'John Doe', NULL, 1, NULL),
(2235, 6, 1, 'Што лебди пред лицето на господинот во костум|насликан од Рене Магрит во „Синот на човекот“?', 'портокал', 'банана', 'јаболко', 'ананас', 3, 1, 1, 0, 0, 'The Son of Man is a 1964 painting by the Belgian surrealist painter René Magritte. Magritte painted it as a self-portrait. The painting consists of a man in an overcoat and a bowler hat standing in front of a low wall, beyond which is the sea and a cloudy sky. The man''s face is largely obscured by a hovering green apple. However, the man''s eyes can be seen peeking over the edge of the apple. Another subtle feature is that the man''s left arm appears to bend backwards at the elbow.', NULL, 'John Doe', NULL, 1, NULL),
(2236, 6, 1, 'Која владетелска куќа станала царство со|обединувањето на Германија во 1871 година?', 'Хабсбург', 'Вителсбах', 'Хохенцолерн', 'Закс-Кобург', 2, 3, 1, 0, 0, 'When the German Empire was formed in 1871, Bavaria became the new empire''s second most powerful state after Prussia. The Wittelsbachs reigned as kings of Bavaria until 1918. On 12 November 1918 Ludwig III issued the Anif declaration (Anifer Erklärung) at Anif Palace, Austria, in which he released his soldiers and officials from their oath of loyalty to him and ended the 738-year rule of the House of Wittelsbach in Bavaria.', NULL, 'John Doe', NULL, 1, NULL),
(2237, 4, 1, 'Која природна наука е позната и|под името фитологија?', 'генетика', 'лингвистика', 'ботаника', 'аритметика', 3, 7, 2, 0, 0, 'Науката што ги проучува растенијата се нарекува ботаника (или многу поретко нарекувана и фитологија).', NULL, 'John Doe', NULL, 1, NULL),
(2238, 6, 1, 'Покрај текила, од агава се произведува...', 'аквавит', 'тентура', 'мескал', 'патксаран', 3, 19, 5, 0, 0, 'Mezcal (or mescal) is a distilled alcoholic beverage made from any type of agave plant native to Mexico. The word mezcal comes from Nahuatl mexcalli metl and ixcalli which means \"oven-cooked agave\".', NULL, 'John Doe', NULL, 1, '2020-01-18 13:28:27'),
(2239, 6, 1, 'Рој Шнајдер го глуми полицаецот Мартин Броди|во првите два дела на филмот...', 'Полициска академија', 'Смртоносно оружје', 'Ајкула', 'Француска врска', 3, 8, 7, 0, 0, 'Martin Brody was the Chief of Police on Martha''s Vineyard, Massachusetts and was portrayed by in a film adaption based on the Amity Incident in the film Jaws. Also appeared in the sequel, Jaws 2.', '', 'John Doe', '', 1, '2020-01-06 15:10:49'),
(2240, 4, 1, 'Под кој назив е уште познат сосот бешамел?', 'бел сос', 'црвен сос', 'зелен сос', 'шарен сос', 1, 19, 7, 0, 0, 'Béchamel sauce also known as white sauce, is made from a white roux (butter and flour) and milk. It is, since the seventeenth century and on, one of the mother sauces of French cuisine.', NULL, 'John Doe', NULL, 1, NULL),
(2241, 5, 1, 'Преку што лекува лудотерапијата?', 'пишување', 'цртање', 'играње', 'викање', 3, 7, 2, 0, 0, 'During the treatment sessions the child is given the opportunity to release their feelings and problems through play. It is the same as adult therapy, where he solves problems through speech. But in play therapy the child has the toy and the play to express their feelings. The therapy can be done individually or in a group.', NULL, 'John Doe', NULL, 1, '2020-01-18 13:34:25'),
(2242, 7, 1, 'Кој е главен лик во романот|„Портрет на уметникот во младоста“?', 'Атикус Финч', 'Стивен Дедалус', 'Холден Колфилд', 'Семјуел Пиквик', 2, 4, 2, 0, 0, 'A Portrait of the Artist As a Young Man - роман на ирскиот писател Џејмс Џојс од 1916 година. Романот се состои од пет глави во кои е опишано созревањето на главниот лик, Стивен Дедалус.', NULL, 'John Doe', NULL, 1, NULL),
(2243, 5, 1, 'Кои припадници на ''рбетниците имаат најмногу врсти?', 'рибите', 'цицачите', 'водоземците', 'птиците', 1, 12, 4, 0, 0, 'Po broju vrsta ribe su najveća grupa kičmenjaka jer ih ima približno koliko i svih ostalih uzetih zajedno (kružnouste, vodozemci, gmizavci, ptice i sisari).', NULL, 'John Doe', NULL, 1, NULL),
(2244, 7, 1, 'На кои браќа дедо им бил кралот Нумитор?', 'Кастор и Полукс', 'Тибериј и Гај Грак', 'Ромул и Рем', 'Хектор и Парис', 3, 10, 2, 0, 0, 'Numitor Silvius king of Alba Longa, a descendant of Aeneas , the father of Rhea Silvia and the grandfather of the legendary founders of Rome - the twins Romulus and Remus.', NULL, 'John Doe', NULL, 1, '2020-01-04 15:04:59'),
(2245, 6, 1, 'Која историска личност го започнала и завршила|својот живот на остров?', 'Франц Фердинанд', 'Џордано Бруно', 'Сократ', 'Наполеон Бонапарт', 4, 3, 1, 0, 0, 'Наполеон e роден на 15 август 1769 г. во Ајачо, на островот Корзика и e крстен како Наполеонe ди Бонапарте (во Франција неговото име станало Наполеон Бонапарт. Наполеон бил протеран на островот Света Елена. Толку бил голем поразот на Наполеон, што Ватерло останал како синоним за огромен пораз. Тој бил прогонет на Св. Елена, изолиран остров во југот на Атлантскиот Океан, каде останал до неговата смрт на 5 мај 1821.', '', 'John Doe', '', 1, NULL),
(2246, 4, 1, 'Колку месеци има во два квартали?', 'шест', 'осум', 'десет', 'дванаесет', 1, 6, 2, 0, 0, 'Четвртина од годината, период од три месеца. кварт.', NULL, 'John Doe', NULL, 1, NULL),
(2247, 3, 1, 'Од колку нули се состои бројот десет милијарди?', '8', '10', '12', '14', 2, 6, 1, 0, 0, '10 000 000 000 (1милијарда = 1 000 000 000)', NULL, 'John Doe', NULL, 1, NULL),
(2248, 4, 1, 'Од каде потекнува расата на кучиња пекинезер?', 'Монголија', 'Кина', 'Јапонија', 'Русија', 2, 12, 1, 0, 0, 'Пекинезер е раса на кучиња која води порекло од Кина, поточно од Пекинг по кој го добил името. Расата е стара преку 2000 години, но биле чувани тајно единствено во кинеската царска палата. Дури во 19 век се појавиле во западната цивилизација.', NULL, 'John Doe', NULL, 1, '2020-02-09 20:25:31'),
(2249, 4, 1, 'Која од наведениве земји не е дел од унијата|од три земји наречен Бенелукс?', 'Белгија', 'Холандија', 'Луксембург', 'Лихтенштајн', 4, 2, 2, 0, 0, 'Бенелукс е економска унија во Западна Европа составена од три земји членки. Таму релјефот е претежно низински. Само во јужниот дел на Белгија и Луксембург е повисок. Бенелукс е составена држава од три земји: Белгија, Холандија и Луксембург.', NULL, 'John Doe', NULL, 1, NULL),
(2250, 6, 1, 'Како се вика римскиот бог кој има две лица?', 'Вулкан', 'Бахус', 'Јанус', 'Квирин', 3, 10, 2, 0, 0, 'Јанус првобитно бил почитуван како римски бог на сонцето а подоцна: бог на годината, на војната и мирот, на времето и на секој почеток при што бил именуван и првиот месец на годината, јануари. Јанус бил чувар на вселената и присуствувал во раѓањето на секое човечко суштество. Бил претставуван со жезол во десната рака, со клуч во левата, и со две лица: едно младешко, што гледало напред, во иднината, и едно старо, што гледало назад, во минатото. Храмот што му бил посветен нему во време на мир бил затворен, а во време на војна секогаш бил отворен.', NULL, 'John Doe', NULL, 1, '2020-03-14 15:30:49'),
(2251, 6, 1, 'Кој бил последниот цар кој владеел со Етиопија пред да|биде турнат од марксистичко-ленинистичката хунта?', 'Жилберт Хунгбо', 'Роберт Мугабе', 'Лесие Трети', 'Хаиле Селасие', 4, 3, 4, 0, 0, 'Хајле Селасије I је био последњи етиопски цар. Селасије је 1928. после смрти Менелика II постао краљ, а 1930. цар Етиопије.', NULL, 'John Doe', NULL, 1, '2020-02-29 19:35:39'),
(2252, 5, 1, 'Како се вика авторот на романот|„Гуливеровите патувања“?', 'Џек Лондон', 'Џонатан Свифт', 'Џејмс Џонс', 'Џорџ Бернард Шо', 2, 4, 1, 0, 0, 'Гуливер кој е лекар на брод кој плови по Тихиот Океан за Источна Индија. Гуливеровите патувања (англиски: Gulliver''s Travels) е роман напишан од Џонатан Свифт.', NULL, 'John Doe', NULL, 1, '2020-03-22 18:47:44'),
(2253, 5, 1, 'Која држава од 2014 се повлече од групацијата G8,|со што новиот називот е променет во G7?', 'Франција', 'Италија', 'Русија', 'Германија', 3, 15, 0, 0, 0, 'The forum originated with a 1975 summit hosted by France that brought together representatives of six governments: France, Germany, Italy, Japan, the United Kingdom, and the United States, thus leading to the name Group of Six or G6. The summit came to be known as the Group of Seven, or G7, in 1976 with the addition of Canada. Russia was added to the political forum from 1997, which the following year became known as the G8. In March 2014 Russia was suspended following the annexation of Crimea, whereupon the group''s name reverted to the G7.[6][7][8] Certain representatives of G7 countries stated that they would be interested in Russia''s return to the group.[9][10][11][12][13][14] However in 2017 Russia announced that it would permanently leave the political forum G8. [15] The European Union was represented at the G8 since the 1980s as a \"nonenumerated\" participant, but originally could not host or chair summits.', '', 'John Doe', '', 1, '2020-03-07 16:49:03'),
(2254, 3, 1, 'Колку е 1/5 од 25% од 10?', '1/4', '1/2', '1', '2', 2, 6, 1, 0, 0, '25% од 10 = 2.5   1/5 од 2.5 = 0.5=1/2', NULL, 'John Doe', NULL, 1, NULL),
(2255, 2, 1, 'Што е секој ученик барем еднаш неделно|во текот на школската година?', 'телохранител', 'командир', 'дежурен', 'адмирал', 3, 13, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2256, 3, 1, 'Кое име на куче го „носи“ најголемиот|северноамерикански полустров?', 'Лабрадор', 'Ретривер', 'Боксер', 'Териер', 1, 2, 2, 0, 0, 'The Labrador Peninsula is a large peninsula in eastern Canada. It is bounded by the Hudson Bay to the west, the Hudson Strait to the north, the Labrador Sea to the east, and the Gulf of Saint Lawrence to the southeast. The peninsula includes the region of Labrador, which is part of the province of Newfoundland and Labrador, and the regions of Saguenay–Lac-Saint-Jean, Côte-Nord, and Nord-du-Québec, which are in the province of Quebec.', '', 'John Doe', '', 1, '2020-02-08 18:22:03'),
(2257, 8, 1, 'Кој бил бог на филијстејскиот град Екрон,|а подоцна поглавар на сите зли духови?', 'Билзебуб', 'Мардук', 'Атон', 'Шамаш', 1, 11, 1, 0, 0, 'Beelzebub or Beelzebul is a name derived from a Philistine god, formerly worshipped in Ekron, and later adopted by Abrahamic religions as a given name to a major demon. The name Beelzebub is associated with the Canaanite god Baal.', NULL, 'John Doe', NULL, 1, '2020-01-18 19:32:51'),
(2258, 4, 1, 'Која крвна група е „универзален примател“?', 'A', 'B', 'AB', '0', 3, 7, 2, 0, 0, 'Единките со крвна група AB ги поседуваат и двата антигена (А и В) на мембраната на нивните еритроцити, и нивниот крвен серум не содржи антитела кои би се бореле против А или В антигенот. Според ова, единка со крвна група АВ може да прима крв од било која друга крвна група (претпочитајќи АВ), но може да дава крв само на единки со крвна група АВ.', NULL, 'John Doe', NULL, 1, NULL),
(2259, 5, 1, 'Кој спорт го играше некогашниот|„господин“ Брус Џенер?', 'тенисер', 'боксер', 'пливач', 'атлетичар', 4, 20, 1, 0, 0, 'Caitlyn Marie Jenner, formerly known as Bruce Jenner, is an American television personality and retired Olympic gold medal-winning decathlete.', NULL, 'John Doe', NULL, 1, NULL),
(2260, 4, 1, 'Што во 17-ти век објавуваше Ла Фонтен, во|12 книги и се стекна со вечна слава? ', 'бајки', 'балади', 'брзозборки', 'басни', 4, 4, 1, 0, 0, 'Жан де Лафонтен (француски: Jean de La Fontaine; 8 јули 1621 - Париз, 13 април 1695) — прочуен француски баснописец и поет. Има напишано 240 басни. Тој е еден од најголемите писатели на францускиот класицизам. Се вбројува во редот на најпознатите баснописци во светската литература. ', NULL, 'John Doe', NULL, 1, NULL),
(2261, 5, 1, 'Која од овие реки се влева во|Мексикански Залив?', 'Мисисипи', 'Јангцекјанг', 'Енисеј', 'Хоангхо', 1, 2, 0, 0, 0, 'Јангцекјанг се влива во Источно Кинеско Море. Енисеј се влива во Карско Море. Хоангхо или Жолта река се влива во Бохајско Море. Мисисипи со Мисури се влива во Мексикански Залив', '', 'John Doe', '', 1, NULL),
(2262, 2, 1, 'Гласовно совпаѓање по звучност на крајните зборови|во стиховите се вика...', 'литота', 'метафора', 'рима', 'ритам', 3, 4, 4, 0, 0, 'Римувањето може да биде во повеќе комбинации, но основни се три: паралелно римување, крстосано римување и обградено римување.', NULL, 'John Doe', NULL, 1, '2020-01-06 15:05:09'),
(2263, 6, 1, 'Која година Индонезија официјално се ослободила|од Холандската власт?', '1909', '1929', '1949', '1969', 3, 3, 3, 0, 0, 'По холандскиот колонијализам кој траеше три ипол века, Индонезија ја обезбеди својата независност по Втората светска војна. Оттогаш индонезиската историја е турбулентна, со предизвици поставени од природни катастрофи, корупција, сепаратизам, процес на демократизација и периоди на брзи економски промени.Независност од Холандија: призната на 27 ноември 1949 ', NULL, 'John Doe', NULL, 0, NULL),
(2264, 3, 1, 'Кога се пее „а капела“, се пее без...', 'машки гласови', 'инструментална придружба', 'диригент', 'присуство на публика', 2, 9, 8, 0, 0, 'А капела (A cappella) е вокална музика или пеење без инструментална придружбa, или дело наменето да се изведува на овој начин. A cappella на италијански значи (музика) како во капела; терминот потекнува од ограничувањата за користење на инструменти во средновековните цркви.', NULL, 'John Doe', NULL, 1, '2020-02-16 14:34:46'),
(2265, 3, 1, 'Кој е творецот на периодниот систем на елементите?', 'Грегор Мендел', 'Дмитриј Менделеев', 'Антоан Лавоазје', 'Амедео Авогардо', 2, 7, 3, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-20 20:06:41'),
(2266, 4, 1, 'Која од овие должини е поголема од еден јард?', '25 cm', '50 cm', '75 cm', '1 m', 4, 6, 2, 0, 0, 'Eден јард е еднаков на 0,9144 метри или на 36 инчи. 1 јард = 91,4 cm', NULL, 'John Doe', NULL, 1, '2020-04-25 14:52:53'),
(2267, 5, 1, 'Која од следниве европски држави|е најгусто населена?', 'Белгија', 'Германија', 'Франција', 'Холандија', 4, 2, 1, 0, 0, 'Холандија, со 394 жители на кm², Белгија со 340, Велика Британија со 242, Германија со 231 жители на кm² итн. Голем број од државите, на пример, Франција, Унгарија, Чехија, Австрија, Полска, Данска, Романија итн., се одликуваат со густина на населеност од околу 100 жители на кm².', NULL, 'John Doe', NULL, 1, NULL),
(2268, 1, 1, 'Оној што се бунтува без причина, „крева...“?', 'среден прст', 'раце', 'врева за ништо', '300 на час', 3, 4, 5, 0, 0, '', NULL, 'John Doe', NULL, 0, NULL),
(2269, 5, 1, 'Композиторот Јохан Себастијан Бах едно свое дело|го посветил на...', 'румот', 'чоколадата', 'кафето', 'виното', 3, 9, 4, 0, 0, 'Schweigt stille, plaudert nicht (Be still, stop chattering), BWV 211, also known as the Coffee Cantata, is a secular cantata by Johann Sebastian Bach. He composed it probably between 1732 and 1735. Although classified as a cantata, it is essentially a miniature comic opera. In a satirical commentary, the cantata amusingly tells of an addiction to coffee.', NULL, 'John Doe', NULL, 1, NULL),
(2270, 2, 1, 'Кој дел од кујнскиот прибор „му го позајмува“| името на еден дел од цветот?', 'тава', 'толчник', 'ренде', 'сатар', 2, 19, 7, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-02-16 14:25:58'),
(2271, 2, 1, 'Што настанува по смирување на ветрот,|кога брановите во морето немаат одредена насока?', 'бело море', 'црвено море', 'жолто море', 'мртво море', 4, 2, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-27 19:25:58'),
(2272, 5, 1, 'Која република по површина во цел свет е најмала,|дури три пати помала од Сан Марино?', 'Науру', 'Ватикан', 'Монако', 'Аруба', 1, 2, 1, 0, 0, 'Науру, официјално Република Науру, е островска држава во Микронезија, во Јужниот Пацифик. Науру е најмалата островска држава во светот, најмалата независна членка на Комонвелтот, најмалата независна република и единствената република без официјален главен град. ', NULL, 'John Doe', NULL, 1, NULL),
(2273, 5, 1, 'Што ќе „зготвите“ ако на калиум нитрат|додадете малку сулфур и јаглен?', 'син камен', 'динамит', 'сода бикарбона', 'барут', 4, 7, 3, 0, 0, 'Барут е лесно запална смеса од калиумов нитрат (KNO3), дрвен јаглен и сулфур. Според тежина овие 3 составни делови постојат во однос 15:3:2. Со палењето на барут, во самата хемиска реакција, тој ослободува гасови кој дејствуваат како гориво при експлозијата.', '', 'John Doe', '', 1, NULL);
