(2274, 6, 1, 'Која сопруга на Хенри VIII била мајка на|кралицата Елизабета I?', 'Џин Сејмур', 'Ен Болеин', 'Катарина Хауард', 'Катарина Пар', 2, 3, 1, 0, 0, 'Anne Boleyn (c. 1501 – 19 May 1536) was Queen of England from 1533 to 1536 as the second wife of King Henry VIII. Henry''s marriage to her, and her subsequent execution by beheading, made her a key figure in the political and religious upheaval that was the start of the English Reformation. On 7 September, she gave birth to the future Queen Elizabeth I.', '', 'John Doe', '', 1, NULL),
(2275, 5, 1, 'Кое четириножно животно е родено|во имагинацијата на Феликс Салтен?', 'Бамби', 'Леси', 'Наполеон', 'Аслан', 1, 4, 2, 0, 0, 'Napoleon is a fictional character and the main antagonist in George Orwell''s Animal Farm. Aslan is the main character in C. S. Lewis''s The Chronicles of Narnia series. Lassie is created by Eric Knight. Bambi is a 1942 American animated film produced by Walt Disney and based on the book Bambi, a Life in the Woods by Austrian author Felix Salten. ', NULL, 'John Doe', NULL, 1, '2020-01-06 15:07:48'),
(2276, 6, 1, 'Од колку вкупно слогови се состои|една хаику песна?', '17', '19', '21', '23', 1, 4, 4, 0, 0, 'Хаику е вид јапонска поема која обично ја опишува природата и исто така содржи мошне емотивна перспектива. Хаикуто и неговите творци се свртени кон ситните, обичните, речиси безначајните нешта, и тоа најчесто нешта кои се дел од природата, нејзините феномени и процеси. Хаику се состои од 3 стихови и 17 слогови. Во првиот стих се користат 5 слогови во вториот стих се користат 7 слогови и во последниот стих се користат 5 слогови (формата е 5-7-5). Ваквата структура прилично го отежнува процесот на преведување на хаику во други јазици, но ова не е најбитно и понекогаш се одбегнува во преведувањето на хаику.', NULL, 'John Doe', NULL, 1, '2020-01-16 21:10:31'),
(2277, 6, 1, 'Кој стрип јунак како свој помошник|„вработил“ сираче од акробатска трупа?', 'Загор', 'Супермен', 'Дилан Дог', 'Бетмен', 4, 4, 2, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-22 18:38:29'),
(2278, 7, 1, 'Легендата за Летечкиот Холанѓанец,|кој носи зла коб на бродовите, е поврзана за...', '`ртот Добра Надеж', '`ртот Хорн', 'Зелениот ’рт', '`ртот Тарифа', 1, 3, 1, 0, 0, 'Ukleti Holandez (Flying Dutchman) je ukleti brod koji nikada ne može doći u matičnu luku nego mora ploviti preko svih sedam mora zauvijek. Iako je doslovan prijevod Leteći Nizozemac, u Hrvatskoj se ustalio naziv Ukleti Holandez ili Leteći Holandez. Plovio je na ruti od Europe do Indije i kada je prolazio kraj rta Dobre nade najjuznija zapadna točka Afrike zapao je u oluju.', NULL, 'John Doe', NULL, 1, NULL),
(2279, 7, 1, 'Како би се нарекла куклата Барби|ако е именувана по изумителот?', 'Џоун', 'Рут', 'Сузи', 'Гвен', 2, 20, 0, 0, 0, 'Barbie is a fashion doll manufactured by the American toy company Mattel, Inc. and launched in March 1959. American businesswoman Ruth Handler is credited with the creation of the doll using a German doll called Bild Lilli as her inspiration. Ruth Handler watched her daughter Barbara play with paper dolls, and noticed that she often enjoyed giving them adult roles. At the time, most children''s toy dolls were representations of infants. Realizing that there could be a gap in the market, Handler suggested the idea of an adult-bodied doll to her husband Elliot, a co-founder of the Mattel toy company. He was unenthusiastic about the idea, as were Mattel''s directors.', NULL, 'John Doe', NULL, 1, NULL),
(2280, 9, 1, 'На кој значаен датум е роден|Форест Гамп?', '29 октомври 1929', '1 септември 1939', '6 јуни 1944', '4 октомври 1957', 3, 8, 1, 0, 0, 'The Normandy landings were the landing operations on Tuesday, 6 June 1944 of the Allied invasion of Normandy in Operation Overlord during World War II. Codenamed Operation Neptune and often referred to as D-Day, it was the largest seaborne invasion in history.', '', 'John Doe', '', 1, NULL),
(2281, 8, 1, 'Кој е најголем град во државата|каде Јамусукро е главен град?', 'Акра', 'Абиџан', 'Асмара', 'Абуја', 2, 2, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2282, 9, 1, 'Кој папа почина за време на|Вториот ватикански концил?', 'Павле VI', 'Јован XXIII', 'Јован Павле I', 'Пио XII', 2, 11, 1, 0, 0, 'Pope John XXIII did not live to see the Vatican Council to completion. He died on 3 June 1963, four and a half years after his election and two months after the completion of his final and famed encyclical, Pacem in terris.', NULL, 'John Doe', NULL, 1, NULL),
