(2285, 6, 1, 'Кој сограѓанин го глумеше Мајкл Шин во филмовите|„Договор“, „Кралица“ и „Посебна врска“?', 'Винстон Черчил', 'Вилијам Шекспир', 'принцот Чарлс', 'Тони Блер', 4, 8, 2, 0, 0, 'Sheen has become better known as a screen actor since the 2000s, in particular through his roles in various biopics. With writer Peter Morgan, he has starred in a trilogy of films as British politician Tony Blair: the television film The Deal in 2003, followed by The Queen (2006) and The Special Relationship (2010)', NULL, 'John Doe', NULL, 1, '2020-01-04 15:15:50'),
(2286, 4, 1, 'Микеланџело Мериси на љубителите на сликарството|им е познат како...', 'Карпачо', 'Кореџо', 'Караваџо', 'Каналето', 3, 1, 2, 0, 0, 'Микеланџело Мериси, подоцна наречен Караваџо е роден на 29 септември 1571, во местото Караваџо во близина на Бергамо, во семејството Ферма, имал помлад брат кој станал свештеник. Детството го минал во Милано, но кугата повторно го вратила семејствтвото во Караваџо. По смртта на Сфорца, семејството на Караваџо почнува да живее во сиромаштија. Првиот контакт со сликарството Караваџо го остварува во Милано на 13 години, во 1584., кога доаѓа кај малку познатиот ученик на Тицијан, Симоне Петерцана.', NULL, 'John Doe', NULL, 1, NULL),
