(2298, 6, 1, 'Како се вика словенската божица на|зимата, осветата и смртта?', 'Морана', 'Лада', 'Весна', 'Маја', 1, 10, 0, 0, 0, 'Морена, Морана, Мора, Марзана — слoвенска божица на зимата и смртта, како и на пролетта. Морана божество чиј карактер различно се претставува кај различни групи на словенски народи: кај источнословенските народи е божица на пролетта. А кај јужнословенските како аграрно-сточарско божество. Според другите толкувања таа е зло божество на зимата и смртта, но воедно е и божество кое се врзува за обреди кои донесуваат дожд и кружно движење во природата, каде се потенцираат и умирањето, но и воскреснувањето на божествата.', NULL, 'John Doe', NULL, 1, NULL),
(2299, 4, 1, 'Која северноевропска држава не е членка на|Европската Унија?', 'Шведска', 'Норвешка', 'Данска', 'Финска', 2, 15, 1, 0, 0, 'Норвешка, Сан Марино, Андора, Лихтенштајн, Ватикан, Монако и Швајцарија не се членки, но имаат посебни договори со ЕУ.', '', 'John Doe', '', 1, '2020-03-14 15:38:57'),
