(2303, 6, 1, 'Јура е ерата на диносаурсите. Која е ерата на рибите|во која доаѓа до експлозија на голем број видови риби?', 'девон', 'квартар', 'камбријум', 'тријас', 3, 2, 7, 0, 0, 'The evolution of fish began about 530 million years ago during the Cambrian explosion. It was during this time that the early chordates developed the skull and the vertebral column, leading to the first craniates and vertebrates. ', NULL, 'John Doe', NULL, 1, NULL),
(2304, 7, 1, 'Кој роман завршува со филозофската реченица:|„Ние мора да ја обработуваме нашата градина“?', 'Чичко Горио', 'Улис', 'Кандид', 'Робинзон Крусо', 3, 4, 4, 0, 0, 'Кандид или оптимизам (француски: Candide, ou l''Optimisme) или едноставно Кандид (француски: Candide) е сатиричен роман на францускиот писател и филозоф Волтер, напишана во 1759 година.[3] Во „Кандид“, Волтер заклучува дека оптимизмот не треба да се прифаќа некритички и го предлага познатиот принцип според којшто „ние мора да ја обработуваме нашата градина“, наместо Лајбницовата мисла дека „сè е најдобро во најдобриот од сите можни светови“. Денес, Кандид е препознатлив како Волтеровото magnum opus и често се вбројува во западниот канон. Тоа е веројатно најизучуваното дело од француската литература.', NULL, 'John Doe', NULL, 1, NULL),
(2305, 3, 1, 'За кого животот е посветен првенствено на уживање?', 'алтруистите', 'хедонистите', 'нихилистите', 'идеалистите', 2, 4, 6, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2306, 4, 1, 'По кого е наречен грегоријанскиот календар?', 'по цар', 'по морепловец', 'по папа', 'по астроном', 3, 11, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-04-04 13:28:17'),
(2307, 5, 1, 'На кој јазик зборувал Заратустра во филозофскиот|роман „Така зборуваше Заратустра“?', 'германски', 'персијски', 'англиски', 'хебрејски', 1, 4, 2, 0, 0, '', '', 'John Doe', '', 1, NULL),
(2308, 3, 1, 'Кога нешто е формирано само за една прилика,|тоа е направено...', 'ад акта', 'ад хок', 'ад астра', 'ад либитум', 2, 5, 3, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-04-16 15:42:29'),
(2309, 5, 1, 'Рубин Картер, трагичниот боксерски играч кој е опеан|од Боб Дилан, во рингот е попознат како...', 'Cinderella Man', 'Hurricane', 'Pretty Boy', 'The Greatest', 2, 14, 0, 0, 0, 'Rubin \"Hurricane\" Carter (1937 – 2014) was a middleweight boxer who was wrongfully convicted of murder[1] and later released following a petition of habeas corpus after spending almost 20 years in prison. Carter''s autobiography, titled The Sixteenth Round, which he wrote while he was in prison, was published in 1975 by Warner Books. The story inspired the 1975 Bob Dylan song \"Hurricane\" and the 1999 film The Hurricane (with Denzel Washington playing Carter). From 1993 to 2005, Carter served as executive director of the Association in Defence of the Wrongly Convicted.', NULL, 'John Doe', NULL, 1, NULL),
(2310, 4, 1, 'Кој филм со Мет Дејмон во улога на|поранешен оперативец на CIA не постои?', 'Борновиот идентитет', 'Борновото враќање', 'Борновата надмоќ', 'Борновиот ултиматум', 2, 8, 5, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-02-29 19:23:52'),
(2311, 8, 1, 'Пред приближно колку години настанал|свемирот според Теорија на Биг Бенг?', '3,17 милијарди години', '7,13 милијарди години', '13,7 милијарди години', '17,3 милијарди години', 3, 7, 5, 0, 0, 'Po teoriji Velikog praska (eng. Big Bang), svemir se prije (prema posljednjim istraživanjima) 13,8 milijardi godina počeo širiti iz točke neizmjerne gustoće, te se nastavio širiti do danas. Ova teorija, za razliku od suparničkih teorija, obuhvaća koncepte mijenjanja i evolucije svemira, te je zato jedina u stanju objasniti pojave kao što su Hubbleov zakon, kozmičko mikrovalno pozadinsko zračenje i omjeri lakih elemenata u svemiru. Otac teorije je katolički svećenik Georges Lemaître.', '', 'John Doe', '', 1, NULL),
(2312, 7, 1, 'Која држава досега никогаш не била домаќин|на ОИ, а има освоено најмногу олимписки медали?', 'Куба', 'Унгарија', 'Полска', 'Романија', 2, 14, 0, 0, 0, 'December 2017', '', 'John Doe', '', 1, NULL),
