(2314, 8, 1, 'Кој бил на чело на Египет додека таа држава|била во состав на Османското Царство?', 'беглербег', 'везир', 'калиф', 'кедив', 4, 3, 4, 0, 0, 'Кедив (перс. Khidiw‎ господар) је титула у турском царству, почасни назив за највише државне достојанственике. То је била службена тутула коју је Порта дала египатском намеснику Исмаил-паши 1867. године и коју су његови наследници Тафик-паша и Абаз II. Хилми носили до укидања турског суверенитета над Египтом 1914. године. Замењена је титулом султана 1914. када је Египат постао британски протекторат.', '', 'John Doe', '', 1, '2020-03-10 19:06:34'),
