(2318, 7, 1, 'Каде Тони Монтана ја започнува криминалната|кариера во филмот „Лице со лузна“?', 'Сицилија', 'Менхетен', 'Флорида', 'Филипини', 3, 8, 5, 0, 0, 'Лице со лузна (анг. Scarface) e американски филм од 1983. режиран од Брајан де Палма, додека приказната ја напишал Оливер Стоун. Филмот го следи искачувањето и падот на гангстерот Тони Монтана, кој како сиромашен кубански имигрант доаѓа во Флорида и започнува да гради криминална кариера, полека преземајќи ја локалната трговија со дрога. Како инспирација послужил истоимениот филм од 1932. базиран на животот на Ал Капоне, злогласниот американски гангстер кој имал прекар „Лице со лузна“. Филмот стекна голема популарност и стана елемент од поп културата. Неговите делови често се пародираат и спомнуваат во другите филмови, серии и песни. Особено е популарен помеѓу припадниците на генгста рап субкултурата. Серијата видеоигри Grand Theft Auto исто така е инспирирана од филмот и содржи бројни референци од ликот на Тони. Во 2006 год. излезе видеоиграта Scarface: The World is Yours.', NULL, 'John Doe', NULL, 1, NULL),
(2319, 6, 1, 'Кој албум на групата Green Day на насловната|има рака која стиска граната во облик на срце?', 'American Life', 'American Pie', 'American Idiot', 'American Woman', 3, 9, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2320, 7, 1, 'На кој град автохтоното име на латински јазик|содржи 168 букви?', 'Пекинг', 'Бенгкок', 'Њу Делхи', 'Кабул', 2, 2, 3, 0, 0, 'Ceremonijalno ime grada Bangkoka na tajskom jeziku u transkribiranom obliku glasi: Krung Thep Maha Nakhon Amon Rattanakosin Mahinthara Yutthaya Mahadilok Phop Noppharat Ratchathani Burirom Udom Ratchaniwet Maha Sathan Amon Phiman Awatan Sathit Sakkathattiya Witsanukam Prasit (O ovom zvuku izgovor?/i). To je stari tajski naziv za tajlandski glavni grad Bangkok, i u latiniziranom obliku sa 168 slova je najduže ime grada na svijetu. Na tajskom pismu ime glasi (139 znakova): กรุงเทพมหานคร อมรรัตนโกสินทร์ มหินทรายุธยามหาดิลก ภพนพรัตน์ราชธานีบุรีรมย์ อุดมราชนิเวศน์ มหาสถานอมรพิมาน อวตารสถิต สักกะทัตติยะ วิษณุกรรมประสิทธิ์', NULL, 'John Doe', NULL, 1, '2020-02-29 19:49:05'),
(2321, 4, 1, 'Што означува латинскиот збор altare|од кода потекнува зборот олтар?', 'стол', 'надморска височина', 'жртвеник', 'ниша', 3, 5, 3, 0, 0, 'žrtvenik Mesto prinošenja žrtve božanstvu, oltar. altar  (Homonym: alter). A raised structure on which gifts or sacrifices to a god are made. The table in Christian churches where communion is given; SYN. communion table, Lord''s table. ', NULL, 'John Doe', NULL, 1, NULL),
(2322, 6, 1, 'Која земја од областа Магреб во 1987 поднесе|службена пријава за членство во ЕУ?', 'Тунис', 'Алжир', 'Либија', 'Мароко', 2, 2, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2323, 7, 1, 'Обликувал бронзени фигури на млади атлети, а неговиот|„Копјеносец“ станал канон на грчкото скулпторство. Кој е тој?', 'Фидиј', 'Лизип', 'Мирон', 'Поликлет', 4, 1, 1, 0, 0, 'Поликлет (гр. Πολύκλειτος (Polýkleitos) бил грчки склуптор и теоретичар од Арга којшто влијаел на општеството помеѓу 460 и 420 година пред нашата ера. Тој во главно правел склуптури од бронза и тоа од атлети, кои според него биле со идеални пропорции на човечки тела, што подоцна стануваат и пример за кипарската антика. Самиот Поликлет во своите теоретски расправи дал мерка за складноста и композицијата на идеалните пропорции. Идеата за пресметани редови е применета низ целата античка грчка култура. Еден од законите на неговата теорија е дека во совршеното човечко тело мора да се состои 7 пати главата од истот тело. Пример за тоа е Дорифора или Копјеносец која што првенствено и оригинално била изработена во бронза, а римската копија се наоѓа во Помпеј, денес во Наполи). ', NULL, 'John Doe', NULL, 1, NULL),
(2324, 10, 1, 'Колку по ред претседатели |во историјата на САД наполниле 90 години?', '2', '3', '4', '5', 3, 3, 2, 0, 0, 'Џералд Форд, Џими Картер, Роналд Реган, Џорџ Х.В. Буш (93 години)', '', 'John Doe', '', 1, '2020-03-07 23:03:49'),
(2325, 8, 1, 'Кој од овие американски претседатели|не бил од демократската партија?', 'Милард Филмор', 'Мартин Ван Бјурен', 'Ендру Џексон', 'Џејмс Нокс Полк', 1, 3, 2, 0, 0, 'Милард Филмор (1800 — 1874) је био тринаести председник Сједињених Америчких Држава и на овом положају је био од 1850. до 1853. године. Био је последњи члан Виговске странке који је био председник САД. Мартин Ван Бјурен на власт 1782–1862 (Демократска), Ендру Џексон на власт 1767–1845 (Демократска) Џејмс Нокс Полк на власт 1795–1849 (Демократска)', NULL, 'John Doe', NULL, 1, NULL),
(2326, 9, 1, 'Нефелокоцигија е пракса на...', 'барање облици во облаци', 'спиење со отворени очи', 'кршење стакло со глас', 'пливање во замрзната вода', 1, 5, 3, 0, 0, 'Nephelococcygia (uncountable). The act of seeking and finding shapes in clouds. Most of us, at one time or another, have looked up to the clouds and imagined that we saw shapes that resembled things with which we were familiar. ', NULL, 'John Doe', NULL, 1, '2020-01-18 19:34:29'),
(2327, 9, 1, 'Познатиот Хрушчов  \"испад со чевлите\" во 1960 на ОН|беше одговор на делегат од која нација?', 'Австралија', 'Холандија', 'Филипини', 'Турција', 3, 3, 1, 0, 0, 'Nikita Khrushchev''s shoe-banging incident occurred during the 902nd Plenary Meeting of the United Nations General Assembly held in New York in 1960. During the session on 12 October, Khrushchev is said to have pounded his shoe on his delegate-desk in protest at a speech by Philippine delegate Lorenzo Sumulong.', 'ОН - Обединети Нации', 'John Doe', '', 1, '2020-03-24 19:36:07'),
(2328, 5, 1, 'Која од наведениве држави без излез на море|е целосно опкружена од друга држава?', 'Лесото', 'Буркина Фасо', 'Монголија', 'Луксембург', 1, 2, 3, 0, 0, 'Лесото (сото: Lesotho}}) или офиц. Кралство Лесото (Muso oa Lesotho) — независна земја во Јужна Африка и воедно е енклава бидејќи е целосно опкружена со Јужноафриканската Република. Големината на Лесото е околу 30.000 км2, со население од околу 1.800.000. Главен град на кралството е Масеру. Таа е најјужната независна држава во светот која не излегува на море. Лесото е член на Обединетите нации. Името Лесото потекнува од националниот јазик сесото и значи „земјата на луѓе кои зборуваат Сесото“. ', '', 'John Doe', '', 1, '2020-03-24 23:54:56'),
(2329, 9, 1, 'Што работел Семјуел Вилсон во војната од 1812,|на кого е базирана американската икона \"Чичко Сем\"?', 'инспектор за месо', 'историчар', 'поштар', 'механичар за оружје', 1, 3, 2, 0, 0, 'Samuel Wilson’s career role during the War of 1812 is what he is most noted for today. The demand for a supply of meat for the troops had significantly increased. E & S Wilson’s location and dock made the business ready and ideal. Samuel Wilson was appointed meat inspector for the Northern Army. His duties included checking the freshness of meat and assuring that it was properly packaged and that the barrels were according to specification.', NULL, 'John Doe', NULL, 1, '2020-03-23 19:15:31'),
(2330, 9, 1, 'Што чувале американските војници за време на II Светска војна,|во првите комерцијални аеросолни контејнери?', 'средство за чистење', 'инсектицид', 'антисептик', 'пена за бричење', 2, 3, 2, 0, 0, 'It was not until 1941 that the aerosol spray can was first put to good use by Americans Lyle Goodhue and William Sullivan, who are credited as the inventors of the modern spray can.[7][8] Their design of a refillable spray can dubbed the \"bug bomb\", is the ancestor of many popular commercial spray products. Pressurized by liquefied gas, which gave it propellant qualities, the small, portable can enabled soldiers to defend against malaria-carrying mosquitoes by spraying inside tents and airplanes in the Pacific during World War II.', NULL, 'John Doe', NULL, 1, '2020-03-10 18:50:51'),
(2331, 7, 1, 'Кој е заслужен за пронаоѓањето на|првиот масовно произведуван хеликоптер?', 'Игор Сикорски', 'Фердинанд фон Цепелин', 'Елмер Спери', 'Готлиб Дајмлер', 1, 7, 5, 0, 0, 'While Igor Sikorsky is undoubtedly the father of the modern helicopter, the history of the helicopter is said by many to have started with an ingenious drawing by 15th century painter and inventor, Leonardo da Vinci. Called the ornithopter flying machine, da Vinci’s 1488 design was never built, but it is said to have inspired modern day helicopters, and there is a suggestion that it inspired Sikorsky.', '', 'John Doe', '', 1, NULL),
(2332, 4, 1, 'Во која религија светите крави се навистина свети?', 'во будизмот', 'во исламот', 'во христијанството', 'во хиндуизмот', 4, 11, 0, 0, 0, 'Indijci smatraju da je bog Krišna činom dolaska na ovaj svet pokazao koliko zaista voli krave i koliko mu je stalo do njihove zaštite. U Indiji se veruje da, kada su bik i krava zadovoljni, da su i svi ljudi na svetu zadovoljni. Ukoliko dođe do ubistva krave, to može da prouzrokuje nevolje različitih vrsta.', NULL, 'John Doe', NULL, 1, NULL),
(2333, 4, 1, 'Што се подразбира дека се наоѓа на плоштадите|кои Италијанците ги нарекуваат Piazza Duomo?', 'парламент', 'кружен тек', 'катедрала', 'фонтана', 3, 2, 1, 0, 0, '', '', 'John Doe', '', 1, NULL),
