(2335, 4, 1, 'Како со еден збор се нарекува бројот 10 на степен 6,|односно илјада илјадарки?', 'милион', 'билион', 'трилион', 'пентилион', 1, 6, 1, 0, 0, '1,000,000 (one million), or one thousand thousand, is the natural number following 999,999 and preceding 1,000,001. The word is derived from the early Italian millione (milione in modern Italian), from mille, \"thousand\", plus the augmentative suffix -one.', NULL, 'John Doe', NULL, 1, NULL),
(2336, 6, 1, 'Која држава како мото го има:|„Liberté, égalité, fraternité“?', 'Хаити', 'Мароко', 'Јамајка', 'Нигерија', 1, 2, 2, 0, 0, 'Liberté, égalité, fraternité (pronounced [libɛʁte eɡalite fʁatɛʁnite]), French for \"liberty, equality, fraternity\", is the national motto of France and the Republic of Haiti, and is an example of a tripartite motto.', NULL, 'John Doe', NULL, 1, NULL),
(2337, 5, 1, 'Во која американска сојузна држава се наоѓаат|седиштето на CIA и Министерството за одбрана?', 'Пенсилванија', 'Калифорнија', 'Виргинија', 'Мисури', 3, 2, 2, 0, 0, 'CIA Headquarters: George Bush Center for Intelligence Langley, Virginia, U.S.; United States Department of Defense Headquarter The Pentagon Arlington County, Virginia, United States', NULL, 'John Doe', NULL, 1, '2020-03-07 11:43:36'),
(2338, 5, 1, 'Кој прв ја изнесе теоријата дека електроните|во атомот се движат по посебни патеки - орбитали?', 'Исак Њутн', 'Нилс Бор', 'Макс Планк', 'Јоханес Кеплер', 2, 7, 3, 0, 0, 'In atomic physics, the Rutherford–Bohr model or Bohr model or Bohr diagram, introduced by Niels Bohr and Ernest Rutherford in 1913, depicts the atom as a small, positively charged nucleus surrounded by electrons that travel in circular orbits around the nucleus—similar to structure of the Solar System, but with attraction provided by electrostatic forces rather than gravity. After the cubic model (1902), the plum-pudding model (1904), the Saturnian model (1904), and the Rutherford model (1911) came the Rutherford–Bohr model or just Bohr model for short (1913). ', NULL, 'John Doe', NULL, 1, NULL),
(2339, 6, 1, 'Од сите познати врсти змии,|отровна е секоја...', '7-ма врста', '14-та врста', '20-та врста', '23-та врста', 2, 12, 2, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2340, 6, 1, 'Кој Далтон од стрипот|„Lucky Luke“ е највисок?', 'Аверел', 'Џо', 'Вилиам', 'Џек', 1, 4, 7, 0, 0, 'The Daltons are outlaws who regularly appear in the Lucky Luke comic book series. They were created by artist Morris and writer René Goscinny. They are loosely inspired by the real-life Dalton Gang, and billed as their cousins. While the original Dalton brothers are depicted as evil and successful these Daltons are depicted as less skillful and more prone to fighting between the siblings. All four Daltons are depicted as identical except for in height, with the oldest brother Joe being the shortest and the youngest brother Averell being the tallest.', NULL, 'John Doe', NULL, 1, '2020-02-16 14:47:44'),
(2341, 5, 1, 'Како се вика сината боја, која во смеса со скроб,|се користи како синило за облека?', 'римско сино', 'прашко сино', 'мадридско сино', 'берлинско сино', 4, 19, 2, 0, 0, 'Берлинско сино е темно син пигмент со хемиска формула Fe7(CN)18. Берлинското сино е еден од првите пигменти добиени по синтетски пат.  Во медицината, берлинското сино се користи како антидот при некои труења со тешки метали (цезиум и талиум).', NULL, 'John Doe', NULL, 1, NULL),
(2342, 5, 1, 'Ја пишуваат Кристоферсон и Фостер, а најпозната е|изведбата на Џенис Џоплин. За која песна се работи?', 'Me and Arnold Layne', 'Me and Eleanor Rigby', 'Me and Bobby McGee', 'Me and Peggy Sue', 3, 9, 1, 0, 0, '\"Me and Bobby McGee\" is a song written by American singer-songwriter Kris Kristofferson and songwriter Fred Foster, originally performed by Roger Miller.  Kenny Rogers and The First Edition, Gordon Lightfoot, Miranda Lambert, and most famously Janis Joplin, whose posthumously released version topped the U.S. singles chart in 1971, making the song the second posthumously released No. 1 single in U.S. chart history after \"(Sittin'' On) The Dock of the Bay\" by Otis Redding. Billboard ranked Joplin''s version as the No. 11 song for 1971.', NULL, 'John Doe', NULL, 1, '2020-03-14 15:29:11'),
(2343, 4, 1, 'Која птица припаѓа на фамилијата був?', 'чучурлига', 'сојка', 'ќук', 'биљбиљ', 3, 12, 3, 0, 0, 'Ќук или евроазиски ќук (науч. Otus scops) — граблива птица од редот утковидни. Се среќава и во Македонија. Ќукот е една од најмалите утковидни птици. Се среќава и во Македонија. Чучурлигите (науч. Alaudidae) се фамилија птици песнопојки. Сите видови го населуваат стариот свет, северна и источна Австралија, само еден вид алпската ушеста чучурлига се проширила и во Северна Америка. Сите живеат на различни места, но сепак најмногу сакаат да живеат во суви подрачја. Биљбиљ или трнарче, каденче (Carduelis carduelis), е мала врапчевидна птица од фамилијата ѕвингалки. Го има и во Македонија.', NULL, 'John Doe', NULL, 1, '2020-02-08 18:25:15'),
(2344, 5, 1, 'Која „американска“ држава има знаме кое е|верна копија на „непријателско“ кубанско знаме?', 'Американска Самоа', 'Порторико', 'Гвам', 'Мидвеј', 2, 2, 2, 0, 0, 'In 1952, the Commonwealth of Puerto Rico adopted the same flag design, which was unveiled in 1895 by the Puerto Rican exiles within the Cuban Revolutionary Committee, as its official standard. The color of the triangle that was used by the administration of Luis Muñoz Marín was the dark blue. Знамето на Порторико се состои од пет хоризонтални црвени и бели линии, и син триаголник со бела ѕвезда од левата страна.', NULL, 'John Doe', NULL, 1, NULL),
(2345, 5, 1, 'Ако Лисбет Саландер е асоцијална хакерка,|тогаш Микаел Бломквист е...', 'одличен судија', 'асоцијален форензичар', 'непоткуплив полицаец', 'вистонољубив новинар', 4, 8, 1, 0, 0, 'Lisbeth Salander is a fictional character created by Swedish author and journalist Stieg Larsson. She is the lead character in Larsson''s award-winning Millennium series, along with the journalist Mikael Blomkvist. Occupation: Computer hacker in the Hacker Republic Private investigator at Milton Security. Mikael Blomkvist is a graduate of the School of Journalism and had much of his professional life dedicated to revealing and report suspicious transactions, specifically in the field of banking and business,\" writes Larsson in the first volume of the trilogy. ', NULL, 'John Doe', NULL, 1, NULL),
(2346, 5, 1, 'На кој антички народ неговиот назив|во превод значи „тетовирани“?', 'Нормани', 'Визиготи', 'Пикти', 'Лангобарди', 3, 5, 3, 0, 0, 'Pikti (lat. Picti, od pictus: naslikan; tetoviran), rimski naziv za narod naseljen u antičko doba u sjevernoj Škotskoj. Pretpostavlja se da su bili potomci pretkeltskoga domorodačkog stanovništva Irske i Britanije, a ime su vjerojatno dobili zbog njihova običaja bojenja tijela (tetoviranja). U rimskim izvorima prvi se put spominju 297. Dijelili su se na više plemena, među kojima su najbrojniji bili Kaledonci (Caledonii), Verturionci (Verturiones) i Meaćani (Maeatae).', '', 'John Doe', '', 1, '2020-02-16 14:46:20'),
(2347, 7, 1, 'Кое митско место, според постоечките описи|имало 540 врати?', 'Тартар', 'Валхала', 'Вавилонска кула', 'Ел Дорадо', 2, 3, 8, 0, 0, 'Valhalla (Old Norse Valhöll) is located in Asgard, the front of the big city of Asgard there are 540 doors. The doors are so wide that through each huge door, 800 warriors can walk side by side. The roof is covered with golden shields, and the walls around Valhalla are made from wooden spear shafts. This is the place were half of the Vikings who had died in a battle would come for their afterlife.', NULL, 'John Doe', NULL, 1, '2020-01-06 15:11:41'),
(2348, 6, 1, 'Каде во моментов се наоѓа нашето Сонце,|што се однесува на неговиот животен циклус?', 'на средина', 'на почеток', 'при крајот', 'неодредено', 1, 2, 7, 0, 0, 'The sun is in the middle of its lifespan, and is currently in the main sequence phase. At this stage in its life the sun is fusing hydrogen into helium.  [Update: January 2018]', NULL, 'John Doe', NULL, 1, NULL),
(2349, 7, 1, 'Кој лик на Зола, Симон Сињоре ја портретирала|во 1953 г. и Елизабет Олсен шест децении подоцна?', 'Тереза Раквин', 'Нана Купе', 'Медлин Фера', 'Кетрин Маху', 1, 4, 2, 0, 0, 'Thérèse Raquin (also The Adultress) is a 1953 French-Italian drama film directed by Marcel Carné and starring Simone Signoret and Raf Vallone. The story is loosely based on the novel of the same title by Émile Zola but updated to 1953. It was screened at the 14th Venice International Film Festival where it won the Silver Lion.', NULL, 'John Doe', NULL, 1, NULL),
