(2351, 6, 1, 'Што е „позајмено“ од унгарскиот јазик?', 'капут', 'прслук', 'бунда', 'марама', 3, 5, 5, 0, 0, 'Hungarian bunda (plural bundák)', NULL, 'John Doe', NULL, 1, NULL),
(2352, 4, 1, 'Како се вика некогашната резиденција на руските|цареви на реката Нева во Санкт Петерсбург?', 'Летен дворец', 'Зимски дворец', 'Есенски дворец', 'Пролетен дворец', 2, 2, 1, 0, 0, 'Зимскиот дворец (од руски: Зи́мний дворе́ц), Санкт Петербург, Русија била официјалната резиденција на руските владетели, од 1732 до 1917 година. Сместена помеѓу кејот и плоштадот на дворецот, соседна на поранешната локација на Зимскиот дворец од Петар Велики, денешната и четврта Зимски дворец била изградена и изменувана при крајот на 1730 и 1837 година, кога тешко била оштетена во пожар и непосредно обновена. Наводниот напад на дворецот во 1917 година, насликан во Советските слики и прикажен во филмот на Сергеј Ејзенштејн Октомври (1927 година), стана ироничен симбол на Руската револуција.', NULL, 'John Doe', NULL, 1, NULL),
(2353, 4, 1, 'Кој не е фудбалер, туку лик во литературата|од перото на Алекс Халеј?', 'Кики Мусампа', 'Банана Веј', 'Кунта Кинте', 'Џеј-Џеј Окоча', 3, 4, 2, 0, 0, 'Kunta Kinte (c. 1750 – c. 1822) is a character in the novel Roots: The Saga of an American Family by American author Alex Haley. Haley claimed that Kunta Kinte was based on one of his ancestors: a Gambian man who was born in 1750, enslaved and taken to America and who died in 1822.', NULL, 'John Doe', NULL, 1, NULL),
(2354, 5, 1, 'Која од овие држави нема излез на море?', 'Бутан', 'Мјанмар', 'Бангладеш', 'Пакистан', 1, 2, 3, 0, 0, 'Кралството Бутан или само Бутан е земја во Јужна Азија, лоцирана на источниот крај на Хималаите. Државата на југ, исток и запад се граничи со Индија, а додека на север се граничи со НР Кина. Поради тешко проодната околина, градењето на патишта и друга инфраструктура е отежната. Ова, а и недостапноста на море, допринело да Бутан нема голема корист од трговија со останатите земји, а и во самата држава иато така. ', NULL, 'John Doe', NULL, 1, NULL),
(2355, 3, 1, 'Кој термин доаѓа од грчкиот јазик|што значи „љубов кон мудроста“?', 'патологија', 'филозофија', 'тригонометрија', 'лингвистика', 2, 5, 3, 0, 0, 'Riječ filozofija (grč. „philosophia“) nastala je u starogrčkom jeziku, a izvorno znači „ljubav spram mudrosti“, odnosno „nastojanje i djelatnost onih što teže za mudrošću“. Dolazi od riječi „philos“, što znači prijatelj, ljubitelj, i „sophia“, što znači mudrost. Po predaji, riječ „philosophia“ je prvi upotrijebio Pitagora.', NULL, 'John Doe', NULL, 1, NULL),
(2356, 4, 1, 'Октоподот има три...', 'очи', 'усти', 'белодробни крила', 'срца', 4, 12, 4, 0, 0, 'Октоподите имаат три срца. Едно е за телото е другите две за да пумпаат крв низ жабрите за дишење. Ако се почувствуваат загрозени, тие испуштаат течност што наликува на мастило и којашто се шири низ водата како огромен, темен облак. На тој начин, октоподот може да го замаскира и сокрие правецот во којшто ќе избега. Згора на тоа, тие се и мајстори за камуфлирање, бидејќи можат многу брзо да ја променат бојата на своето тело од сиво-кафеава во сино-зелена, црвена или розева.', NULL, 'John Doe', NULL, 1, '2020-03-29 00:36:30'),
(2357, 7, 1, 'На која банкнота се наоѓа зградата во која е донесена|Американската декларација за независност?', '10 долари', '20 долари', '50 долари', '100 долари', 4, 16, 3, 0, 0, 'The United States one hundred-dollar bill ($100) is a denomination of United States currency featuring statesman, inventor, and diplomat Benjamin Franklin on the obverse of the bill. On the reverse of the banknote is an image of Independence Hall.', NULL, 'John Doe', NULL, 1, NULL),
(2358, 7, 1, 'Која опера главна тема е заљубувањето на|проститутката Виолета во чистиот ум на Алфредо?', 'Волшебниот стрелец', 'Така прават сите', 'Кавалерија Рустикана', 'Травијата', 4, 9, 7, 0, 0, 'Травијата (Italian La traviata, The Fallen Woman) е опера во три чина на Џузепе Верди. Убавата куртизана Виолета, иако болна, ноќите ги минува на балови и пијанки. На еден бал се запознава со Алфред и веднаш ја чувствува неговата искрена љубов. Решаваат да живеат заедно, далеку од градот, во летната куќа на Виолета. Тука, се појавува таткото на Алфред, Жорж, кој бара Виолета да се жртвува и да го напушти син му, заради доброто име на семејството. Виолета, нерадо, прифаќа. Навреден од гестот, а без да ја знае вистината, Алфред ја наоѓа Виолета на балот кај Флора и пред сите ја навредува. Тој гeст најжестоко го осудува татко му, а баронот Дуфол го предизвикува на дуел. Виолета и Алфред се разделени. Таа е тешко болна и во живот ја одржува само писмото од татко му на Алфред, кој ја моли за прошка и ветува дека ќе дојдат штом на Алфред ќе му заздрави раната добиена во дуелот. Конечно, Алфред и се враќа на Виолета. Таа е пресреќна, но само толку за да може да умре со насмевка на усните.', NULL, 'John Doe', NULL, 1, '2020-03-07 11:46:18'),
