(2365, 5, 1, 'Колку римски цареви загинуваат во филмот|„Гладијатор“ на режисерот Ридли Скот?', 'еден', 'два', 'четири', 'пет', 2, 8, 1, 0, 0, 'Not only is the audience finally given what they''ve been waiting for the entire film—Commodus'' death at the hands of Maximus—but we also see Rome restored to proper leadership. Maximus'' heroic death not only avenges the death of his family and of Marcus Aurelius, but it also frees Lucilla from her brother''s tyranny, and Rome of an evil, despotic tyrant.', '', 'John Doe', '', 1, NULL),
