(2369, 6, 1, 'Низ Тајланд сообраќајува мал тук тук. Во кое големо|превозно средство може да се кружи низ хаитските улици?', 'тап тап', 'пиф паф', 'тик так', 'зук зук', 1, 17, 1, 0, 0, 'Tap taps are gaily painted buses or pick-up trucks that serve as share taxis in Haiti. They may also be referred to as camionette. Literally meaning \"quick quick\", these vehicles for hire are privately owned and ornately decorated. ', NULL, 'John Doe', NULL, 1, NULL),
(2370, 7, 1, 'Неговите јадра имаат еден протон и еден неутрон. Околу|нив кружи еден електрон. Кој е неговиот хемиски симбол?', 'A', 'B', 'C', 'D', 4, 7, 3, 0, 0, 'Deuterium (or hydrogen-2, symbol D, also known as heavy hydrogen) is one of two stable isotopes of hydrogen (the other being protium, or hydrogen-1). The nucleus of deuterium, called a deuteron, contains one proton and one neutron, whereas the far more common protium has no neutron in the nucleus. ', NULL, 'John Doe', NULL, 1, NULL),
