(2375, 5, 1, 'На која островска група припаѓаат островите|Итака и Кефалонија?', 'Јонска група', 'Егејска група', 'Додекани', 'Киклади', 1, 2, 1, 0, 0, 'Итака е грчки остров кој се наоѓа во Јонското Море, со површина од 120 km², и 3.084 жители. Островот е општина во префектурата Кефалинија и се наоѓа североисточно од брегот на Кефалоња, и западно од континентална Грција. Најмногу е познат по Хомеровата Итака, како домот на Одисеј во Одисеја.', NULL, 'John Doe', NULL, 1, '2020-03-08 16:02:21'),
(2376, 6, 1, 'На што од понуденово се однесува поимот „vitellin“?', 'лушпа од орев', 'еленска кожа', 'жолчка од јајце', 'смола од дрва', 3, 7, 2, 5, 5, 'Vitellin is a protein found in the egg yolk. It is a phosphoprotein. Vitellin is a generic name for major of many yolk proteins. Vitellin has been known since the 1930s', NULL, 'John Doe', NULL, 1, '2020-04-15 16:20:59'),
(2377, 5, 1, 'За време на Втората светска војна, Видкун Квислинг|бил лидер-предавник на...', 'Франција', 'Италија', 'Норвешка', 'Турција', 3, 3, 1, 0, 0, 'Vidkun Abraham Lauritz Jonssøn Quisling (Norwegian: [ˈvidkʉn ˈkvisliŋ] (18 July 1887 – 24 October 1945) was a Norwegian military officer and politician who nominally headed the government of Norway after the country was occupied by Nazi Germany during World War II.', '', 'John Doe', '', 1, '2020-03-23 19:11:16'),
(2378, 7, 1, 'Во Шекспировата „Ромео и Јулија“,|кој од овие карактери не умира?', 'Меркуцио', 'Тибалт', 'Бенволио', 'Ромео', 3, 4, 2, 0, 0, '6 people died (In Romeo and Juliet).  1.Tybalt killed Mercutio because Romeo wouldn''t fight, so Mercutio died. 2.Romeo killed Tybalt because Romeo wanted revenge. 3.Romeo killed Paris because Paris was trying to stop him.  4.Romeo killed himself because he thought Juliet was dead.  5.Juliet killed herself because Romeo was dead.  6.Lady Montague (Romeo’s mom) died of a heart attack because of the grief over her son (Romeo).', NULL, 'John Doe', NULL, 1, NULL),
(2379, 5, 1, 'Која придавка поврзува архитектонски стил|и вид роман кој изобилува со страв и напнатост?', 'еолска', 'дорска', 'готска', 'хеленистичка', 3, 4, 0, 0, 0, 'Готски роман е вид на роман кој изобилува со страв и напнатост а бил особено популарен во Англија кон крајот на 18 век. Изразот “готски” се употребува во тој период и за рушевини и старини. Готската архитектура се развила од романската архитектура и била заменета од ренесансната архитектура. Почетоците на овој стил потекнуваат од 12 век се до 16 век во Франција', NULL, 'John Doe', NULL, 1, NULL),
(2380, 5, 1, '''The Body'' е познат прекар на манекенката...', 'Наоми Кемпбел', 'Клаудија Шифер', 'Иман', 'Ел Мекферсон', 4, 20, 0, 0, 0, 'Elle Macpherson (born Eleanor Nancy Gow; 29 March 1964) is an Australian model, businesswoman, television host and actress. She is well known for her record five cover appearances for the Sports Illustrated Swimsuit Issue beginning in the 1980s, leading to her nickname The Body, coined by Time in 1989.', '', 'John Doe', '', 1, NULL),
(2381, 5, 1, 'Која риба, според обликот на телото,|најмногу наликува на папалина?', 'јагула', 'салпа', 'сардина', 'ковач', 3, 12, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-10 18:47:40'),
(2382, 3, 1, 'Која состојка, покрај чакал и вода,|недостасува во основната рецепта за бетон?', 'цемент', 'ламинат', 'гипс', 'бордура', 1, 7, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-02-16 14:27:05'),
(2383, 4, 1, '„Аранжман во црно и сиво бр. 1“, најпознатото|Вистлерово масло на платно, е портрет на неговата...', 'ќерка', 'сестра', 'баба', 'мајка', 4, 1, 2, 0, 0, 'Whistler''s Mother', NULL, 'John Doe', NULL, 1, NULL),
(2384, 4, 1, 'Кој приватен детектив плаќа|станарина на госпоѓа Хадсон?', 'Херкул Поаро', 'Сем Спејд', 'Мајк Хемер', 'Шерлок Холмс', 4, 8, 5, 0, 0, 'Martha Louise Hudson (née Sissons) is the landlady of 221B and 221C Baker Street. She rents 221B out to Sherlock Holmes and Dr John Watson. Mrs Hudson lives in the same building in a flat of her own.', NULL, 'John Doe', NULL, 1, '2020-02-29 19:28:04'),
(2385, 5, 1, 'Кој калифорниски град, центар на Силициумската долина, е седиште|на некои од водечките компании на полето на високата технологија?', 'Фресна', 'Риалто', 'Модесто', 'Пало Алто', 4, 7, 6, 0, 0, 'Palo Alto serves as a central economic focal point of the Silicon Valley, and is home to more than 7,000 businesses employing more than 98,000 people. Many prominent technology firms reside in the Stanford Research Park on Page Mill Road, while nearby Sand Hill Road in the adjacent city of Menlo Park is a notable hub of venture capitalists. The city''s economy generally follows the economic trends of the rest of the Silicon Valley. Well-known companies and research facilities headquartered in Palo Alto include: Amazon, Tesla, Hp, Dell, Skype, Nokia...', NULL, 'John Doe', NULL, 1, NULL),
(2386, 4, 1, 'Каде се наоѓа Рованиеми,|местото каде живее Дедо Мраз?', 'на Гренланд', 'во Норвешка', 'во Шведска', 'во Финска', 4, 2, 1, 0, 0, 'Rovaniemi is the capital of Lapland, in northern Finland. Almost totally destroyed during World War II, today it’s a modern city known for being the \"official\" home town of Santa Claus, and for viewing the Northern Lights. ', NULL, 'John Doe', NULL, 1, NULL),
(2387, 3, 1, 'Како популарно е наречено хемиското соединение|тринитротолуен?', 'динамит', 'тротил', 'пластид', 'бетонит', 1, 7, 3, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-07 16:31:45'),
(2388, 7, 1, 'Кој од овие поими никогаш не бил поврзан со Виетнам?', 'Тонкински Залив', 'Кохинхина', 'Ајутја', 'Аннам', 3, 2, 3, 0, 0, '', '', 'John Doe', '', 1, '2020-04-04 17:53:28'),
(2389, 5, 1, 'Во која од овие земји официјален јазик е француски?', 'Доминиканска Република', 'Хаити', 'Доминика', 'Гвајана', 2, 2, 0, 5, 0, 'Хаити или Аити е независна држава на Карпските Острови. Заедно со Доминиканската Република, Хаити го зазема островот Хиспаниола, односно Хаити го зазема западниот, додека Доминиканската Република источниот. Имети „Аити“ или земја на високи планини била земја на староседелскиот народ Таино и тоа име потекнува од нив, термин кој го користеле за западниот дел на островот. Службен јазик хаитски креолски, француски', NULL, 'John Doe', NULL, 1, NULL),
(2390, 5, 1, 'Каде дејствувале грубите закони, кои подоцна|се именувани како „драконски“?', 'Древна Атина', 'Древен Египет', 'Антички Рим', 'Сумер', 1, 3, 8, 0, 0, 'Претерано остар, премногу строг (по атинскиот законодавец Дракон). Драконски је груб или пунитиван захтев или казна. Појам потиче од Дракона, грчког владара из 7. века п. н. е. који је доносио законе са строгим казнама. ', NULL, 'John Doe', NULL, 1, NULL),
(2391, 8, 1, 'Што направил царот Франц Јозеф за време на прошетка,|иницирајќи нов тренд во модата?', 'ги подвиткал панталоните', 'ги раскинал ракавите', 'ја скршил штиклата', 'ја симнал капата', 1, 19, 2, 3, 1, '', '', 'John Doe', '', 1, '2020-03-29 01:45:37');
