(2392, 4, 1, 'По што може да се одреди староста на елените?', 'по опашката', 'по ушите', 'по копитата', 'по роговите', 4, 12, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2393, 5, 1, 'Од која земја емигриралe повеќето херои од|делата за воените хорори на Ремарк?', 'Русија', 'Германија', 'Франција', 'Австрија', 2, 4, 2, 3, 1, 'Erich Maria Remarque (born Erich Paul Remark; 22 June 1898 – 25 September 1970) was a German novelist who created many works about the horrors of war. His best known novel All Quiet on the Western Front (1928), about German soldiers in the First World War, was made into an Oscar-winning film. His book made him an enemy of the Nazis, who burned many of his works. In 1941, he published Flotsam (entitled \"Love Thy Neighbor\" in German), in a serialized version in Collier''s. It featured the sufferings of exiles fleeing Hitler''s Germany.', NULL, 'John Doe', NULL, 1, NULL),
(2394, 4, 1, 'Кој океан на Земјата зазема најмала површина?', 'Атлантски Океан', 'Индиски Океан', 'Јужен Океан', 'Северен Леден Океан', 4, 2, 8, 0, 0, 'Тихи океан - 155 557 000 кв.км, Атлантски океан- 76 762 000 кв.км, Индијски океан - 68 556 000 кв.км, Јужен океан - 20 327 000, Северно-леден океан - 14 056 000 кв.км', '', 'John Doe', '', 1, '2020-04-25 14:44:34'),
(2395, 5, 1, 'Чинот на предавање на Јапонија во Втората Светска војна|беше потпишан на палубата на американската морнарица...', 'Висконсин', 'Мисури', 'Ајова', 'Њу Черси', 2, 3, 2, 3, 3, 'Предавањето се одржа на 2 септември, на палубата на американскиот воен брод USS Мисури, на кој претставници од јапонската влада го потпишаа Јапонскиот инструмент за предавање.', NULL, 'John Doe', NULL, 1, NULL),
(2396, 5, 1, 'Кој од овие главни градови „лежи“ на реката Тибар?', 'Вадуз', 'Техеран', 'Багдад', 'Рим', 4, 2, 1, 0, 0, 'Тибар (ита. Tevere), трета по должина река во Италија со 406 km, по Поа и Адиџе, тече низ Рим во правец од планината Фумајоло до Тиренското море, во кое се влива во два слива: еден низ предградијето Остија на југ, а вториот низ Фијумиџино на север. Сливот на Тибар е околу 18.000 km²', NULL, 'John Doe', NULL, 1, NULL),
(2397, 5, 1, 'Која држава нема знаме со бои црвено-бело-сино?', 'Либерија', 'Израел', 'Куба', 'Франција', 2, 2, 8, 0, 0, 'Сино и бело со давидова ѕвезда-Израел', NULL, 'John Doe', NULL, 1, NULL),
(2398, 5, 1, 'Кој апарат за домаќинство го користат домаќинките во Хонолулу,|за да го направат месото на октопод помеко?', 'машина за перење', 'правосмукалка', 'фен', 'пегла', 1, 19, 7, 0, 0, 'Latest story on the versatility of modern household appliances comes from Honolulu, where octopus is a staple delicacy. The monster''s tentacles must be beaten carefully with a wooden paddle before being eaten. When octopus was proposed a certain Chinese cook always pulled a long face because the beating process is so tiresome. He discovered a short time ago that the washing machine knows exactly how to slap octopus tentacles around and does it in three and a half minutes.', '', 'John Doe', '', 1, '2020-04-25 14:39:40'),
(2399, 6, 1, 'Кој бил главен град на царството на Ацтеките?', 'Кју Клукс Кан', 'Мексико Сити', 'Монтесума', 'Теночтитлан', 4, 2, 8, 3, 8, 'Теночтитлан бил главен град на царството на Ацтеки. Тој се наоѓал на островот на езерото Тешкоко, таму каде што е денес градот Мексико Сити. Теночтитлан на врвот од својата моќ, бил еден од најголемите градови на светот со околу 200.000 жители. Градот го уништиле шпанските конквистадори во 1521 година. На неговите урнатини е изграден денешниот град Мексико Сити, а езерото Тешкоко постепено е исушено.', NULL, 'John Doe', NULL, 1, NULL),
(2400, 5, 1, 'Кој херој од романот „Грофот на Монте Кристо“|навистина постоел?', 'Абе Фарија', 'баронот Дангларс', 'обвинителот де Вилфорт', 'грофот де Морцер', 1, 4, 2, 4, 3, 'Abbé Faria: Italian priest and sage. Imprisoned in the Château d''If. Edmond''s dearest friend while in prison.', '', 'John Doe', '', 1, '2020-03-08 16:27:06'),
(2401, 8, 1, 'Колку круга околу Земјата направи првиот екипаж|со вселенскиот брод Восток на чело со Јуриј Гагарин?', 'еден', 'три', 'пет', 'десет', 1, 7, 1, 3, 7, '', NULL, 'John Doe', NULL, 1, '2020-04-04 17:53:38'),
(2402, 6, 1, 'Колку индикатори се во обемот на Апгар тестот|за новородени бебиња?', '4', '5', '6', '8', 2, 7, 2, 0, 0, 'Апгар-тест е едноставна метода за брза проценка на здравствената состојба на новородено дете веднаш по раѓањето. Тестот бил измислен од Вирџинија Апгар, анестезиолог, со цел да се утврди ефектот на акушерската анестезија врз бебињата. Резултатот од Апгар-тестот (т.н. Апгар скор) е одреден преку оценување на новороденото за пет едноставни критериуми на скала од нула до два, а потоа со собирање на добиените пет вредности. Резултатот може да биде од 0 до 10. Почетните букви од критериумите, на англиски јазик, го даваат името АПГАР: (Appearance: изглед или боја на кожата, Pulse: пулс, Grimace: гримаса или рефлексна раздразливост, Activity: активност или мускулен тонус, Respiration: респирации, односно дишење). На бебињата со збир меѓу 4 и 6 им е потребна реанимација, која најчесто вклучува вшмукување на содржината од дишните патишта и примена на кислород. На оние со збир помал од 4 им се неопходни подрастични акции за спасување на животот.', NULL, 'John Doe', NULL, 1, '2020-04-25 14:50:18'),
(2403, 5, 1, 'Хипотетички, во кој случај би бил можен|живот на Плутон?', 'ако Сонцето стане џин', 'ако Сонцето се намали двојно', 'ако Месечината исчезне', 'не постои решение', 1, 7, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-04-13 14:28:41'),
(2404, 5, 1, 'Каде е родното место на|популарната пејачка Шакира?', 'Венецуела', 'Боливија', 'Еквадор', 'Колумбија', 4, 9, 1, 0, 0, 'Born on 2 February 1977 in Barranquilla, Colombia, she is the only child of William Mebarak Chadid and Nidia Ripoll Torrado. Her paternal grandparents emigrated from Lebanon to New York City, where her father was born.', NULL, 'John Doe', NULL, 1, '2020-01-04 15:02:36'),
(2405, 5, 1, 'Кој е главен град на најмалата земја каде|се зборува португалски јазик, Сао Томе и Принципе?', 'Писи', 'Вали', 'Сао Томе', 'Принципе', 3, 2, 4, 5, 0, 'Сао Томе и Принсипе, официјално Демократска Република Сао Томе и Принсипе, е островска нација во Африка, во центарот на Гвинејски Залив. Државата се состои од два острови: Принсипе и Сао Томе, разделени меѓу себе 140 км, а додека од брегот на Африка се оддалечени 250 односно 225 км. Двата острови се состојат од венец на изумрени вулкански острови. Сао Томе, поголемиот остров, се наоѓа северно од екваторот и го добил името по Свети Тома, поради тоа што Португалците пристигнале за прв пат на островот на самиот ден Св. Тома. Сао Томе и Принсипе е втората најмала земја во Африка, во поглед на населението. Исто така, таа е најмалата земја каде се зборува португалски јазик. Главен и најголем град: Сао Томе', NULL, 'John Doe', NULL, 1, '2020-03-23 19:08:58'),
(2406, 6, 1, 'Како се нарекува феноменот кога Сонцето во|северните ширини не се спушта надвор од хоризонтот?', 'поларен ден', 'астрономски самрак', 'поларна ноќ', 'соларна кулминација', 1, 2, 7, 0, 0, 'Поларниот ден или полноќното сонце е природен феномен кој се случува во летните месеци на географски ширини северно и јужно близу до Арктикот, како и јужно и северно близу до Антарктикот каде сонцето останува видливо и на полноќ по локално време. Во зависност од времето сонцето може да се гледа цели 24 часа без прекин, најчесто северно од Арктикот и јужно од Антарктикот. Бројот на потенцијални поларни денови во годината се зголемува како што се приближуваме до половите.', NULL, 'John Doe', NULL, 1, '2020-03-27 19:35:17'),
(2407, 5, 1, 'На кој од овие филмови Енио Мориконе|не е потпишан за креатор на музика?', 'Големиот Лебовски', 'Неславни копилиња', 'Професионалец', 'Љубовна афера', 1, 2, 0, 8, 0, 'The Mercenary (1968) Directed by Sergio Corbucci Music by Ennio Morricone; Love Affair (1994 film)  Directed by Glenn Gordon Caron and music composed by Ennio Morricone; The Professional (1981) Directed by Enio Moricone and music composed by Enio Moricone; The Big Lebowski (1998) Directed by Joel Coen and Music by Carter Burwell', '', 'John Doe', '', 1, NULL),
