(2409, 6, 1, 'Императорката на Русија во периодот од 18-ти век,|Екатерина II, на Петар III му била...', 'сопруга', 'тетка', 'мајка', 'ќерка', 1, 3, 1, 0, 0, 'Катерина II Велика (руски: Екатерина II Великая) Таа всушност е и императорот кој најдолго се задржал на тронот на Руската Империја, а периодот од нејзиното владеење многу често се нарекува “Златен век“. Таа водела успешни освојувачки војни. По војната со Османлиското Царство од 1766 до 1774 кон Русија го приклучила Кримскиот Полуостров. Ја проширила и на запад, на сметка на Полска. Како резултат на овие освојувања Русија станала најголема и најсилна европска држава во XVIII век, меѓутоа на општествен и стопански поглед заостанувала зад западноевропските држави. Го земала името Катерина Алексеевна и на 21 август 1745, кога имала 16 години, со величествена церемонија, стапила во брак со Петар. Според многумина, првата брачна ноќ на новите сопружници им била катастрофална, бидејќи Петар повеќе сакал да си игра со своите војници отколку да се позанимава со својата сопруга.', NULL, 'John Doe', NULL, 1, '2020-04-15 15:53:01'),
(2410, 4, 1, 'Која од следниве планети е|најоддалечена од Сонцето?', 'Сатурн', 'Венера', 'Јупитер', 'Уран', 4, 7, 1, 0, 0, 'Осумте планети во Сончевиот Систем : Меркур, Венера,Земја,Марс,Јупитер, Сатурн,Уран и Нептун.', NULL, 'John Doe', NULL, 1, NULL),
(2411, 6, 1, 'Во која земја населението на Тонтон-Макута|ги заплашува луѓето?', 'Хаити', 'Гватемала', 'Куба', 'Парагвај', 1, 2, 4, 0, 0, 'The Tonton Macoute (Haitian Creole: Tonton Makout) or simply as the Macoute was a special operations unit within the Haitian paramilitary force created in 1959 by dictator François \"Papa Doc\" Duvalier. In 1970 the militia was renamed the Volontaires de la Sécurité Nationale (VSN, Volunteers of the National Security).[6] Haitians named this force after the Haitian mythological bogeyman, Tonton Macoute (\"Uncle Gunnysack\"), who kidnaps and punishes unruly children by snaring them in a gunny sack (French: macoute) and carrying them off to be consumed at breakfast.', NULL, 'John Doe', NULL, 1, NULL),
(2412, 6, 1, 'Којa сојузна држава има главен град кој е|именуван во чест на англиски истражувач?', 'Мичиген', 'Алабама', 'Северна Каролина', 'Вермонт', 3, 2, 2, 3, 1, 'Raleigh is the capital of the state of North Carolina and the seat of Wake County in the United States. Raleigh is the second-largest city in the state of North Carolina, after Charlotte. Raleigh is known as the \"City of Oaks\" for its many oak trees, which line the streets in the heart of the city. It is one of the fastest-growing cities in the country. The city of Raleigh is named after Sir Walter Raleigh, who established the lost Roanoke Colony in present-day Dare County.', NULL, 'John Doe', NULL, 1, NULL),
(2413, 4, 1, 'Колку обиди на самиот почеток на играта му се дава|на играчот во куглање за да урне 10 чунови?', '1', '2', '3', '4', 2, 14, 0, 0, 0, 'There are ten frames in one game. You have two chances to knock down the ten pins in each frame. The tenth frame rewards you with a final bonus ball if you convert your spare (or make two strikes). You can thus throw nine strikes in the first nine frames and, if you get another two in the tenth, the bonus ball means the most strikes you can have in one game is twelve. This is called a perfect game. https://www.topendsports.com/sport/tenpin/glossary.htm', NULL, 'John Doe', NULL, 1, '2020-01-19 12:59:54'),
(2414, 5, 1, 'На брегот на кој континент се забележува|највисоката светска плима?', 'Австралија', 'Америка', 'Африка', 'Евроазија', 2, 2, 8, 0, 0, 'The highest tides in the world can be found in Canada at the Bay of Fundy, which separates New Brunswick from Nova Scotia. At some times of the year the difference between high and low tide in this Bay is 16.3 meters, taller than a three-story building. Canada is a country located in the northern part of North America. ', NULL, 'John Doe', NULL, 1, NULL),
(2415, 5, 1, 'Кое од овие дела е напишано од рускиот|романописец и драматург Михаил Булгаков?', '„Тања“', '„Љубовта на пролетта“', '„Машенка“', '„Мајсторот и Маргарита“', 4, 4, 1, 4, 4, 'Мајсторот и Маргарита (руски: Ма́стер и Маргари́та) е роман на рускиот писател Михаил Булгаков. Во центарот на вниманието на романот е посетата на Сатаната на Москва. Голем број критики ја сметаат книгата за еден од најдобрите романи на 20 век, најважниот руски роман на 20 век, како и една од најдобрите сатирични книги за советската бирократија и социјален живот.', NULL, 'John Doe', NULL, 1, NULL),
(2416, 9, 1, 'Како се вика канцеларијата на Петар I Велики|во големата палата во Петергоф?', 'Таен кабинет', 'Тивок кабинет', 'Кабинет на декрети', 'Дабов кабинет', 4, 3, 1, 0, 0, 'Дубовый кабинет Петра I. Петергоф. Большой дворец. 1716-1720 гг. Дубовые панели сплошь покрывают стены, придавая интерьеру удивительную теплоту и уютность. Все деревянные панели отделаны изящной резьбой, выполненной французским резчиком-скульптором и декоратором Николя Пино. Oak furniture in the Russian style, origin of which was an attempt to stop the process of depersonalizing artifacts due to ever-increasing industrial production, was particularly distinctive. Furniture in Russian style was made in small craft workshops. ', NULL, 'John Doe', NULL, 1, NULL),
(2417, 6, 1, 'На кој јазик се напишани мемоарите на|руската императорка Екатерина II?', 'француски', 'руски', 'германски', 'англиски', 1, 4, 3, 3, 1, 'Empress Catherine II brought Europe to Russia, and Russia to Europe, during her long and eventful reign (1762—96). She fostered the culture of the Enlightenment and greatly expanded the immense empire created by Czar Ivan the Terrible, shifting the balance of power in Europe eastward. Famous for her will to power and for her dozen lovers, Catherine was also a prolific and gifted writer.  Fluent in French, Russian, and German, Catherine published political theory, journalism, comedies, operas, and history, while writing thousands of letters as she corresponded with Voltaire and other public figures. Translation from the French is scrupulously faithful to her words and is the first for which translators have consulted original manuscripts written in Catherine’s own hand. It is an indispensable work for anyone interested in Catherine the Great, Russian history, or the eighteenth century.', NULL, 'John Doe', NULL, 1, NULL),
(2418, 6, 1, 'Што е „Големиот триаголник“, најден на|Уралските Планини во 1842 година?', 'смарагд', 'дијамант', 'малахит', 'златна грутка', 4, 2, 8, 0, 0, '\"Большой треугольник\"- самый крупный российский самородок - найден в 1842 г. на Ю.Урале (Миасский район). Массивный, плотный, из жилы кварц-карбонатного состава, на поверхности хорошо видны отпечатки кристаллов кварца и карбоната. В России есть множество больших и малых месторождений золота и многие из них богаты самородками. Самородки массой в несколько килограммов были найдены на Урале, в Красноярском крае, Иркутской области, в Якутии, на Чукотке, в Магаданской области. В основном самородки обнаруживают при промышленной добыче россыпного золота, хотя известны случайные находки вдали от существующих разработок. В России в старину считали, что золотой самородок — это фарт и «божий дар», и поэтому не считалось зазорным присвоить его. Во второй половине XIX века главным материальным стимулом для работы на приисках служило «подъемное» золото, за которое платили наличными деньгами. ', '', 'John Doe', '', 1, NULL),
(2419, 4, 1, 'Кој музички термин соодветствува за мирно темпо?', 'виваче', 'анданте', 'алегро', 'престо', 2, 9, 8, 0, 0, 'vivace - lively and brisk manner; andante - a tempo mark directing that a passage is to be played in a moderately slow tempo; faster than adagio but slower than allegretto. allegro - at a brisk lively tempo — used as a direction in music.', NULL, 'John Doe', NULL, 1, '2020-04-04 13:26:45'),
(2420, 4, 1, 'Што проучува семиотиката?', 'знаци и симболи', 'потекло на зборови', 'знамиња', 'антропоидни мајмуни', 1, 5, 3, 0, 0, 'Семиотика е наука за толкување на знаците и нивните ситеми. Главни гранки на семиотиката најчесто се сметаат: прагматика · семантика · синтакса · емпиристика. Постои голема врска помеѓу семиотиката и комуникациите, односно комуникациските студии.', NULL, 'John Doe', NULL, 1, NULL),
(2421, 4, 1, 'Како се нарекува краткиот отворен елек и шапката|на шпанските тореадори?', 'болеро', 'кимоно', 'танго', 'фламенко', 1, 5, 2, 0, 0, 'Antique Spanish matador bullfighter bolero jacket, knickers, waist cincher three piece costume dates from 1900. It is made of a black velvet fabric, with gold metallic lace sequin trim and black lace applique, silk ball fringe trim on the pants. This magnificent matador Spanish toreadors bullfighters costume includes a bolero short cropped ceremonial jacket, with epaulette ornamental shoulder piece decorations, long fitted sleeves and an open front with no closure. ', NULL, 'John Doe', NULL, 1, '2020-01-04 15:01:37'),
(2422, 6, 1, 'Која руска река тече од Кина?', 'Ангара', 'Иртиш', 'Колима', 'Лена', 2, 2, 1, 2, 3, 'Иртиш — река во Сибир и Казахстан, главна притока на Об. Реката има мошне големо и значајно сливно подрачје во Азија, опфаќајќи го западен Сибир и Алтајските Планини. Реката извира како во монголски Алтај (Сјинџанг, Кина), каде е наречена Кара Иртиш (Црн Иртиш), па тече на северозапад преку Зајсанското Езеро во Казахстан. Потоа во неа се влеваат реките Ишим и Тобол, за на крај самата река да се влее во Об кај Ханти-Мансијск во западен Сибир, Русија. Течението има должина од вкупно 4.248 км.', NULL, 'John Doe', NULL, 1, NULL),
(2423, 5, 1, 'Колку жици има контрабасот?', '2', '3', '4', '5', 3, 9, 8, 0, 0, 'Контрабасот е најголем и според регистрите најдлабок гудачки инструмент со четири жици (порано имал три). Припаѓа на групата гудачки инструменти, као и виолината, виолата и виолончелото. Гудалото за контрабас е најкратко и најтешко во однос на останатите. Се свири стоејќи или седејќи на висок стол. Регистарот на контрабасот е во квартно растојание од 1Е,1А,Д,Г.', NULL, 'John Doe', NULL, 1, NULL),
