(2429, 5, 1, 'Која битка се води во филмот|„Лоренс од Арабија“?', 'Битка кај Акаба', 'Битка кај Мосул', 'Битка кај Рака', 'Битка кај Хотин', 1, 8, 1, 3, 3, 'Акапски Залив е голем залив на северниот крај на Црвеното Море, источно од Синајскиот Полуостров и западно од Арапскиот Полуостров. Друго популарно место источно од северниот крај на заливот е долината Вади Рум. Покрај тоа, посетени места се археолошките наоди на цивилизацијата железно од време кај Ејла во Акаба и местото кајшто се одиграла Битката кај Акаба во Првата светска војна предводена од Лоренс од Арабија.', NULL, 'John Doe', NULL, 1, NULL),
