(2432, 6, 1, 'Кој тогашен аргентински претседател во 1981|наредил инвазија на Фолкландските острови?', 'Карлос Менем', 'Хуан Перон', 'Леополд Галтиери', 'Роберто М. Левингстон', 3, 3, 2, 3, 1, 'Leopoldo Fortunato Galtieri Castelli was an Argentine general and President of Argentina from 22 December 1981 to 18 June 1982, during the last military dictatorship). He was removed from power soon after the British re-took the Falkland Islands, whose invasion and occupation he had ordered.', '', 'John Doe', '', 1, '2020-02-09 20:38:19'),
(2433, 5, 1, 'Довршете го познатиот цитат од 1848: „Сите сили на|старата Европа се обединиле во света хајка против…“', 'баукот на атеизмот', 'баукот на фашизмот', 'баукот на комунизмот', 'баукот на хуманизмот', 3, 3, 1, 0, 0, 'Manifest Komunističke partije, isto tako poznat kao Komunistički manifest, je jedan od najvažnijih političkih proglasa u historiji. Na zahtjev tajne organizacije Savez komunista su ga godine 1847. napisali Karl Marx i Friedrich Engels i objavili u Londonu 21. februara 1848. Uvod počinje poznatim opisom komunizma kao bauka: Bauk kruži Evropom - bauk komunizma. Sve sile stare Evrope sjedinile su se u svetu hajku protiv tog bauka, rimski papa i ruski car, Meternih i Gizo, francuski radikali i nemački policajci.', NULL, 'John Doe', NULL, 1, '2020-03-10 19:01:44'),
(2434, 6, 1, 'Кој во 1965 стана првиот астронаут кој излезе од вселенскиот|брод и во вселената помина 12 минути?', 'Алексеј Леонов', 'Герман Титов', 'Владимир Комаров', 'Валериј Полјаков', 1, 7, 1, 0, 0, 'Алексеј Леонов (роден на 30 мај 1934), советски космонаут, полковник. Прв човек кој претстојувал заштитен со скафандер во космичкиот простор надвор од космичкото летало за време на летот на леталото Васход 2 , 18-19 03.1965, со кое управувал Бељаев.', NULL, 'John Doe', NULL, 1, NULL),
(2435, 5, 1, 'Во кој филм дејствата се одвиваат во 1987 година?', 'Кучиња од резервоарот', 'Огнена лисица', 'Волкот од Wall Street', 'Север северозапад', 3, 8, 1, 0, 0, 'In 1987, Jordan Belfort (Leonardo DiCaprio) takes an entry-level job at a Wall Street brokerage firm. By the early 1990s, while still in his 20s, Belfort founds his own firm, Stratton Oakmont. Together with his trusted lieutenant (Jonah Hill) and a merry band of brokers, Belfort makes a huge fortune by defrauding wealthy investors out of millions. ', NULL, 'John Doe', NULL, 1, NULL),
(2436, 5, 1, 'Со што изобилува т.н. „Трезор на судниот ден“ на|Норвешкиот остров Спитсберген?', 'книги', 'семки', 'злато', 'паладиум', 2, 2, 8, 2, 1, 'U trezoru sudnjeg dana, savremenoj \"Nojevoj barci\" na Arktiku, u kojoj se već devet godina prikupljaju uzorci sjemena biljaka iz cijelog svijeta, još nema ničeg iz Srbije. U norvešku kapsulu, koja će zaštititi bioraznolikost Zemlje u slučaju globalne kataklizme, nedavno su stigle i sjemenke iz BiH. The Svalbard Global Seed Vault is a \"doomsday\" seedbank to store seeds from as many of the world''s crop varieties and their botanical wild relatives as possible.', NULL, 'John Doe', NULL, 1, '2020-03-22 18:38:01'),
(2437, 6, 1, 'Кој доктор рекол: „Само дозата е она што прави |некоја работа да не е отров“?', 'Алојз Алцхајмер', 'Роберт Кох', 'Парацелзус', 'Луј Пастер', 3, 4, 6, 7, 1, 'Парацелзус често се спомнува како татко на токсикологијата. Во таа смисла посебно е значајна неговата реченица: Сите работи се отровни и ништо не е без отров; само дозата е она што прави некоја работа да не е отров. гер. Alle Ding'' sind Gift und nichts ohn'' Gift; allein die Dosis macht, das ein Ding kein Gift ist. Ова останува принцип на токсикологијата. Количината на супстанција е многу важна при нејзината примена. Малите количини имаат позитивен ефект, додека при големи количини можат да бидат и смртоносни. На слична тема напишал и студија за болести и ризици врзани за работа во рудници.', NULL, 'John Doe', NULL, 1, '2020-03-23 19:12:44'),
(2438, 6, 1, 'Кој англиски поет е прв погребан на местото|кое денес е познато како Поетски агол?', 'Кристофер Марлоу', 'Џефри Чосер', 'Џон Милтон', 'Томас Греј', 2, 4, 5, 0, 0, 'Geoffrey Chaucer (/ˈtʃɔːsər/; c. 1343 – 25 October 1400), known as the Father of English literature,[1] is widely considered the greatest English poet of the Middle Ages. He was the first poet to be buried in Poets'' Corner of Westminster Abbey.', '', 'John Doe', '', 1, NULL),
(2439, 5, 1, '„Трагедија е кога ќе си го исечам прстот. Комедија е кога ти паѓаш во|отворена шахта и умираш“, е реченица на авторот на „Младиот Франкенштајн“...', 'Били Вајлдер', 'Гручо Маркс', 'Волт Кели', 'Мел Брукс', 4, 8, 7, 0, 0, '\"Mladi Frankestein\" je najzabavnija, ali i najstrašnija komedija svih vremena. Ako ste mislili da sve znate o dr. Frankensteinu, varate se jer Mel Brooks, kralj filmske parodije, zna bolje, više i smješnije...', NULL, 'John Doe', NULL, 1, '2020-04-15 15:50:23'),
(2440, 5, 1, 'По кое име е позната сојузничката инвазија|на Сицилија во 1943 година?', 'Операција Beagle', 'Операција Husky', 'Операција Shepherd', 'Операција Boxer', 2, 3, 1, 0, 0, 'Saveznička invazija Sicilije započela je 9. srpnja 1943., a završila 17. kolovoza iste godine savezničkom pobjedom. Invazija otoka znana je i kao Operacija Husky i započela je podvodno ratovanje u Talijanskoj kampanji Drugom svjetskom ratu. Strateški, invazija otoka postigla je ciljeve koje su postavili vođe Saveznika: zračne i pomorske sile Sila Osovine protjerane su sa otoka, oslobođeno je Sredozemno more i Mussolini je svrgnut sa moći.', '', 'John Doe', '', 1, '2020-04-11 11:09:23'),
(2441, 5, 1, 'Која од овие хемиски врски е меѓумолекулска?', 'јонска врска', 'метална врска', 'ковалентна врска', 'водородна врска', 4, 7, 3, 0, 0, 'Types of intramolecular forces of attraction: Ionic bond, Covalent bond, polar covalent bond, nonpolar covalent bond, Metallic bonding; Types of intermolecular forces that exist between molecules: Dipole-dipole interactions, Hydrogen bonding, van der Waal forces', NULL, 'John Doe', NULL, 1, '2020-03-07 16:35:52'),
(2442, 5, 1, 'Која глумица е муза на Бергман и|глумела во десет негови филмови?', 'Анита Екберг', 'Брит Екланд', 'Герд Андерсон', 'Лив Улман', 4, 8, 1, 0, 0, 'Лив Јохане Улман (норвешки: Liv Johanne Ullmann, 16 декември 1938, Токио) е норвешка актерка и режисер. Таа е позната како една од \"музите\" на шведскиот режисер Ингмар Бергман.', NULL, 'John Doe', NULL, 1, NULL),
(2443, 5, 1, 'Во која серија Дора Маар прикажала слика на Пикасо? ', 'Жената која плаче', 'Жената која ја нема', 'Жената која ја сакам', 'Жената која ја барам', 1, 8, 1, 1, 2, 'Henriette Theodora Markovitch, pseudonym Dora Maar (1907–1997), was a French photographer, painter, and poet. She was a lover and muse of Pablo Picasso. Dora Maar photographed the successive stages of the creation of Guernica, painted by Picasso in his studio in the rue des Grands-Augustins from May to June 1937; Picasso used these photographs in his creative process. At the same time, she is the principal model of Picasso, who often represents her in tears, she, herself produced several self-portraits entitled: La Femme qui pleure – The Weeping Woman.', NULL, 'John Doe', NULL, 1, '2020-01-06 15:18:46'),
(2444, 5, 1, 'Во кој италијански регион се наоѓа градот Шила?', 'Апулија', 'Калабрија', 'Ломбардија', 'Венето', 2, 2, 1, 0, 0, 'Scilla (Greek: Σκύλλα) is a town and comune in Calabria, Italy, administratively part of the Province of Reggio Calabria. It is the traditional site of the sea monster Scylla of Greek mythology.', NULL, 'John Doe', NULL, 1, NULL),
(2445, 5, 1, 'Која сила, заедно со гравитациската и слабата и јака нуклеарна сила,|е четврта основна сила во традиционалната физика?', 'центрифугалната сила', 'електромагнетна сила', 'силата на триење', 'кориолисовата сила', 2, 7, 4, 0, 0, 'Elektromagnetska sila (kratica EMS) jedno od temeljnih međudjelovanja elementarnih čestica, opisano Maxwellovim objedinjenjem električne i magnetske sile. Primjer je elektrostatička sila između nabijenih čestica koja proizlazi od izmjene virtualnih fotona. U fizici se danas tradicionalno razlikuju četiri osnovna međudjelovanja (interakcije): gravitacijska, elektromagnetska, slaba i jaka. One se značajno razlikuju prema jakosti i ponašanju, ali se smatra da su prve tri posljedica jednog, još temeljnijeg međudjelovanja, što je već pokazano za elektromagnetsku i slabu nuklearnu interakciju.', '', 'John Doe', '', 1, NULL),
(2446, 6, 1, 'Во кој филм дејството започнува во Гетсеманската градина,|додека апостолите мирно спијат под стеблата?', 'Бен Хур', 'Животот на Брајан', 'Пасија', 'Гребен на спасените', 3, 8, 1, 0, 0, 'Гетсиманската градина е една од најпознатите места во историјата на човештвото. Таа се наоѓа под Маслиновата гора, блиску до ѕидините на стариот град во Ерусалим. Гестиманската градина е всушност местото каде Исус Христос ги одржувал повеќето од своите молитви и каде се собирал често пати со своите ученици-апостоли. Тоа е и местото каде Јуда Искариотски дошол со војниците и со бакнеж на левиот образ на Исус го предал на Кајфа. Пасија е американски игран филм од 2004 година, во режија на Мел Гибсон, со Џим Кавизел во главната улога (го игра Исус). Филмот бил снимен во Израел, а сите дијалози се одвиваат на латински и на арамејски јазик. Филмот бил номиниран за три награди „Оскар“. Во филмот се раскажува за последните 12 часа од животот на Исус Христос, а приказната се темели врз евангелијата од Новиот завет, како и визиите на германската калуѓерка Ен Кетрин Емерих. Поради сцените на насилство, филмот предизвикал големи критики.', NULL, 'John Doe', NULL, 1, NULL),
(2447, 5, 1, 'Легендардниот Меровех, кој се претпоставува дека|живеел во 5 век, бил на чело на племето на...', 'Цисалпинските Гали', 'Кримските Татари', 'Салиските Франки', 'Месхетските Турци', 3, 3, 1, 0, 0, 'Меровех (латински: Meroveus или Merovius) бил легендарен основоположник на династијата Меровинзи кои биле Салиски Франки (иако фактички Клодион може да е основоположникот), кое подоцна станало доминантно племе кај Франките. Се мисли дека живеел во првата половина на 5-от век. Неговото латинизирано име потекнува од старогерманската форма Marwig ( māri \"славен\" + wīg \"борба\").[1][2] Првите франкиски кралски династии во негова чест себеси се нарекувале Меровинзи или (\"потомци на Меровех\").', NULL, 'John Doe', NULL, 1, NULL),
(2448, 4, 1, 'На концертниот албум „S&M“ од 1999 година,|S е Симфонија, а M е...', 'Maroon 5', 'Metallica', 'Motorhead', 'Masters of our Universe', 2, 9, 8, 0, 0, 'S&M (an abbreviation of Symphony and Metallica) is a live album by American heavy metal band Metallica, with The San Francisco Symphony conducted by Michael Kamen. It was recorded on April 21–22, 1999 at The Berkeley Community Theatre. This is the final Metallica album to feature Jason Newsted as Metallica''s bassist.', NULL, 'John Doe', NULL, 1, '2020-01-17 18:25:06'),
(2449, 6, 1, 'Со што се занимава населенито Воре за кое Емил Зола |пишува во неговиот роман „Жерминал“?', 'рибарство', 'лозарство', 'сточарство', 'рударство', 4, 4, 4, 0, 0, 'Жерминал — 13. роман од францускиот писател Емил Зола, негово најпознато дело и класик на француската литература. Романот, кој раскажува за штрајкот на копачите на јаглен од северна Франција во 1860-тите, е преведен на повеќе од 100 светски јазици, и пет пати бил поставен на филмското платно. асловот на книгата означува пролетен месец според францускиот републички календар, а зборот жермен на латински значи семе, метафора за подобра иднина на рударите.', NULL, 'John Doe', NULL, 1, NULL),
(2450, 4, 1, 'Кој глумец со кратко име, осум години|го глумел Круз Кастиљо во „Санта Барбара“?', 'А Мартинез', 'Б Мартинез', 'В Мартинез', 'Г Мартинез', 1, 8, 1, 0, 0, 'Adolfo Larrue Martínez III (1948), better known as A Martinez, is an American actor and singer with roles in the daytime soap operas Santa Barbara, General Hospital, One Life to Live, The Bold and the Beautiful, and Days of Our Lives, and the primetime dramas L.A. Law, Profiler, and Longmire. On the big screen, he played the role of Cimmeron in the Western The Cowboys (1972), with John Wayne.', NULL, 'John Doe', NULL, 1, '2020-03-08 15:59:46'),
(2451, 6, 1, 'Кои се првите три добитнички на|Нобелова награда за книжевност?', 'Дорис, Елфрида и Тони', 'Херта, Елис и Светлана', 'Нели, Габриела и Вислава', 'Селма, Грација и Зигрид', 4, 4, 1, 0, 0, '1909 Селма Лагерлеф Шведска, 1926 Грација Деледа Италија, 1928 Зигрид Ундсет Норвешка. Последни [Update: March 2018] 2009 Херта Милер Германија, 2013 Алис Манро Канада, 2015 Светлана Алексиевич         Белорусија', NULL, 'John Doe', NULL, 1, '2020-04-13 14:52:15'),
(2452, 5, 1, 'Што „опејуваат“ песните „Delilah“ на Том Џонс |и „Hey Joe“ на Џими Хендрикс? ', 'грабежи', 'сообраќајни незгоди', 'убиства', 'сиромаштија', 3, 9, 3, 0, 0, 'Hey Joe, I said where you goin'' with that gun in your hand, oh -- I''m goin'' down to shoot my old lady -- You know I caught her messin'' ''round with another man -- I''m goin'' down to shoot my old lady;    At break of day when that man drove away I was waiting // I crossed the street to her house and she opened the door // She stood there laughing // I felt the knife in my hand and she laughed no more // My, my, my Delilah', NULL, 'John Doe', NULL, 1, NULL),
(2453, 4, 1, 'Што зоврива на температура над 100 Целзиусови степени|при непроменет притисок?', 'чистата вода', 'чистиот етанол', 'солената вода', 'хелиумот', 3, 7, 4, 7, 3, 'Water: 100 C; Helium: -269 C; Ethanol: 78.4 C; Water, sea: 100.7 C', '', 'John Doe', '', 1, '2020-02-29 19:28:40'),
(2454, 4, 1, 'Што прави главниот лик во областа Медисон|кој го толкува Клинт Иствуд?', 'фотографира мостови', 'минира мостови', 'гради мостови', 'одржува мостови', 1, 8, 1, 0, 0, 'The Bridges of Madison County is a 1995 American romantic drama film based on the best-selling novel of the same name by Robert James Waller. The film is about an Italian war bride, Francesca (Meryl Streep), who lives with her husband and two children on a farm in Iowa. In 1965, she meets a National Geographic photographer named Robert (Eastwood) and has a four-day extramarital affair with him that changes both their lives forever. ', NULL, 'John Doe', NULL, 1, NULL),
(2455, 4, 1, 'Ако тв-коментаторот повеќепати го спомне|зборот пелотон, истиот коментира...', 'велосипедизам', 'дигање тегови', 'борење', 'хокеј на мраз', 1, 14, 0, 0, 0, 'In a road bicycle race, the peloton (from French, originally meaning ''platoon'') is the main group or pack of riders. Riders in a group save energy by riding close (drafting or slipstreaming) near (particularly behind) other riders. The reduction in drag is dramatic; in the middle of a well-developed group it can be as much as 40%. Exploitation of this potential energy saving leads to very complex cooperative and competitive interactions between riders and teams in race tactics. The term is also used to refer to the community of professional cyclists in general, as in ''the professional peloton.''', NULL, 'John Doe', NULL, 1, NULL),
(2456, 5, 1, 'Која мутантка во филмскиот серијал „Икс-Мен“|ја глумеа Ребека Ромијин и Џенифер Лоренс?', 'Мистик', 'Роуг', 'Сторм', 'Гамбит', 1, 8, 3, 0, 0, 'Jennifer Lawrence, Rebecca Romijn as Raven / Mystique: A mutant with shapeshifting abilities, globally renowned for saving Nixon''s life 10 years prior. Mystique appears in six of the X-Men films: she was portrayed by actress Rebecca Romijn in X-Men, X2 and X-Men: The Last Stand, while Jennifer Lawrence portrayed a younger version of the character in X-Men: First Class (in which Romijn has a cameo), X-Men: Days of Future Past, X-Men: Apocalypse, and the X-Men: Dark Phoenix.', NULL, 'John Doe', NULL, 1, NULL),
(2457, 6, 1, 'Кој род на житарки е настанат|со вкрстување на пченица и `рж?', 'овес', 'хељда', 'просо', 'тритикале', 4, 7, 2, 0, 0, 'Тритикале (лат. Triticosecale, Triticale) је род житарица из фамилије Poaceae, чије се зрно користи за исхрану. Настао је крајем 19. века у Шкотској и Немачкој. Тритикале је синтетичка биљна врста, алополиплоид, и данас постоје две форме: хексаплоидна са 42 хромозома и октоплоидна са 56 хромозома. Овај хибрид садржи све хромозоме вулгаре пшенице, и све хромозоме од ражи. У почетку су је због нутритивне вредности, која је већа и од кукуруза, селекционари и стручњаци за исхрану стоке, препоручивали за исхрану свих врста животиња. Последњих година се све више уводи у људску исхрану, производњу тзв. интегралних производа заједно са пшеничним брашном.', NULL, 'John Doe', NULL, 1, '2020-03-25 18:42:09'),
(2458, 4, 1, 'Во кој архитектонски стил е |Статуата на Исус Христос Искупителот во Рио?', 'арт деко', 'ланд арт', 'поп арт', 'нет арт', 1, 1, 1, 11, 1, 'Christ the Redeemer is an Art Deco statue of Jesus Christ in Rio de Janeiro, Brazil, created by French sculptor Paul Landowski and built by the Brazilian engineer Heitor da Silva Costa, in collaboration with the French engineer Albert Caquot. Romanian sculptor Gheorghe Leonida fashioned the face. Constructed between 1922 and 1931, the statue is 30 metres (98 ft) tall, excluding its 8-metre (26 ft) pedestal. The arms stretch 28 metres (92 ft) wide.', NULL, 'John Doe', NULL, 1, '2020-04-15 16:34:49'),
(2459, 5, 1, 'Каков вид животно е терaпин?', 'птица', 'желка', 'октопод', 'глушец', 2, 12, 0, 0, 0, 'The diamondback terrapin (Malaclemys terrapin) or simply terrapin, is a species of turtle native to the brackish coastal tidal marshes of the eastern and southern United States, and in Bermuda.', NULL, 'John Doe', NULL, 1, '2020-04-18 12:00:23'),
(2460, 5, 1, 'Кој континент се наоѓа најблиску до пресекот на нула степени |географска ширина и нула степени географска должина?', 'Јужна Америка', 'Австралија', 'Африка', 'Антарктик', 3, 2, 7, 0, 0, 'The equator has a mark of zero degrees latitude and the prime meridian one of zero degrees longitude, and the two lines intersect in the Gulf of Guinea, just off the western coast of Africa.', NULL, 'John Doe', NULL, 1, NULL),
(2461, 6, 1, 'Кој мултимилијардер во 2000 година издаде рок-албум|заедно со неговиот бенд, Grown Men?', 'Џефри Безос', 'Пол Ален', 'Ричард Бренсон', 'Пјер Омидјар', 2, 9, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2462, 4, 1, 'Која рок икона го носи прекарот „The Boss“?', 'Мик Џегер', 'Брус Спрингстин', 'Џери Ли Луис', 'Боб Дилан', 2, 9, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2463, 4, 1, 'Кој американски град го памети легендардниот Cotton Club?', 'Њу Јорк', 'Њу Орлеанс', 'Мемфис', 'Детроит', 1, 9, 8, 3, 2, 'The Cotton Club was a New York City night club located first in the Harlem neighborhood on 142nd Street and Lenox Avenue from 1923 to 1935 and then for a brief period from 1936 to 1940 in the midtown Theater District. The club operated most notably during America''s Prohibition Era.', NULL, 'John Doe', NULL, 1, '2020-03-24 23:55:26'),
