(2466, 6, 1, 'Кој од овие термини означува страв при сценски настап,|или уште познато како трема?', 'фонофобија', 'одонтофобија', 'плутофобија', 'топофобија', 4, 5, 3, 0, 0, 'Topophobia is the fear of certain places or situations. The origin of the word topo is Greek (meaning place) and phobia is Greek (meaning fear). Topophobia is considered to be a social phobia', NULL, 'John Doe', NULL, 1, NULL),
