(2469, 5, 1, 'Која изјава често била завршница на|концертите на Елвис Присли?', 'Добра ноќ и со среќа!', 'Бог нека ја благослови Америка', 'Елвис ви посакува добро', 'Елвис ја напушти зградата', 4, 9, 4, 0, 0, '\"Elvis has left the building\" is a phrase that was often used by public address announcers at the conclusion of Elvis Presley concerts in order to disperse audiences who lingered in hopes of an encore. It has since become a catchphrase and punchline.', NULL, 'John Doe', NULL, 1, '2020-04-21 11:26:29'),
(2470, 7, 1, 'Кој моден гуру ја популаризира|мини-сукњата во 1960-тите години?', 'Руди Гернрајх', 'Мери Куант', 'Карл Лагерфелд', 'Бетси Џонсон', 2, 19, 2, 0, 0, 'Dame Barbara Mary Quant, Mrs Plunket Greene (born 11 February 1934) is a Welsh fashion designer and British fashion icon. She became an instrumental figure in the 1960s London-based Mod and youth fashion movements. She was one of the designers who took credit for the miniskirt and hotpants, and by promoting these and other fun fashions she encouraged young people to dress to please themselves and to treat fashion as a game', NULL, 'John Doe', NULL, 1, '2020-03-20 20:21:20'),
(2471, 7, 1, 'Кој беше третиот човек што стапна на месечината?', 'Баз Олдрин', 'Волтер Шира', 'Пит Конрад', 'Мајкл Колинс', 3, 7, 1, 0, 0, 'Charles \"Pete\" Conrad Jr. (June 2, 1930 – July 8, 1999) was an American NASA astronaut, aeronautical engineer, naval officer and aviator, test pilot, and during the Apollo 12 mission became the third man to walk on the Moon. Conrad was selected in NASA''s second astronaut class.', NULL, 'John Doe', NULL, 1, NULL),
