(2475, 6, 1, 'Каде во човековото тело се наоѓа Бовмановата капсула?', 'мозокот', 'бубрезите', 'стомакот', 'белите дробови', 2, 7, 2, 0, 0, 'Bowman''s capsule (or the Bowman capsule, capsula glomeruli, or glomerular capsule) is a cup-like sack at the beginning of the tubular component of a nephron in the mammalian kidney that performs the first step in the filtration of blood to form urine.', NULL, 'John Doe', NULL, 1, NULL),
(2476, 2, 1, 'Вообичаено, режисерското столче е направено од дрво,|а потпората е изработена од…', 'железо', 'платно', 'дрво', 'бамбус', 2, 5, 2, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-04-15 15:47:09'),
(2477, 6, 1, 'Во филмот „Касапски кучиња“ од 1992 година на Квентин Тарантино|главните ликови имаат тајни имиња кои всушност се…', 'животни', 'бои', 'скапоцени камења', 'парични единици', 2, 8, 5, 0, 0, 'Флешбекот на г-дин Портокалов открива како тој станал шпион за полицијата си цел да го фати Кабот. Џо им дава тајни имиња на крадците (на што г-дин Розов и г-дин Кафеав се противат заради нивните бои) и го објаснува планот за грабежот.', NULL, 'John Doe', NULL, 1, NULL),
(2478, 7, 1, 'Популарниот марш кој се слуша на влезот на невестата на многу формални свадби во|западниот свет познатa како „Here Comes The Bride“ е извадок од опера на композиторот…', 'Моцарт', 'Штраус', 'Вагнер', 'Хендл', 3, 9, 7, 0, 0, 'The \"Bridal Chorus\" (German: Treulich geführt) from the 1850 opera Lohengrin by German composer Richard Wagner is a march played for the bride''s entrance at many formal weddings throughout the Western world. In English-speaking countries it is generally known as \"Here Comes the Bride\" or \"Wedding March\", though \"wedding march\" refers to any piece in march tempo accompanying the entrance or exit of the bride, notably Felix Mendelssohn''s \"Wedding March\".', NULL, 'John Doe', NULL, 1, '2020-03-29 12:11:38'),
(2479, 5, 1, '„Поетски медитации“ на Алфонсо де Ламартин|се смета за вистински почеток на францускиот...', 'реализам', 'романтизам', 'симболизам', 'надреализам', 2, 4, 5, 0, 0, 'Алфонс де Ламартин (целосно име: Alphonse-Marie-Louis de Prat de Lamartine; Макон, 21 октомври 1790 - Париз, 28 февруари 1869), француски поет и академик. Со своите дела изврши големо влијание на романтизмот во Франција.', '', 'John Doe', '', 1, NULL),
(2480, 7, 1, 'Кој гостољубиво го прими Одисеј и неговата посада?', 'Еол', 'Кирк', 'Полифем', 'Морфеј', 1, 10, 1, 0, 0, 'Kada je Odisej, na svom povratku iz Troje, pristao sa svojim brodovljem uz obalu Lipari, ugostio ga je Eol. Dirnut njegovom pričom o njegovom lutanju u potrazi za rodnom Itakom, odlučio mu je pomoći. Dao mu je mješinu u koju je zatvorio sve zle vjetrove nepovoljne za plovidbu, a Zefiru, blagom zapadnom vjetru, naredio da ga prati na putovanju.', NULL, 'John Doe', NULL, 1, NULL),
(2481, 4, 1, 'Во која држава се наоѓа родното место на|светскиот ренесансен уметник Микеланџело?', 'Шпанија', 'Италија', 'Франција', 'Грција', 2, 1, 2, 0, 0, 'Микеланџело е роден на 6 март, 1475 година, во Капрезе (денес познато како Капрезе Микеланџело), во близина на Арецо, во Тоскана. Неговите предци со генерации работеле скромно како банкари во Фиренца, меѓутоа неговиот татко, Лудовико ди Леонардо ди Бонароти Симони, не успеал да ја задржи банкарската работа, па повремено успевал да приграби и некоја пониска позиција во редовите на владата.', NULL, 'John Doe', NULL, 1, NULL),
(2482, 4, 1, 'За која состојка во кулинарството Италијанците|го употребуваат зборот помодоро?', 'сирење', 'ананас', 'печурки', 'домати', 4, 19, 7, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2483, 6, 1, 'Која од наведенве држави на своето знаме ја нема црвената боја?', 'Луксембург', 'Литванија', 'Унгарија', 'Естонија', 4, 2, 8, 0, 0, 'Естонија (сино, црно, бело) Унгарија (црвено, бело, зелено) Луксембург (црвено, бело, сино) Литванија (жолто, зелено, црвено)', NULL, 'John Doe', NULL, 1, NULL),
(2484, 3, 1, 'Која планета во Сончевиот систем е именувана|според римската божица на љубовта?', 'Сатурн', 'Плутон', 'Нептун', 'Венера', 4, 7, 1, 10, 2, 'Името на планетата „Венера“ доаѓа од името на Римската божица на љубовта – Венера. Исто така, многу од нејзините географски карактеристики ги носат имињата на мистични и славни жени од историјата.', '', 'John Doe', '', 1, '2020-01-19 12:59:17'),
(2485, 6, 1, 'Како се нарекува точката во орбитата на астрономскиот објект,|каде што тој е најдалеку од својот орбитален фокус?', 'апхел', 'перихел', 'цефеида', 'ефемерида', 1, 7, 1, 0, 0, 'Афел — точка во орбитата на астрономскиот објект, каде што тој е најдалеку од својот орбитален фокус. Поимот со спротивно значење кој ја претставува точката каде што објектот е најблиску до својот орбитален фокус се нарекува „перихел“.', NULL, 'John Doe', NULL, 1, '2020-02-08 18:29:07'),
(2486, 1, 1, 'Што е очекувано дека треба да има секој олигарх?', 'хотел со четири ѕвезди', 'умереност и префинет вкус', 'пари и политичко влијание', 'злобна сопруга и Ферари', 3, 4, 6, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2487, 2, 1, 'Кое живо суштество гнездата ги прави во|дупките на дрвата кои сам ги издупчува?', 'крт', 'зајак', 'еж', 'клукајдрвец', 4, 12, 3, 0, 0, 'Големиот шарен клукајдрвец е жител на шумите и парковите, хранејќи се и гнездејќи на старите дрвја. По дрвјата се движат отсечно, потскокнувајќи со едната нога нанапред.', NULL, 'John Doe', NULL, 1, '2020-02-16 14:33:42'),
(2488, 3, 1, 'Што може да се состои во рецептата за|веганска чоколадна торта?', 'свинска маст', 'авокадо', 'јајца', 'козјо млеко', 2, 19, 7, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-01-18 13:21:03'),
(2489, 4, 1, 'Што по професија е Валканиот Хари, главниот лик|во истоимениот филм портретиран од Клинт Иствуд?', 'бескомпромисeн полицаец ', 'поткуплив судија', 'алчен адвокат', 'корумпиран политичар', 1, 8, 5, 0, 0, 'Филмот е посветен на бескомпромисниот полицаец Хари Калахан, познат по прекарот Валканиот Хари. Хари е полициски инспектор кој не почитува никакви правила, не носи панцир и постојано е во судир со своите претпоставени. Хари е опседнат со мислата самиот да ја истера правдата и да им пресуди на криминалците на својот, понекогаш екстремен, начин. ', NULL, 'John Doe', NULL, 1, NULL),
(2490, 5, 1, 'Каква боја е ромбот на бразилското знаме?', 'зелен', 'жолт', 'црвен', 'црн', 2, 2, 8, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2491, 6, 1, 'За кого Пол Макартни ја напиша песната „Hey, Jude“?', 'за неговата ќерка', 'за синот на Џон Ленон', 'за Јоко Оно', 'за Џорџ Харисон', 2, 9, 1, 0, 0, '\"Hey Jude\" is a song by the English rock band the Beatles, written by Paul McCartney and credited to Lennon–McCartney. The ballad evolved from \"Hey Jules\", a song McCartney wrote to comfort John Lennon''s son, Julian, during his parents'' divorce.', NULL, 'John Doe', NULL, 1, NULL),
(2492, 1, 1, 'На првата седница на секое Народно собрание,|пратениците се заколнуваат дека ќе се раководат според...', 'хороскопскиот знак', 'интересите на народот', 'личниот адвокат', 'докторските препораки', 2, 4, 6, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL);
