(2494, 5, 1, 'Витаминот Б1 има значајна улога во метаболизмот на јаглехидратите.|Под кое име е познат во нутриционизмот?', 'рибофлавин', 'пиридоксин', 'биотин', 'тиамин', 4, 7, 2, 5, 4, 'Тиамин-Б1; Рифофлавин-Б2; Пиридоксин-Б6; Биотин-Б7; Витаминот B1, познат и како тиамин или анеурин е анти бери-бери или антинеуритичен витамин. Прв го изолирал Фанк од лушпата на оризот', NULL, 'John Doe', NULL, 1, '2020-04-21 16:10:47'),
