(2497, 4, 1, 'Колку е просечно широка секоја од 24-те временски зони,|што е всушност бројот на степени што Земјата ротира за еден час?', '8', '15', '24', '30', 2, 2, 8, 0, 0, 'To establish time zones, Earth''s rotation rate of 360 degrees of longitude per day was divided by 24 hours. The result shows that Earth turns 15 degrees of longitude per hour. Adopting time zones that are exactly 15 degrees wide would result in 24 equally spaced time zones around the world. Every four minutes of difference would indicate 1 degree of longitude to the east or the west.', NULL, 'John Doe', NULL, 1, '2020-03-23 18:45:09'),
(2498, 3, 1, 'Симба е свахилски збор што во превод на македонски значи…', 'слон', 'лав', 'жирафа', 'зебра', 2, 5, 3, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-04-09 17:09:08'),
(2499, 2, 1, 'Каква енергија произведуваат големите брани|опремени со генератори?', 'хидроелектрична', 'соларна', 'нуклеарна', 'воздушна', 1, 7, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2500, 3, 1, 'Периодот пред пишаната историја, праисторијата,|најчесто е поделена во три епохи...', 'железо, цинк, никел', 'платина, злато, сребро', 'вода, земја, ветер', 'камен, бронза, железо', 4, 3, 8, 0, 0, 'Трипериодниот систем на праисторијата (камено време, бронзеното време и железното време), останува да се применува за голем дел од Евроазија и Северна Африка, но не се применува во оние делови од светот како што се Америка, Океанија, Австралија и поголемиот дел од Субсахарска Африка каде што изработката на тешките метали пристигнала нагло при контакти со евроазиските култури.', NULL, 'John Doe', NULL, 1, '2020-01-04 15:08:20'),
(2501, 5, 1, 'Кое е буквалното значење на кинескиот поим|„фенг шуи“?', 'дух душа', 'простор свет', 'воздух вода', 'земја оган', 3, 5, 3, 0, 0, 'Feng shui also known as geomancy, is a pseudoscience originating from China, which claims to use energy forces to harmonize individuals with their surrounding environment. It is closely linked to Taoism. The term feng shui literally translates as \"wind-water\" in English.', NULL, 'John Doe', NULL, 1, NULL),
(2502, 6, 1, 'Кој од големите уметници од периодот на ренесансата го наслика|контроверзното дело „Страшниот суд“ кое се наоѓа во Систинската капела?', 'Леонардо', 'Микеланџело', 'Рафаел', 'Тицијан', 2, 1, 2, 0, 0, 'Микеланџело бил ангажиран од папата Климент VII во 1534 - 1541 за да го наслика олтарниот ѕид на капелата. Тој таму го насликал „Страшниот суд“, дело кое своевремено, па и денес, предизвикува контроверзи поради видните луѓе кои уметникот ги сместил во пеколот, како и поради голотијата на фигурите непримерена за христијанскиот морал.', NULL, 'John Doe', NULL, 1, NULL),
(2503, 7, 1, 'Кои народи свештениците ги нарекувале Друиди?', 'Етрурците', 'Античките Германци', 'Иберите', 'Античките Келти', 4, 2, 1, 11, 1, 'Друид (Welsh: derwydd; Стариот ирски: druí; шкотски галски: draoidh) биле членови на високата професионална класа во античките келтски култури. Додека можеби најдобро се запаметени како религиозни лидери, тие исто така беа правни власти, судии, адвокати, медицински професионалци и политички советници. Додека друидите се пријавени дека биле писмени, се верува дека биле спречени од доктрина да го запишат своето знаење во писмена форма, и затоа не оставиле никакви пишани извештаи за себе. Тие сепак се потврдени со детали од нивните современици од други култури, како што се Римјаните и Грците.', NULL, 'John Doe', NULL, 1, NULL),
(2504, 7, 1, 'Која од овие ѕвезди има најголем дијаметар?', 'Антарес', 'Ригел', 'Алдебаран', 'Електра', 1, 7, 1, 0, 0, 'Antares (Radius 680 R☉); Aldebaran (Radius 44.13±0.84 R☉); Електра (Radius 6.06+-0.15 R☉); Rigel (Radius 62 R☉)', NULL, 'John Doe', NULL, 1, NULL),
(2505, 3, 1, 'Кое животно од наведените не може да ги движи очите?', 'крокодил', 'зајак', 'шимпанзо', 'був', 4, 12, 3, 0, 0, 'Owls don''t have eyeballs. The eyes are long and shaped more like a tube. Owl eyes can''t turn in their sockets because of this shape.', NULL, 'John Doe', NULL, 1, NULL),
(2506, 6, 1, 'Кој од овие херои успеал да избега по падот на Троја?', 'Хектор', 'Троил', 'Парис', 'Енеј', 4, 3, 1, 0, 0, 'That night, at a banquet in his honor, Aeneas tells Dido the story of how Troy was captured, and how he escaped, carrying his father, Anchises, on his back, and leading his son, Ascanius, by the hand. (His wife, Creusa, died in the chaos – making Aeneas single, too.)', NULL, 'John Doe', NULL, 1, NULL),
(2507, 6, 1, 'Кого Сандро Милер го фотографирал да изгледа како|Џон Ленон, Пабло Пикасо, Салвадор Дали и многу други?', 'Кристофер Вокен', 'Дастин Хофман', 'Џон Малкович', 'Роберт Де Ниро', 3, 19, 4, 0, 0, 'Established photographer Sandro Miller, together with long time friend and Hollywood legend John Malkovich, created a witty project called “Malkovich, Malkovich, Malkovich: Homage to photographic masters.” As the title suggests, the creative duo’s photo series reimagines the world‘s most iconic portraits with Malkovich as the main subject instead.', NULL, 'John Doe', NULL, 1, '2020-04-13 14:58:19'),
(2508, 7, 1, 'Со кој прекар францускиот крал Луј Филип,|владеел од 1830 до 1848 година?', '„кралот-граѓанин“', '„огнениот крал“', '„кралот-селанец“', '„кралот-убиец“', 1, 3, 1, 0, 0, 'Луј-Филип (роден на 6 октомври 1773 во Париз - починал на 26 август 1850 во Клејрмонт) бил крал на Французите од Орлеанската династија. Тој бил познат и како „кралот-граѓанин“ и му се восхитувал на моделот на англиската монархија, кој се обидел да го воведе и во Франција. Неговото владеење се карактеризира со брз развој и богатење на буржоазијата и осиромашување на сиромашните, што довело до крајот на неговото владеење.', '', 'John Doe', '', 1, NULL),
(2509, 6, 1, 'На кои долари се наоѓаат Ернест Радерфорд,|Едмунд Хилари и Кејт Шепард?', 'на австралиските', 'на канадските', 'на новозеландските', 'на сингапурските', 3, 16, 3, 0, 0, '', '', 'John Doe', '', 1, '2020-04-15 15:52:29'),
(2510, 5, 1, 'По кој хистолог е наречена мрежастата материја која е во|близина на клеточното јадро во која се собираат секрети?', 'Александар Скене', 'Бартоломео Еустахи', 'Камило Голџи', 'Теодор Шван', 3, 7, 2, 0, 0, 'Голџиев систем е органела која е именувана по италијанскиот научник Камилио Голџи. Голџиевиот систем е изграден од голем број нееднакво дебели и делумно свиткани мембрански структури, сродни на ендоплазматичниот ретикулум, наречени диктиозоми, кои најчесто се наоѓаат околу јадрото.', NULL, 'John Doe', NULL, 1, '2020-01-18 19:31:26'),
(2511, 5, 1, 'Од каков жанр се снимени неколку филмови|со Елвис Присли, а притоа не се музички?', 'авантуристички', 'воен', 'хорор', 'вестерн', 4, 9, 4, 8, 3, 'Flaming Star was the second of three serious Western films made by Elvis Presley. For my money, it was the best, far better than either Love Me Tender or Charro!. It was another small step forward for Elvis in his goal of becoming a serious actor.', NULL, 'John Doe', NULL, 1, NULL),
(2512, 4, 1, 'Се заљубил во „златокоса“, а се оженил со нејзината|имењачка со „бели раце“. Кој е овој несреќен лик?', 'Пирам', 'Ромео', 'Тристан', 'Казанова', 3, 4, 2, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-08 16:20:00'),
(2513, 5, 1, 'Која држава својата водечка положба на Балтичкиот регион ја препуштила|на Русија по поразот во Северната војна во првата половина на 18 век?', 'Данска', 'Полска', 'Шведска', 'Финска', 3, 3, 1, 0, 0, 'Uzrok rata bio je borba za prevlast na prostoru šire jugoistočne obale Baltika. Dominantna Švedska je nakon početnih pobjeda nad Poljsko-litavskom državom počela gubiti rat protiv Rusije koja je stvorila opozicijsku koaliciju. (Veliki Sjeverni Rat)', NULL, 'John Doe', NULL, 1, NULL),
(2514, 5, 1, 'Во седумте слободни вештини, реториката ја претставува Цицерон, |геометријата Евклид, а аритметиката Питагора. Кој ја претставува логиката?', 'Аристотел', 'Платон', 'Сократ', 'Талес', 1, 4, 8, 0, 0, 'sedam slobodnih vještina tradicionalni srednjovjekovni curriculum svjetovne izobrazbe koji se dijelio na dvije skupine, trivij (gramatika, logika i retorika) i kvadrivij (geometrija, aritmetika, astronomija i glazba); svaka je disciplina predstavljena ženskom personifikacijom i povijesnom osobom: gramatika — Priscijan (ili Donat), logika — Aristotel, retorika — Ciceron, geometrija — Euklid, aritmetika — Pitagora, astronomija — Ptolomej, glazba — Tubalkain;', NULL, 'John Doe', NULL, 1, NULL),
(2515, 5, 1, 'Кој стрип најчесто има само две слики по страница?', 'Алан Форд', 'Изабела', 'Загор', 'Текс Вилер', 1, 4, 7, 0, 0, 'Pored rečenog, serijal je prepoznatljiv i po osebujnom Magnusovom crtačkom stilu, pomoću kojega je uspijevao dati sjajnu vizualnu karakterizaciju likova i situacija, te neobičnom formatu 22 x 14 cm sa dva kadra (slike) na jednoj stranici.', NULL, 'John Doe', NULL, 1, NULL),
(2516, 5, 1, 'Во кој германски град се наоѓа највисоката црква во светот?', 'Бон', 'Хамбург', 'Келн', 'Улм', 4, 2, 1, 0, 0, '1ST: Ulm Minster, Ulm, Germany – 161.5 m (530 ft) – The tallest cathedral in the world is also the latest cathedral built among all the European churches in this list. ... 2ND: Lincoln Cathedral, Lincoln, England – 159.7 m (524 ft) – The Lincoln Cathedral was the tallest building in the world from its completion in 1311 till 1549.', NULL, 'John Doe', NULL, 1, NULL),
(2517, 6, 1, 'Кој негирал дека е егзистенцијалист и се чудел|кога своето име било поврзано со Жан Пол Сартр?', 'Мартин Хајдегер', 'Серен Кјеркегор', 'Артур Рембо', 'Албер Ками', 4, 4, 1, 0, 0, 'Најзначајни преставници на егзистенцијализмот се Жан-Пол Сартр, Симон де Бовоар, Морис Мерло-Понти, а некој го приклучуваат и Албер Ками. Најголем претставник на овој правец е Жан-Пол Сартр. Тој бил под влијание на Хегел, Кјеркегор, Макс Шелер, Мартин Хајдегер и особено на Хусрел, а во својата последна фаза бил под влијание и на Карл Маркс. ', NULL, 'John Doe', NULL, 1, '2020-03-07 11:48:19'),
(2518, 5, 1, 'Каде буквално експлодира господин Кресо во|„Смислата на животот на Монти Пајтон“?', 'во базен', 'во ресторан', 'во воз', 'во авион', 2, 8, 0, 0, 0, 'Mr. Creosote is a fictional character who appears in Monty Python''s The Meaning of Life. He is a monstrously obese restaurant patron who is served a vast amount of food whilst vomiting repeatedly. After being persuaded to eat an after-dinner mint, he explodes in a very graphic way. ', '', 'John Doe', '', 1, '2020-02-09 20:28:16'),
(2519, 5, 1, 'Во која група кариерата ја започна хитмејкерот|Винс Кларк, члeн на дуaтa Yazoo и Erasure?', 'Depeche Mode', 'Genesis', 'Talking Heads', 'Duran Duran', 1, 9, 4, 0, 0, 'Vince Clarke (born Vincent John Martin; 3 July 1960) is an English synthpop musician and songwriter. Clarke has been the main composer and musician of the band Erasure since 1985, and was previously the main songwriter of several groups, including Depeche Mode, Yazoo, and The Assembly.', NULL, 'John Doe', NULL, 1, '2020-02-09 20:34:57'),
(2520, 5, 1, 'Која е веројатно најпознатата максима од филмот|„Друштво на мртвите поети“?', 'Carpe diem', 'O tempora, o mores', 'Res, non verba', 'In vino veritas', 1, 8, 1, 4, 6, 'Друштвo на мртвите поети е филм од 1989 година во режија на Питер Вир. Дејството се случува во 1959 година во едно аристократско и подготвително училиште и раскажува приказна за професор по англиски јазик кој ги инспирира своите ученици да ги променат своите конформистички животи преку неговите предавања на поезија и литература.', NULL, 'John Doe', NULL, 1, NULL),
(2521, 6, 1, 'Кои галерии или музеи се споени со долг затворен ходник?', 'Лувр и Орсеј', 'Прадо и Софија', 'Уфици и Пити', 'Гугенхајм и Дали', 3, 1, 2, 2, 1, 'Vasari corridor (from Palazzo Vecchio to Uffizi)', NULL, 'John Doe', NULL, 1, '2020-05-03 13:22:41'),
(2522, 7, 1, 'На погребот на кој композитор немало цвеќиња,|бидејќи биле искористени за испраќањето на Сталин?', 'Михаил Глинка', 'Сергеј Прокофјев', 'Дмитри Шостакович', 'Александар Молосов', 2, 9, 7, 0, 0, 'At Prokofiev''s funeral there were no flowers: Stalin''s men had rounded up all winter blooms. There were few mourners, barely 40, because all attention was directed to the national loss.', NULL, 'John Doe', NULL, 1, NULL),
(2523, 6, 1, 'Стихот „Биди моја вода, ја сум сега оган“ да е створен|во античкиот период, би го „отпеале“ двата филозофи...', 'Анаксимен и Анаксимандар', 'Леукип и Демокрит', 'Талес и Хераклит', 'Диоген и Епиктет', 3, 4, 8, 0, 0, 'Според Хераклит, основата и симболот на промените е огнот, најверојатно е дека Хераклит бил под влијание на источните учења, првенствено на Заратустра и од таму го зел огнот како симбол. За Хераклит огнот е архе. Основач на оваа школа е Талес, филозоф кој за архе ја гледа водата. Она бесконечното и неуништливото, она трајното и непроменливото, она што е прапричина за постоењето на Светот - тоа е водата. Diogen believed air to be the one source of all being, and, as a primal force, to be intelligent.', NULL, 'John Doe', NULL, 1, NULL),
(2524, 5, 1, 'Кој е насловот на првото дело од филмскиот серијал|„Хрониките на Ридик“, со Вин Дизел во улога на Ридик?', 'Планета на мајмуните', 'Планета на темнината', 'Планета на теророт', 'Планета на марсовците', 2, 8, 3, 0, 0, 'The series follows the adventures of antihero character Riddick (either portrayed or voiced by Vin Diesel) in the 28th century. The Chronicles of Riddick fictional universe was initially created with the release of Pitch Black.', NULL, 'John Doe', NULL, 1, '2020-02-29 19:17:59'),
(2525, 3, 1, 'Кои две соседни букви од англиската абецеда се во|називот на дводимензионалниот графички код?', 'HI', 'VW', 'XY', 'QR', 4, 5, 2, 0, 0, 'QR code is the trademark for a type of matrix barcode (or two-dimensional barcode) first designed for the automotive industry in Japan', NULL, 'John Doe', NULL, 1, '2020-02-09 20:22:22'),
(2526, 6, 1, 'Кое владеење започнало веднаш по преземањето на кормилото|од страна на Веспазијан во пресвртната „година на четирите цареви“?', 'Антониевското владеење', 'Флавиевското владеење', 'Јулиевското владеење', 'Теодосиското владеење', 2, 3, 1, 0, 0, 'Веспазијан је био први владар из династије Флавијеваца. Током своје десетогодишње власти, Веспазијан је политички и финансијски успео да стабилизује прилике у Римском царству.', NULL, 'John Doe', NULL, 1, '2020-02-08 18:16:32'),
(2527, 4, 1, 'Во кој град живее анимираното семејство Кременко?', 'Флинстон', 'Бедрок', 'Маунтинрок', 'Хардрок', 2, 8, 4, 0, 0, 'The Flintstones were the modern Stone Age family. Residing in Bedrock, Fred Flintstone worked an unsatisfying quarry job, but returned home to lovely wife Wilma and eventually daughter Pebbles', NULL, 'John Doe', NULL, 1, '2020-03-20 20:07:43'),
(2528, 4, 1, 'Кој во четири пеења го опеал|развратниот живот на витезот Харолд?', 'Џорџ Гордон Бајрон', 'Вилијам Вордсворт', 'Џон Китс', 'Перси Биш Шели', 1, 4, 5, 0, 0, 'Странствувањето на Чајлд Харолд е дело на Џорџ Гордон Бајрон (1788-1824), напишана во текот на неговото патување по средоземјето, а која по враќањето дома му носи неочекувана и мигновена слава.', '', 'John Doe', '', 1, NULL),
(2529, 5, 1, 'Кој месец е најсуров|во поемата „Пуста Земја“ на Т. С. Елиот?', 'јануари', 'април', 'август', 'октомври', 2, 4, 5, 0, 0, 'Pusta zemlja je duga poema čiji je autor Tomas Sterns Eliot, koja je široko priznata kao jedna od najpoznatijih poema 20. veka i najznačajnije delo moderne poezije. Poznata je po frazama poput „April je najsvirepiji mesec“, „Pokazaću ti strah u pregršti praha“ i mantri na jeziku sanskrit „Shantih, shantih, shantih“.', NULL, 'John Doe', NULL, 1, NULL),
(2530, 5, 1, 'Сојузничките конвои на Атлантикот за време на Втората светска војна|стравувале од нападите на германските подморници, односно од...', 'рој комарци', 'стампедо слонови', 'чопор волци', 'јато гаврани', 3, 3, 1, 0, 0, 'The term wolfpack refers to the mass-attack tactics against convoys used by German U-boats of the Kriegsmarine during the Battle of the Atlantic, and by submarines of the United States Navy against Japanese shipping in the Pacific Ocean in World War II.', '', 'John Doe', '', 1, '2020-03-29 12:11:16'),
(2531, 5, 1, 'На која буква почнува италијанскиот назив на реката Соча?', 'A', 'E', 'I', 'O', 3, 2, 1, 0, 0, 'Соча (словенечки: Soča, италијански: Isonzo, фурлански: Lusinç) — река во западна Словенија и североисточна Италија со должина од 138 км, од кои 96 км се на словенечка, а 43 км на италијанска територија.', NULL, 'John Doe', NULL, 1, '2020-04-15 16:18:16'),
