(2538, 7, 1, 'Како уште се нарекува двогрбата камила?', 'партска камила', 'бактријска камила', 'нубијска камила', 'медејска камила', 2, 12, 2, 0, 0, 'Двогрба камила (латински: Camelus bactrianus) — типична камила од централноазиски степи и пустини. Од едногрбите камили се разликуваат во тоа што имаат два грба. Научното име го добила по Бактрија, античка држава, која постоела на тлото на Централна Азија. Бактријската камила може да издржи без вода 4 до 5 дена.', '', 'John Doe', '', 1, '2020-03-20 20:03:39'),
(2539, 7, 1, 'Хекатонхири Кот, Бријареј и Гиј во грчката митологија биле три браќа.|Колку глави имале заедно?', '6', '30', '150', '600', 3, 10, 1, 0, 0, 'Во грчката митологија, Хекатонхирите се викаат Бријареј, Кот и Гиг. Секој од нив има сто раце и педесет глави кои плукаат оган. Тие, исто така, се браќа на Титаните и на Киклопите. ', NULL, 'John Doe', NULL, 1, NULL),
