(2551, 5, 1, 'Кој државник е убиен додека се возел во автомобил?', 'Улоф Палме', 'Франц Фердинанд', 'Роберт Ф. Кенеди', 'Лав Троцки', 2, 3, 1, 0, 0, 'At 10:10 am, Franz Ferdinand''s car approached and Čabrinović threw his bomb. The bomb bounced off the folded back convertible cover into the street. The bomb''s timed detonator caused it to explode under the next car, putting that car out of action wounding 16–20 people.', NULL, 'John Doe', NULL, 1, NULL),
(2552, 5, 1, 'Антијунаците во „Пеколниот Портокал“ говорат „надсатски“,|жаргон кој комбинира зборови од англискиот и...', 'шпанскиот јазик', 'италијанскиот јазик', 'кинескиот јазик', 'рускиот јазик', 4, 4, 2, 0, 0, 'Nadsat is a fictional register or argot used by the teenagers in Anthony Burgess''s novel A Clockwork Orange. In addition to being a novelist, Burgess was a linguist and he used this background to depict his characters as speaking a form of Russian-influenced English. ', NULL, 'John Doe', NULL, 1, NULL),
(2553, 4, 1, 'На кого или на што Голум се обраќа со „My precious“?', 'на Фрод', 'на Гендалф', 'на Саруман', 'на прстенот', 4, 8, 7, 0, 0, 'Gollum is a fictional character from J. R. R. Tolkien''s legendarium. He was introduced in the 1937 fantasy novel The Hobbit, and became an important supporting character in its sequel, The Lord of the Rings. The Ring, which Gollum referred to as \"my precious\" or \"precious\", extended his life far beyond natural limits.', NULL, 'John Doe', NULL, 1, '2020-02-29 19:16:43'),
(2554, 5, 1, 'Три држави го „делат“ брегот на...', 'Јонското Море', 'Тиренското Море', 'Егејското Море', 'Јадранското Море', 1, 2, 1, 0, 0, 'Јонското Море претставува дел на Средоземно Море, јужно од Јадранско Море. На запад граничи со јужна Италија, поточно со Калабрија и Сицилија, а на исток со југоисточна Албанија и со голем број на грчки острови, меѓу кои Крф, Закинтос, Кефалонија, Левкас и Итака. ', NULL, 'John Doe', NULL, 1, NULL),
(2555, 5, 1, 'Која од наведениве е најголема брзина на движење?', '2 метри во секунда', '5 милји на час', '7 чворови', '10 километри на час', 3, 6, 2, 0, 0, '1 čvor = 1 nautička milja/sat = 1,852 km/h.    5 miles/hour = 8.04672 km/h   2 meters/s = 7.2 km/h    7 чворови = 12.95 km/h', NULL, 'John Doe', NULL, 1, '2020-01-06 15:08:31'),
(2556, 6, 1, 'Со кое царство владеел Џелалудин Мухамед,|познат и како Акбар Велики?', 'Османско царство', 'Могулско царство', 'Ахемендско царство', 'Селеукидско царство', 2, 3, 1, 0, 0, 'Џелалудин Мухамед Акбар попознат како Акбар Велики (Умаркот, Синд, 15 август 1542 - Агра 16 август 1605) бил владетел на Могулското Царство од 1556 година. Роден е во Иран како бегалец, а на престолот доаѓа како законит наследник на неговиот татко Хумајун на 13 годишна возраст. Тоа е единствениот случај во историјата на могулската династија некој да дојде на власт без војна или крвопролевање.', NULL, 'John Doe', NULL, 1, '2020-04-25 14:55:54'),
(2557, 4, 1, 'Која карта во блекџек има две вредности?', 'крал', 'ас', 'дама', 'деветка', 2, 19, 8, 0, 0, 'Karte sa brojevima vrede onoliko bodova koliki je broj, a žandar (J), dama (Q) i kralj (K) vrede po 10 bodova. Kec (A) vredi 11 bodova, ako je zbir drugih karata 10 ili manji; odnosno 1 bod ukoliko je zbir drugih karata 11 ili veći. Međutim, ako igrač ima dva asa (keca), jedan od njih mora vredeti 11 bodova, osim ako sve ostale karte zajedno vrede 10 ili više bodova. U slucaju da igrač u početnom deljenju dobije Asa i (10, J, Q ili K) automatski pobeđuje, njemu se isplaćuje 3:2 od uloženog (to se zove blekdžek). Kada krupije dobije Asa kao jednu od dve karte (kartu okrenutu licem na gore), otvara se mogućnost “osiguranja igrača”. Igrač u tom slučaju može da uloži do polovine svog uloga da će krupije kao drugu kartu izvući 10, J, Q ili K. U tom slučaju, isplaćuje mu se u odnosu 2:1 (vrednost osiguranja se množi koeficijentom 2).', NULL, 'John Doe', NULL, 1, '2020-01-06 15:06:42'),
(2558, 5, 1, 'Кој во 387 година п.н.е. ја основал|филозофската школа во Академската градина?', 'Сократ', 'Аристотел', 'Платон', 'Диоген', 3, 4, -1, 0, 0, 'Платон е старогрчки филозоф, математичар, ученик на Сократ, автор на филозофски дијалози, основач на Академијата во Атина, првата институција за високо образование во Западниот свет.', '', 'John Doe', '', 1, NULL),
(2559, 2, 1, 'Каква „боја“ е фондот во кој|чувате пари за посебни намени?', 'бел', 'црн', 'розев', 'зелен', 2, 4, 6, 0, 0, 'Црн фонд претставува паричен фонд за тајни плаќања, мито на лицата за некоја тајна активност или нелегални услуги, но најчесто за покривање на непредвидени трошоци.', NULL, 'John Doe', NULL, 1, NULL),
(2560, 2, 1, 'Како се вика компјутерската игра која е позната|повеќе од 20 години?', 'Age of Aquarius', 'Age of Discovery', 'Age of Empires', 'Age of Dawn', 3, 19, 8, 0, 0, 'Age of Empires is a series of historical real-time strategy video games, originally developed by Ensemble Studios and published by Microsoft Studios. The first title of the series was Age of Empires, released in 1997.', NULL, 'John Doe', NULL, 1, '2020-03-07 16:38:40'),
(2561, 4, 1, 'Кој град според легендата го основала Либуша?', 'Братислава', 'Варшава', 'Рига', 'Прага', 4, 3, 1, 2, 1, 'Libuše Libussa, Libushe or, historically Lubossa, is a legendary ancestor of the Přemyslid dynasty and the Czech people as a whole. Libuše is said to have been the youngest daughter of the equally mythical Czech ruler Krok. ', NULL, 'John Doe', NULL, 1, NULL),
(2562, 4, 1, 'Во кој филм не е снимена ниту една сцена|во градот од насловот на филмот?', 'Филаделфија', 'Нешвил', 'Казабланка', 'Манчестер покрај море', 3, 8, 1, 0, 0, 'Casablanca, located in the central-western part of Morocco bordering the Atlantic Ocean, is the largest city in Morocco. Casablanca''s (movie) principal photography began on May 25, 1942, ending on August 3; the film was shot entirely at Warner Bros. Studios in Burbank, California with the exception of one sequence at Van Nuys Airport in Van Nuys, Los Angeles.', NULL, 'John Doe', NULL, 1, NULL),
(2563, 5, 1, 'Коja од следниве не е држава во Јужна Америка?', 'Боливија', 'Еквадор', 'Папуа Нова Гвинеја', 'Суринам', 3, 2, 2, 0, 0, 'Независна Држава Папуа Нова Гвинеја — држава во Океанија, која го зазема источниот дел на островот Нова Гвинеја и многубројни околни острови. Островот се наоѓа во југозападниот дел на Тихиот Океан, во регионот Меланезија. Главен град на Папуа Нова Гвинеја е Порт Морзби.', NULL, 'John Doe', NULL, 1, NULL),
(2564, 6, 1, 'Која од следниве личности во своето творештво|ја има првата модерна европска комедија „Мандрагола“?', 'Николо Макијавели', 'Вирџинија Вулф', 'Еуџенио Монтале', 'Бертранд Расел', 1, 4, 1, 0, 0, 'The Mandrake (Italian: La Mandragola) is a satirical play by Italian Renaissance philosopher Niccolò Machiavelli. Although the five-act comedy was published in 1524 and first performed in the carnival season of 1526, Machiavelli likely wrote The Mandrake in 1518 as a distraction from his bitterness at having been excluded from the diplomatic and political life of Florence following the 1512 reversion to Medici rule. ', NULL, 'John Doe', NULL, 1, '2020-02-09 20:29:22'),
(2565, 5, 1, 'Кој е најпознат по својата политичка расправа „Владетелот“?', 'Рене Декарт', 'Томас Хобс', 'Имануел Кант', 'Николо Макијавели', 4, 4, 1, 4, 3, '„Владетелот“ (италијански: Il Principe) — политичка расправа од фиренскиот чиновник и политички теоретичар Николо Макијавели. Била напишана во 1513 година, и првобитно била насловена „За кнежевствата“ (De Principatibus)', NULL, 'John Doe', NULL, 1, NULL),
(2566, 5, 1, 'Што предвидуваат картите за Кармен и Хозе|во третиот чин на операта Кармен?', 'пари', 'свадба', 'смрт', 'деца', 3, 9, 7, 0, 0, 'Frasquita and Mercédès amuse themselves by reading their fortunes from the cards; Carmen joins them and finds that the cards are foretelling her death, and José''s. Сцена почиње сликом кријумчара (међу њима и Кармен) како се пробијају кроз планину. Кармен се заситила Хосеа и хоће да га се реши, и због тога она и њене другарице бацају карте да би сазнале судбину. Карте показују скору смрт за Кармен. У близини Микаела тражи Хосеа по планини у нади да ће га спасити и одвратити од Кармен. ', '', 'John Doe', '', 1, '2020-04-15 16:35:44'),
(2567, 4, 1, 'Кој е измислен лик од серијалот|„Twilight“ на Стефани Мајер?', 'Едвард Кален', 'Пета Меларк', 'Кило Рен', 'Тирион Ланистер', 1, 8, 7, 0, 0, 'Едвард Кален (англиски: Edward Cullen) е вампир кој, за време на серијалот се вљубува, се оженува, и има дете со Бела Свон, тинејџерка девојка која подоцна одлучува да стане вампир исто така. Во филмската адаптација на серијалот, Едвард е толкуван од актерот Роберт Патинсон.', NULL, 'John Doe', NULL, 1, '2020-03-20 20:14:36'),
(2568, 5, 1, 'Од што се плаши лицето ако страда од гимнофобија?', 'голотија', 'паѓање', 'гужва', 'математика', 1, 5, 3, 0, 0, 'Gymnophobia: An abnormal and persistent fear of nudity. Sufferers of this phobia experience undue anxiety even though they realize their fear is irrational. They may worry about seeing others naked or being seen naked, or both.', NULL, 'John Doe', NULL, 1, NULL),
(2569, 6, 1, 'Кој филозоф своето прво позначајно дело „Елементите на законот“|го напишал по бегството во Франција во 1640 година?', 'Томас Хобс', 'Френсис Бејкон', 'Емил Диркем', 'Рене Декарт', 1, 4, 8, 0, 0, 'Своето прво позначајно дело „Елементите на законот“ го напишал по бегството во Франција во 1640 година, т.е. кога имал над 50 години, а делото било објавено кога Хобс имал 62 години. Хобс немал единствено мислење околу тоа, која државна форма е најдобра - монархијата, аристократијата или демократијата. Така, во делото „Elements of law“, тој се произнесол дека монархијата е најдобра форма на владеење', NULL, 'John Doe', NULL, 1, '2020-02-16 14:38:39'),
(2570, 5, 1, 'Во која држава се наоѓа пустината Гибсон?', 'Австралија', 'САД', 'Канада', 'Јужна Африка', 1, 2, 5, 0, 0, 'The Gibson Desert, an interim Australian bioregion, is a large desert that covers a large dry area in the state of Western Australia and is still largely in an almost \"pristine\" state. It is about 155,000 square kilometres (60,000 sq mi) in size, making it the fifth largest desert in Australia, after the Great Victoria, Great Sandy, Tanami and Simpson deserts.', NULL, 'John Doe', NULL, 1, NULL),
(2571, 6, 1, 'Кој писател го има напишано романот|„Касапницата-Пет или Детска крстоносна војна“?', 'Курт Вонегат', 'Џон Ирвинг', 'Ернест Хемнгвеј', 'Џон Стајнбек', 1, 4, 1, 4, 4, 'Касапницата-Пет или Детска крсоносна војна (англиски: Slaugtherhouse-Five or The Children''s Crusade) - роман на американскиот писател Курт Вонегат. Врз основа на романот, во 1971 година бил снимен истоимениот филм, во режија на Џорџ Рој Хил', NULL, 'John Doe', NULL, 1, NULL),
(2572, 7, 1, 'Во која земја кралот Фарук мораше да се откаже|од кралската функција во 1952 година?', 'Португалија', 'Непал', 'Египет', 'Перу', 3, 2, 4, 3, 4, 'Farouk I was the tenth ruler of Egypt from the Muhammad Ali dynasty and the penultimate King of Egypt and the Sudan, succeeding his father, Fuad I, in 1936. His full title was \"His Majesty Farouk I, by the grace of God, King of Egypt and the Sudan, Sovereign of Nubia, of Kordofan and of Darfur\". He was overthrown in the 1952 military coup d''état and forced to abdicate in favour of his infant son, Ahmed Fuad, who succeeded him as Fuad II. He died in exile in Italy in 1965.', NULL, 'John Doe', NULL, 1, NULL),
(2573, 6, 1, 'Кој натпис, според патописецот Павзениј|стои над влезот во Аполоновиот храм во Делфи?', 'Спознај се себеси', 'Еурека!', 'Се тече, се се менува', 'Знам дека ништо не знам', 1, 2, 1, 4, 8, 'The Ancient Greek aphorism \"know thyself\" (Greek: γνῶθι σεαυτόν, transliterated: gnōthi seauton; also ... σαυτόν … sauton with the ε contracted), is one of the Delphic maxims and was inscribed in the pronaos (forecourt) of the Temple of Apollo at Delphi according to the Greek writer Pausanias (10.24.1).', '', 'John Doe', '', 1, '2020-03-25 19:11:37'),
(2574, 6, 1, 'Колку Крстоносни војни се воделе во 11 век?', 'ниту една', 'една', 'две', 'три', 2, 3, 1, 0, 0, 'Прва крстоносна војна 1095, Втора крстоносна војна 1147, Трета крстоносна војна 1187', NULL, 'John Doe', NULL, 1, NULL),
(2575, 5, 1, 'Во кој видеоспот на Мајкл Џексон,|на крајот се претвора во црн пантер?', 'Billie Jean', 'Black or White', 'Thriller', 'Beat It', 2, 9, 1, 0, 0, '\"Black or White\" is a single by American singer and songwriter Michael Jackson. The song was released by Epic Records on November 11, 1991. Controversy was generated concerning the last four minutes of the original music video. Jackson walks out of the studio as a black panther and then morphs into himself. Then he walks outside to perform some of his most physically complicated dance techniques, in a similar way to \"Billie Jean\". ', NULL, 'John Doe', NULL, 1, '2020-03-25 19:07:12'),
(2576, 6, 1, 'Со што се занимавал Грегор Самса се до моментот |кога во кобното утро се буди како џиновски инсект?', 'чиновник во банка', 'поштенски службеник', 'трговски патник', 'одгледувач на пчели', 3, 4, 2, 4, 7, 'The Metamorphosis (German: Die Verwandlung) is a novella written by Franz Kafka which was first published in 1915. One day, Gregor Samsa, a traveling salesman, wakes up to find himself transformed into a giant insect (the most common translation of the German description ungeheures Ungeziefer, literally \"monstrous vermin\"). He reflects on how dreary life as a traveling salesman is.', NULL, 'John Doe', NULL, 1, NULL),
(2577, 5, 1, 'Која држава во својот состав ги има Пелагијските острови?', 'Грција', 'Италија', 'Турција', 'Португалија', 2, 2, 1, 0, 0, 'Пелагијска острва (итал. Isole Pelagie) је мали архипелаг у Средоземном мору између Сицилије и туниске обале, који припада Италији.', NULL, 'John Doe', NULL, 1, NULL),
(2578, 5, 1, 'Кој бил претседател на САД |за време на Првата светска војна?', 'Келвин Кулиџ', 'Теодор Рузвелт', 'Вудро Вилсон', 'Херберт Хувер', 3, 3, 2, 0, 0, 'Томас Вудро Вилсон (28 декември 1856, Стентон, Вирџинија - 3 февруари 1924, Вашингтон) бил 28-миот претседател на Соединетите Американски Држави. Тој бил претседател на САД од 4 март во 1913 година до 3 март, 1921, за време на Првата светска војна. Тој бил награден со Нобелова награда за мир.', NULL, 'John Doe', NULL, 1, NULL),
(2579, 5, 1, 'Кој Бразилец во 2007 беше последниот играч кој ја освоил|„Златната топка“ пред доминацијата на Меси и Роналдо?', 'Роналдињо', 'Вијеира', 'Роналдо', 'Кака', 4, 14, 1, 0, 0, 'Во Милан, Кака го доживеа свите најблескави моменти во кариерата освојувајќи ја Серија А и Лигата на Шампионите, а во 2007 година тој беше прогласен за играч на годината и ја доби Ballon d''Or наградата. ', NULL, 'John Doe', NULL, 1, NULL),
(2580, 4, 1, 'Кој компјутерски програм е бесплатен, но само|во одреден рок со ограничени функционалности?', 'freeware', 'shareware', 'careware', 'beerware', 2, 7, 6, 0, 0, 'Freeware refers to software that anyone can download from the Internet and use for free. Sharewares give users a chance to try the software before buying it.', NULL, 'John Doe', NULL, 1, '2020-04-19 15:01:52'),
(2581, 4, 1, 'Додека за книжевноста тврдел дека му е љубовница,|кое занимање Чехов го нарекол негова законска жена?', 'математика', 'медицина', 'право', 'физика', 2, 4, 1, 0, 0, 'В одном из своих писем Чехов в шутливой форме, но при этом совершенно серьезно и по существу утверждал: «Медицина — моя законная жена, а литература — моя любовница»', NULL, 'John Doe', NULL, 1, NULL),
(2582, 5, 1, 'Кој владетел своето име го „позајмил“ на свемирскиот брод|со кој патувале Морфејус и Тринити во „Матрикс“?', 'Хамураби', 'Тутанкамон', 'Набукодоносор', 'Хатчепсут', 3, 3, 1, 8, 7, 'Morfijus mu objašnjava da se nalaze na Nabukodonosoru, brodu čiji je on kapetan.', NULL, 'John Doe', NULL, 1, NULL),
(2583, 6, 1, 'Во која сојузна американска држава|се наоѓа националниот парк Денали?', 'Минесота', 'Орегон', 'Вашингтон', 'Аљаска', 4, 2, 2, 0, 0, 'Denali National Park and Preserve is a national park and preserve located in Alaska Interior, centered on Denali, the highest mountain in North America. ', '', 'John Doe', '', 1, NULL),
(2584, 5, 1, 'Кој филм има главен лик кој страда од|опсесивно-компулсивно пореметување?', 'Авијатичарот', 'Волкот од Волстрит', 'Таксист', 'Да се живее гласно', 1, 8, 7, 0, 0, 'The Aviator is a 2004 American epic biographical drama film directed by Martin Scorsese, written by John Logan. The film depicts the life of Howard Hughes, an aviation pioneer and director of Hell''s Angels. The film portrays his life from 1927–1947 during which time Hughes became a successful film producer and an aviation magnate while simultaneously growing more unstable due to severe obsessive–compulsive disorder (OCD).', NULL, 'John Doe', NULL, 1, '2020-01-04 15:04:08'),
(2585, 4, 1, 'Која тенисерка во 2016 беше казнета со 15-месечна забрана|заради консумирање на забранетата супстанца мелдониум?', 'Каролина Плискова', 'Светлана Кузњецова', 'Моника Селеш', 'Марија Шарапова', 4, 14, 4, 0, 0, 'Maria Sharapova returned to competitive tennis (in April 2017) after serving a 15-month ban for testing positive for the banned substance meldonium, also known as mildronate.', NULL, 'John Doe', NULL, 1, '2020-03-24 19:29:02'),
(2586, 4, 1, 'Како се нарекува еден од петте основни стилови|на градба во античката архитектура?', 'апулски', 'ломбардиски', 'тоскански', 'анконски', 3, 1, 0, 3, 8, 'Toskanski red (ili Toskanski stil) je jedan od pet stilova gradnje u antičkoj arhitekturi; ostala četiri su: dorski, jonski, korintski i kompozitni', NULL, 'John Doe', NULL, 1, NULL),
(2587, 5, 1, 'За што детално „сведочи“ стриповскиот серијал „Бронзено доба“,|за кој авторот Ерик Шеновер почнал да го објавува во 1998?', 'за вавилонското ропство', 'за миграцијата на Германите', 'за Тројанската војна', 'за ерупциите во Помпеја', 3, 4, 0, 3, 1, 'Age of Bronze is an American comics series by writer/artist Eric Shanower retelling the legend of the Trojan War. It began in 1998 and is published by Image Comics.', NULL, 'John Doe', NULL, 1, NULL),
(2588, 4, 1, 'Сива тренерка, црни старки, волнена капа или...', 'Џон Рамбо', 'Марлон Кобрет', 'Стакар Огорд', 'Роки Балбоа', 4, 8, 3, 0, 0, 'Cobra (Marion Cobretti); Rambo (John Rambo); Guardians of the Galaxy (Stakar Ogord) all portrayed by Sylvester Stalone', NULL, 'John Doe', NULL, 1, NULL),
(2589, 5, 1, 'На кого писателот Даниел му ги толкувал соништата,|од истоимената библиска книга од Стариот завет?', 'Херод Велики', 'Набукодоносор', 'Амел-Мардук', 'Рамзес II', 2, 11, 1, 0, 0, 'Daniel ili Danilo je ime biblijske knjige iz Starog zavjeta. Pisac je Izraelac Daniel, koji je postao savjetnik babilonskom vladaru Nabukodonozoru II. Biblijska kratica knjige je Dn, odnosno Dan.', NULL, 'John Doe', NULL, 1, NULL),
(2590, 5, 1, 'Како се презивал еден од претседателите на|Соединетите Американски Држави?', 'Гарфилд', 'Симпсон', 'Кертмен', 'Флинстон', 1, 3, 2, 0, 0, 'James Abram Garfield (November 19, 1831 – September 19, 1881) was the 20th President of the United States, serving from March 4, 1881, until his assassination later that year.', NULL, 'John Doe', NULL, 1, '2020-01-19 12:48:53'),
(2591, 5, 1, 'Во кој филм германски нихилисти упаѓаат|во станот на главниот лик и од него бараат откуп? ', 'Големиот Диктатор', 'Големиот Гатсби', 'Големиот Лебовски', 'Големиот Зајгфилд', 3, 8, 6, 0, 0, 'The millionaire Lebowski''s trophy wife is kidnapped, and he commissions The Dude to deliver the ransom to secure her release; but the plan goes awry when the Dude''s friend Walter Sobchak (John Goodman) schemes to keep the ransom money.', NULL, 'John Doe', NULL, 1, NULL),
(2592, 6, 1, 'Која драма е дело на авторот на романот „Марфи“?', 'Кралот Убу', 'Саломе', 'Шпанска Трагедија', 'Чекајќи го Годо', 4, 4, 3, 4, 1, 'Murphy, first published in 1938, is an avant-garde novel as well as the third work of prose fiction by the Irish author and dramatist Samuel Beckett. Waiting for Godot is a play by Samuel Beckett, in which two characters, Vladimir (Didi) and Estragon (Gogo), wait for the arrival of someone named Godot who never arrives', NULL, 'John Doe', NULL, 1, '2020-03-23 18:53:32'),
(2593, 4, 1, 'Која е мерна единица за електричен капацитет?', 'фар', 'фарад', 'фарадеј', 'флукс', 2, 7, 4, 6, 2, 'Фарадот (симб F, Ф) е единица за електричен капацитет од системот SI. Го носи името на англискиот научник Мајкл Фарадеј. Магнетни флукс или магнетни ток (магнетни флукс или магнетни ток), који се представља грчким словом Φ (фи), је физичка величина која описује магнетно поље у околини покретног наелектрисања.', NULL, 'John Doe', NULL, 1, NULL),
(2594, 4, 1, 'Кои држави на своето знаме го имаат амблемот|Сол де Мајо или во буквален превод „мајско сонце“?', 'Аргентина и Уругвај', 'Куба и Панама', 'Перу и Чиле', 'Колумбија и Еквадор', 1, 2, 8, 0, 0, 'The Sun of May (Spanish: Sol de Mayo) is a national emblem of Argentina and Uruguay, and appears on both countries'' flags.', '', 'John Doe', '', 1, '2020-03-25 19:21:31'),
(2595, 5, 1, 'Џејмс Стјуарт беше „човекот кој знаеше премногу“.|Кој беше „човекот кој знаеше премалку“?', 'Стив Карел', 'Џим Белуши', 'Стив Мартин', 'Бил Мари', 4, 8, 6, 0, 0, 'The Man Who Knew Too Little is a 1997 American-German spy comedy film starring Bill Murray, directed by Jon Amiel, and written by Robert Farrar and Howard Franklin. ', NULL, 'John Doe', NULL, 1, '2020-02-29 19:32:48'),
(2596, 5, 1, 'Највеселиот еврејски празник, сличен на карневал, се вика...', 'Ханука', 'Сукот', 'Пурим', 'Буним', 3, 1, 1, 2, 1, 'Purim (heb.: פורים Pûrîm, od akad. pūru „kocka“ u smislu igara na sreću) blagdan je u židovstvu koji podsjeća na izbavljenje Židova koji su bili u opasnosti istrebljenja u Perziji kada je perzijski vladar Kserkso odobrio zator Židova što je zapisano u Knjizi o Esteri u Starom zavjetu. Održava se u rano proljeće, a popraćen je svojevrsnim karnevalom.', NULL, 'John Doe', NULL, 1, '2020-04-25 14:54:37'),
(2597, 4, 1, 'Кој народ во 3 век заради инвазијата на Хуните|се поделил на две гранки?', 'Етрурците', 'Кимеријците', 'Филистејците', 'Готите', 4, 3, 1, 0, 0, 'Кон средината на II век н.е. Готите започнале постепено да се поместуваат на југоисток, кон Црното Море и се населиле во басенот на Днестар и Долно Поднепровје. Во III век (околу 291 г.) била извршена конечната поделба на Готите на Источни и Западни, односно на Остроготи (Грејтунзи или Степски Готи) и Визиготи (Тервинзи или Шумски Готи). ', NULL, 'John Doe', NULL, 1, '2020-05-03 13:31:39'),
(2598, 6, 1, 'Кој пејач се наоѓа на сликата на насловната на албумот|Sgt. Peppers Lonely Heart Club Band?', 'Боб Дилан', 'Мик Џегер', 'Род Стјуарт', 'Стиви Вондер', 1, 9, 1, 0, 0, 'Sgt. Pepper''s Lonely Hearts Club Band is the eighth studio album by English rock band the Beatles. Top row (15) Bob Dylan (singer/songwriter)', NULL, 'John Doe', NULL, 1, NULL),
(2599, 5, 1, 'Во кој спорт се одржува Томас Куп, натпревар|во кој Индонезија победува преку 13 пати?', 'хокеј', 'крикет', 'поло', 'бадминтон', 4, 14, 4, 0, 0, 'The Thomas Cup, sometimes called the World Men''s Team Championships, is an international badminton competition among teams representing member nations of the Badminton World Federation (BWF), the sport''s global governing body. ', NULL, 'John Doe', NULL, 1, NULL),
(2600, 5, 1, 'Кое море во зимскиот период е речиси целосно замрзнато?', 'Азовско Море', 'Ирско Море', 'Норвешко Море', 'Баренцово Море', 1, 2, 8, 2, 7, 'Азовско Море — најплиткото море на светот и ги поврзува Керчкиот Проток со Црното Море на југ. Плиткоста и малите количини сол го прават ова море погодно за замрзнување. Norwegian Sea is ice-free throughout the year.', NULL, 'John Doe', NULL, 1, '2020-04-16 16:00:18'),
(2601, 6, 1, 'Што во грчкиот мит се пегаи, дријади и напеи?', 'данаиди', 'нимфи', 'сирени', 'химери', 2, 10, 1, 0, 0, 'Земјени нимфи: Напеи, Ореади, Хамадријади; Водни нимфи: Нереиди, Океаниди, Најади, Пегаи; Дрвјени нимфи: Лампади ', NULL, 'John Doe', NULL, 1, NULL),
(2602, 5, 1, 'Која држава ја укина морнарицата|кога Еритреја стана независна?', 'Џибути', 'Етиопија', 'Судан', 'Руанда', 2, 2, 4, 0, 0, '1993 - Eritreja stekla nezavisnost od Etiopije posle tri decenije dugog građanskog rata i referenduma na kojem su njeni građani glasali za nezavisnost. ', NULL, 'John Doe', NULL, 1, NULL),
(2603, 5, 1, 'За време на која војна се одвиваат дејствата во филмот|„Гребен на спасените“ во режија на Мел Гибсон?', 'Виетнамска војна', 'Заливска војна', 'Втора Светска војна', 'Американска граѓанска војна', 3, 8, 2, 0, 0, 'Гребен на спасените (англиски: Hacksaw Ridge) — воен филм од 2016 година за искуствата од втората светска војна на Дезмонд Дос, американски медицински работник, припадник на Црквата на Адвентистите од седмиот ден, кој одбивал да носи или да користи оружје од било кој вид. ', NULL, 'John Doe', NULL, 1, NULL),
(2604, 5, 1, 'Која држава има претседател со|службена резиденција во Сината куќа?', 'Бразил', 'Јужна Кореја', 'Турција', 'Грузија', 2, 18, 0, 0, 0, 'The Blue House (literally \"pavilion of blue tiles\") is the executive office and official residence of the South Korean head of state, the President of the Republic of Korea, and is located in the capital city of Seoul.', NULL, 'John Doe', NULL, 1, NULL),
(2605, 5, 1, 'Лишај е симбиотска заедница помеѓу...', 'алги и печурки', 'печурки и папрати', 'папрати и мов', 'мов и комелиниди', 1, 7, 2, 0, 0, 'Лишај, множ. лишаји или лишајеви (лат. Lichenes), сложени су организми изграђени од два члана, алге и гљиве, здружених у мутуалистичку симбиотску заједницу.', NULL, 'John Doe', NULL, 1, NULL);
INSERT INTO "gamequestions" ("QuestionID", "Difficulty", "Type", "Question", "Answer1", "Answer2", "Answer3", "Answer4", "CorrectAnswer", "CategoryID", "SubcategoryID", "AdditionalCategoryID", "AdditionalSubcategoryID", "MoreInformation", "Pronunciation", "QuestionCreator", "Comments", "TimesAnswered", "LastDateAnswered") VALUES
(2606, 6, 1, 'Што е изработено со спирален релјефен фриз|со прикази на Тројановите војни во Дакија?', 'Трајановата плоча', 'Трајановата порта', 'Трајановaта комеморативна плакета', 'Трајановиот столб', 4, 1, 2, 0, 0, 'Trajan''s Column (Italian: Colonna Traiana, Latin: COLVMNA·TRAIANI) is a Roman triumphal column in Rome, Italy, that commemorates Roman emperor Trajan''s victory in the Dacian Wars. The 190-metre (620-foot) frieze winds around the shaft 23 times. Inside the shaft, a spiral staircase of 185 steps provides access to a viewing platform at the top.', NULL, 'John Doe', NULL, 1, NULL),
(2607, 5, 1, 'Кое најпознато дело на руски писател е роман во стихови?', 'Лермонтов', 'Пушкин', 'Достоевски', 'Толстој', 2, 4, 1, 4, 4, 'Едно од главните дела на Пушкин е романот во стихови „Евгениј Онегин“. Кон средината на 19 век тој бил наречен „енциклопедија на рускиот живот“', NULL, 'John Doe', NULL, 1, NULL),
(2608, 4, 1, 'Која риба, според народното верување,|исполнува три желби?', 'Dentex dentex', 'Carassius auratus', 'Huso huso', 'Diplodus annularis', 2, 12, 4, 0, 0, 'The goldfish (Carassius auratus) is a freshwater fish in the family Cyprinidae of order Cypriniformes. It is one of the most commonly kept aquarium fish.', '', 'John Doe', '', 1, '2020-02-16 14:44:39'),
