(2629, 7, 1, 'Кој од петте должности на исламот означува|задолжителна милостиња за сиромашните?', 'шехадет', 'намаз', 'зекат', 'џенет', 3, 11, 2, 0, 0, 'Zekat (arap. زكاة - zekāt, što znači \"ono što pročišćava\") je u islamu obavezni milodar, izdvajanje točno određenog dijela imetka u dobrotvorne svrhe, za sve one koji ispunjavaju uvjete za to. To je četvrti stup islama, po tradicionalnom poretku[1], iako je po važnosti treća praktična dužnost islama, po važnosti odmah nakon namaza. /// Pet je osnovnih islamskih dužnosti, stupova vjere: Šehadet (arap. الشهادة - eš-šehādet, što znači \"svjedočenje\") izgovoriti; Namaz (arap. صلوة - salat, tur. namaz) klanjati; Ramazanki post (arap. صوم‎ - savm, što znači \"post\") postiti; Zekat (arap. زكاة - zekat, što znači \"čišćenje\") kao dio svog imetka za dobrotvorne svrhe izdvojiti i Hadž (arap. حج‎ - hadždž, što znači \"hodočašće\") barem jednom u životu islamska sveta mjesta hodočastiti.', NULL, 'John Doe', NULL, 1, NULL),
