(2638, 5, 1, 'На кое бродоградилиште работел|електричарот Лех Валенса?', 'на Лениновото', 'на Троцковото', 'на Сталиновото', 'на Ждановото', 1, 15, 1, 0, 0, 'Lech Wałęsa is a retired Polish politician and labour activist. While working at the Lenin Shipyard (now Gdańsk Shipyard), Wałęsa, an electrician, became a trade-union activist, for which he was persecuted by the Communist authorities, placed under surveillance, fired in 1976, and arrested several times.', NULL, 'John Doe', NULL, 1, NULL),
