(2642, 6, 1, 'Клинт Иствуд е „Човекот од Сан Фернандо“.|Кое животно е негов партнер?', 'орангутан', 'горила', 'шимпанза', 'лемур', 1, 8, 3, 0, 0, 'Човекот од Сан Фернандо (англиски: Every Which Way But Loose) – американски филм од 1978 година, во режија на Џејмс Фарго, според сценариото на Џереми Џо Кронсберг. Фило Бедо (го игра Иствуд) поправа автомобили, но всушност заработува за живот од уличните борби што му ги организира пријателот Орвил (го игра Луис). На Фило му се допаѓа кантри-музичарката Лин Хелис-Тејлор (ја игра Лок), која поминува една ноќ со него, а потоа си заминува. Заедно со Орвил и со орангутанот Клајд, Фило оди на пат по долината Сан Фернандо во потрага по Лин.', '', 'John Doe', '', 1, NULL),
(2643, 8, 1, 'За кој филозофски правец од 19 век теоријата ја развиле американските|социолози Херберт Спенсер, Талкот Парсонс и Роберт Мертон?', 'симболичен интеракционизам', 'теолошки детерминизам', 'социјален конструкционизам', 'структурален функционализам', 4, 4, -1, 0, 0, 'Funkcionalizam je filozofski pravac koji se pojavio u 19. st. u Europi. Također je poznat kao prosvjećeni biheviorizam. Funkcionalizam je razumijevanje mentalnog života koje se sastoji u razumijevanju njegovog funkcionalnog ustrojstva. Teoriju su razvili američki sociolozi 20. st. (Herbert Spencer, Talcott Parsons i Robert Merton) i ona je postala dominantna teorijska perspektiva sociologije tijekom ''40. i ''50. godina naročito u SAD-u. Od ''60 nadalje njezina popularnost opada – zbog kritika kao i zbog konkurentnih perspektiva za koje se čini da daju bolja objašnjenja i djelomice i zbog promjena u modi.', '', 'John Doe', '', 1, '2020-03-14 15:44:14'),
