(2645, 6, 1, 'Во која држава може да се најдат|старите геоглифи Наскански линии? ', 'Колумбија', 'Перу', 'Чиле', 'Венецуела', 2, 2, 2, 0, 0, 'Насканските линии се низа на стари геоглифи кои се наоѓаат во пустината Сечура во Перу. Тие се денес дел од светското културно наследство на УНЕСКО. Површината кои ја зафаќаат линиите е околу 80 километри помеѓу градовите Наска и Палпа. ', NULL, 'John Doe', NULL, 1, '2020-04-16 15:47:15'),
(2646, 5, 1, 'Која е првата жена која била назначена на|Куќата на Славните на Рокенролот?', 'Тина Тарнер', 'ЛаВерн Бејкер', 'Рут Браун', 'Арета Френклин', 4, 9, 4, 0, 0, 'Куќата и Музејот на Славните на Рокенролот (Rock and Roll Hall of Fame and Museum) е музеј лоциран на брегот на езерото Ири во центарот на Кливленд, Охајо, САД. Тој е поставен за архивирање на историјата на некои од најпознатите и највлијателните артисти, продуценти, инжинери и други кои на некој поголем начин имале влијание врз музичката индустирја преку рок музиката.  1987 Aretha Franklin // 1991 LaVern Baker // 1991 Ike & Tina Turner // 1993 Ruth Brown ((Queen of Soul -- Aretha Franklin))', NULL, 'John Doe', NULL, 1, '2020-02-16 14:36:33'),
(2647, 5, 1, 'Домови на светите или Houses of the Holy e|петтиот студиски албум на англиската рок група...', 'Ролинг Стоунс', 'Пинк Флојд', 'Дип Парпл', 'Лед Цепелин', 4, 9, 4, 0, 0, 'Houses of the Holy e петтиот студиски албум на англиската рок група Лед Зепелин, издаден преку издавачката куќа Атлантик Рекордс на 28 март 1973 година. Насловот на албумот е посвета за верните фанови кои се појавуваат на нивните концерти чии локации ги нарекуваат Houses of the Holy (Домови на Светите). ', NULL, 'John Doe', NULL, 1, NULL),
(2648, 5, 1, 'Кое е името на првиот деби-албум на|американскиот рок-бенд Бон Џови?', 'Keep the Faith', 'Slippery When Wet', 'Bon Jovi', 'New Jersey', 3, 9, 4, 0, 0, 'Со помошта од нивниот нов менаџер, Док Мекги, групата го снимила својот деби-албум, \"Bon Jovi\", кој бил издаден на 21 јануари 1984 година', NULL, 'John Doe', NULL, 1, '2020-04-16 16:03:04'),
(2649, 6, 1, 'Кој од познатите Битлси е бос на|насловната страна на албумот Abbey Road?', 'Пол Мекартни', 'Џорџ Харисон', 'Ринго Стар', 'Џон Ленон', 1, 9, 4, 0, 0, 'The front cover design, a photograph of the group on a zebra crossing, was based on ideas sketched by McCartney,[18][nb 4] and taken on 8 August 1969 outside EMI Studios in Abbey Road. At 11:35 that morning, photographer Iain Macmillan was given only ten minutes to take the photo whilst he stood on a step-ladder and a policeman held up traffic behind the camera. Macmillan took six photographs, which McCartney later examined with a magnifying glass before deciding which of the shots would be used upon the album sleeve. In the image selected by McCartney, the group walk across the street in single file from left to right, with Lennon leading, followed by Starr, McCartney, and Harrison. McCartney is barefoot and out of step with the other members. Apart from Harrison, the group are wearing suits. To the left of the picture, parked next to the zebra crossing, is a white Volkswagen Beetle which belonged to one of the people living in the block of flats across from the recording studio. ', NULL, 'John Doe', NULL, 1, '2020-05-03 13:35:21'),
(2650, 6, 1, 'Кој беше водечка гитара за британскиот рок-бенд Queen?', 'Роџер Тејлор', 'Брајан Меј', 'Емил Ричардс', 'Тејлор Хенсон', 2, 9, 4, 0, 0, 'Queen are a British rock band that formed in London in 1970. Their classic line-up was Freddie Mercury (lead vocals, piano), Brian May (lead guitar, vocals), Roger Taylor (drums, vocals), and John Deacon (bass guitar). ', NULL, 'John Doe', NULL, 1, '2020-03-07 11:44:10'),
(2651, 7, 1, 'Што прикажува познатата футуристичка скулптура на Бочони|„Единствен облик на континуитет во просторот“?', 'птица во лет', 'човек во движење', 'бакнеж на младоженци', 'раѓање од јајце', 2, 1, 1, 0, 0, 'Umberto Boccioni (Reggio di Calabria, 19. listopada 1882. - Verona, 16. kolovoza 1916.), talijanski slikar i kipar; jedan od inicijatora futurizma i njegov glavni teoretičar u slikarstvu. Unique Forms of Continuity in Space depicts a human-like figure apparently in motion. The sculpture has an aerodynamic and fluid form. ', NULL, 'John Doe', NULL, 1, NULL),
(2652, 4, 1, 'Во музиката, како се вика просторот од една|музичка „висина“ до друга со двојна фреквенција?', 'акорд', 'кантилена', 'октава', 'интрада', 3, 9, 8, 0, 0, 'Акорд е група од три или повеќе тонови отсвирени во исто време. Иако било кој број од било кои тонови е, технички, акорд, во праксата е откриено дека само некои акорди хармонски се употребливи. In music, an octave (Latin: octavus: eighth) or perfect octave is the interval between one musical pitch and another with half or double its frequency. Интра́да (итал. intrada, entrata, исп. entrada, фр. entrée, англ. entry, дословно — «вступление») Kantilena (lat.), nekada naziv za popijevku ili skladbu s melodijskim napjevom, poslije za pjevnu melodiju lirskoga karaktera i (od XIX. st.) za instrumentalnu melodiju istih osobina.', NULL, 'John Doe', NULL, 1, '2020-03-25 18:49:20'),
(2653, 5, 1, 'Кој е најпознат по тоа што е главниот вокал |на алтернативниот рок бенд Pearl Jam?', 'Џеф Амент', 'Стоун Госард', 'Мајк Мекреди', 'Еди Ведер', 4, 9, 4, 0, 0, 'Pearl Jam (П`рл Џем) е американска рок група, создадена во Сиетл во 1990 година. Таа е една од најпопуларните групи во почетокот на 1990-те заедно со Nirvana и Soundgarden. Од самиот почеток, бендот бил формиран од страна на Еди Ведер како водечки вокал и гитара, Џеф Амент свирел на бас гитара, Стоун Госард бил ритам гитарист и Мајк Мекреди бил на соло гитара. Тапанарот Мет Камерон член на бендот станал во 1998 година, како тапанар и на Саундгарден. ', NULL, 'John Doe', NULL, 1, NULL),
(2654, 6, 1, 'Која заводлива блондинка во 1981 пееше за америчките деца кои од|Њу Јорк до источна Калифорнија, живеат за музиката и забавата?', 'Кајли Миног', 'Ким Вајлд', 'Деби Хери', 'Саманта Фокс', 2, 9, 1, 9, 4, '\"Kids in America\" is a song recorded by British singer Kim Wilde. It was released in the United Kingdom as her debut single in January 1981, and in the United States in spring 1982,[3] later appearing on her self-titled debut album. T', NULL, 'John Doe', NULL, 1, NULL),
