(2668, 6, 1, 'Каде е затворот во кој се одвиваат дејствата во филмот|„Полноќен експрес“ од 1978 година?', 'во САД', 'во Франција', 'во Тајланд', 'во Турција', 4, 8, 1, 0, 0, 'Midnight Express is a 1978 British-American prison drama film directed by Alan Parker, produced by David Puttnam. It is based on Billy Hayes'' 1977 non-fiction book Midnight Express and was adapted into the screenplay by Oliver Stone. Hayes was a young American student sent to a Turkish prison for trying to smuggle hashish out of Turkey. ', NULL, 'John Doe', NULL, 1, NULL),
(2669, 7, 1, 'Во која држава од 9 јануари 2000 година,|американскиот долар е единствена службена валута за плаќање?', 'Панама', 'Костарика', 'Еквадор', 'Боливија', 3, 16, 3, 0, 0, 'Еквадор, на 9 јануари 2000 година администрацијата на претседателот Џамил Махуад го вовела американскиот долар како национална валута во Еквадор а при тоа го заменила еквадорскиот сукре, сличен процес како и во Аргентина.', NULL, 'John Doe', NULL, 1, NULL),
(2670, 8, 1, 'Каков е ветарот ако Бофоровата скала|прикажува јачина од 8 степени?', 'умерено јак', 'олуен', 'оркански', 'снажен оркански', 2, 7, 4, 2, 8, 'Бофорова скала је скала за одређивање јачине ветра коју је направио енглески контраадмирал и хидрограф Франсис Бофор 1805. године. Скала је подељена на 12 степени. Међународно је прихваћена 1874. године. // 4 умерен ветар - лепрша заставом, повија гранчице // 8 олуја - повија цела јача стабла, ломи гране, осетно задржава човека који корача у правцу ветра // 12 оркан - уништавајуће дејство', NULL, 'John Doe', NULL, 1, '2020-04-15 16:41:11'),
(2671, 6, 1, 'Суфражетките го добиле името по|англискиот збор „suffrage“ што означува...', 'женски права', 'еднаквост на платите', 'право на глас', 'рамноправност на половите', 3, 5, 5, 3, 1, 'Suffrage, political franchise, or simply franchise is the right to vote in public, political elections (although the term is sometimes used for any right to vote). In some languages, and occasionally in English, the right to vote is called active suffrage, as distinct from passive suffrage, which is the right to stand for election. The combination of active and passive suffrage is sometimes called full suffrage.', NULL, 'John Doe', NULL, 1, '2020-03-23 19:06:27'),
(2672, 4, 1, 'Што под лактите има тетовирано анимираниот морнар Попај?', 'едра', 'кормило', 'сидро', 'конзерва со спанаќ', 3, 8, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2673, 4, 1, 'За кој град во туристичките летоци често стои|„залепена“ придавката „златна“? ', 'Виена', 'Прага', 'Анкара', 'Будимпешта', 2, 2, 1, 0, 0, 'Prag (češ. Praha, nem. Prag) je glavni i najveći grad Češke. Nalazi se na reci Vltavi, i ima oko 1,2 miliona stanovnika. Prag spada u najočuvanije velike gradove Evrope, pa je danas njegovo prostano istorijsko jezgro pod zaštitom UNESKOa. Grad je zbog svog bogatstva poznat i pod nadimkom „Zlatni Prag“.', NULL, 'John Doe', NULL, 1, NULL),
(2674, 4, 1, 'Кое куче, необично слично на лавот, во знак на|благодарност ќе ви ја лизне раката со сино-црн јазик?', 'чау чау', 'мопс', 'пудлица', 'бигл', 1, 12, 1, 0, 0, 'Чау Чау се крупни кучиња кои во профил изгледаат правоаголно. Имат длабоки и широки гради, кус и прав грб, цврста половина и мускулести раменици. Имаат голема и широка глава со мали, тираголни уши и дебели крзнени брчки над очите. Овие кучиња се препознатливи по црната внатрешност на устата и црниот јазик. Опашката е високопоставена, густа и бушава и се носи на грбот. Шепите им се округли, а задните нозе невообичаено исправени.', '', 'John Doe', '', 1, '2020-02-16 14:28:39'),
(2675, 4, 1, 'Која книжевна епоха ја обележала „светската болка“|или таканаречениот Велтшмерц?', 'романтизам', 'ренесанса', 'класицизам', 'барок', 1, 4, 3, 0, 0, 'Велтшмерц (герм. Weltschmerz - светска болка). Со него се означува меланхолично-песимистичкото доживување на светот кое е карактеристично за книжевниот романтизам, проткаен со неодредено мечтаење и незадоволство, како и замореност од животот како производ на нехармонијата на личните и општествени интереси, сонот и стварноста.', NULL, 'John Doe', NULL, 1, NULL),
(2676, 5, 1, 'Абрахам Линколн е убиен пред самиот крај на...', 'Американската војна за независност', 'Првата светска војна', 'Американската граѓанска војна', 'Американско-шпанската војна', 3, 3, 2, 0, 0, 'Abraham Lincoln was assassinated as the Civil War drew to a close. At 7:22 a.m., Abraham Lincoln, the 16th president of the United States, dies from a bullet wound inflicted the night before by John Wilkes Booth, an actor and Confederate sympathizer. The president’s death came only six days after Confederate General Robert E. Lee surrendered his massive army at Appomattox, effectively ending the American Civil War.', NULL, 'John Doe', NULL, 1, '2020-01-26 18:40:18'),
(2677, 5, 1, 'Во кој град Мајкл Џексон се чувствува „странец“|во еден негов хит од 1995 година?', 'Виена', 'Париз', 'Берлин', 'Москва', 4, 9, 1, 0, 0, 'Michael Jackson - Stranger In Moscow Album: HIStory: Past, Present and Future, Book I Released: 1995', NULL, 'John Doe', NULL, 1, '2020-01-04 15:14:06'),
(2678, 5, 1, 'Кој американски град е познат како|родно место на џез музиката?', 'Њу Орлеанс, Луизијана', 'Кингстон, Њу Јорк', 'Орландо, Флорида', 'Хјустон, Тексас', 1, 9, 3, 0, 0, 'Birthplace of Jazz. In the late 19th century, while the rest of America was stomping their feet to military marches, and New Orleans was dancing to VooDoo rhythms. New Orleans was the only place in the New World where slaves were allowed to own drums. Jazz was born in New Orleans about 100 years ago (early 20th century), but its roots can be found in the musical traditions of both Africa and Europe. In fact, some people say that jazz is a union of African and European music. From African music, jazz got its: rhythm and \"feel\"', NULL, 'John Doe', NULL, 1, NULL),
(2679, 5, 1, 'Кој музички феномен во 1980-тите години,|две години по ред имаше најпродаван албум во САД?', 'Мајкл Џексон', 'Пинк Флојд', 'Џорџ Мајкл', 'Витни Хјустон', 1, 9, 1, 0, 0, 'Thriller by Michael Jackson 1983 and 1984, Pink Floyd 1980, Whitney Houston 1986, George Michael 1988', NULL, 'John Doe', NULL, 1, NULL),
(2680, 6, 1, 'Кој бил седмиот и воедно последен римски цар?', 'Јулиј Цезар', 'Сервиј Тулиј', 'Луциј Брут', 'Тарквиниј Гордиот', 4, 3, 1, 0, 0, 'Lucius Tarquinius Superbus (died 495 BC) was the legendary seventh and final king of Rome, reigning from 535 BC until the popular uprising in 509 that led to the establishment of the Roman Republic. He is commonly known as Tarquin the Proud, from his cognomen Superbus (Latin for \"proud, arrogant, lofty\")', NULL, 'John Doe', NULL, 1, NULL),
(2681, 9, 1, 'Кои се првите две африкански држави кои се|декларирани за Светско наследство на УНЕСКО?', 'Египет и Сирија', 'Етиопија и Сенегал', 'Тунис и Танзанија', 'Демократска Република Конго и Гана', 2, 2, 4, 0, 0, 'Since Île de Gorée in Senegal was inscribed as Africa’s first World Heritage site in 1978, Unesco has recognized a further 128 sites spread across the continent. Sites range from the iconic structures such as Giza’s pyramids to the beautiful and unique flowers of the Cape Floral Region. Ethiopia is blessed with nine World Heritage locations – the most for a single country. These include the remains of the powerful early kingdom of Aksum and Simien National Park as well as the amazing rock hewn churches of Lalibela. Other nations with seven or more sites include Egypt, Kenya, South Africa, Morocco and Tunisia. A handful of sites straddle borders, such as Victoria Falls which can be accessed from either Zambia (base yourself in Livingstone) or Zimbabwe (stay in Victoria Falls).', NULL, 'John Doe', NULL, 1, '2020-02-01 01:31:55'),
(2682, 6, 1, 'Кој хемиски елемент го добил името според|латинскиот назив за Париз за време на римскиот период?', 'сениум', 'калциум', 'галиум', 'лутециум', 4, 7, 3, 0, 0, 'Лутециум (Lu, латински - lutetium) е лантаноид. Името го добил според латинскиот назив за Париз. ', NULL, 'John Doe', NULL, 1, NULL),
(2683, 7, 1, 'Кои беа главните личности  во 1892 година вклучени во|воведувањето на 35mm филм за фотографија и филм?', 'Александар Грахам Бел и Џорџ Кодак', 'Вилиам Диксон, Томас Едисон и Џорџ Истман', 'Томас Долби и Винсент Виста', 'Семјуел Голдвин и Луис Маер', 2, 19, 4, 0, 0, 'George Eastman (July 12, 1854 – March 14, 1932) was an American entrepreneur who founded the Eastman Kodak Company and popularized the use of roll film, helping to bring photography to the mainstream. Roll film was also the basis for the invention of motion picture film stock in 1888 by the world''s first film-makers Eadweard Muybridge and Louis Le Prince, and a few years later by their followers Léon Bouly, William Kennedy Dickson, Thomas Edison, the Lumière Brothers, and Georges Méliès.', NULL, 'John Doe', NULL, 1, NULL),
(2684, 5, 1, 'Во која држава Висла е најдолга и најголема река?', 'Белорусија', 'Украина', 'Словачка', 'Полска', 4, 2, 1, 0, 0, 'The Vistula (/ˈvɪstjʊlə/; Polish: Wisła [ˈvʲiswa], German: Weichsel [ˈvaɪksl̩], Low German: Wießel, Yiddish: ווייסל‎ Yiddish pronunciation: [vajsl̩]), Russian: Висла) is the longest and largest river in Poland, at 1,047 kilometres (651 miles) in length. The drainage basin area of the Vistula is 194,424 km2 (75,068 sq mi), of which 168,699 km2 (65,135 sq mi) lies within Poland (splitting the country in half). The remainder is in Belarus, Ukraine and Slovakia.', NULL, 'John Doe', NULL, 1, '2020-01-16 21:09:54'),
(2685, 6, 1, 'Кој познат американски музичар беше фатално застрелан|од неговиот татко на 1 април 1984 година?', 'Марвин Геј', 'Џон Ленон', 'Тупак Шакур', 'Фреди Кинг', 1, 9, 1, 0, 0, 'On April 1, 1984, Gaye''s father, Marvin Gay Sr., fatally shot him at their house in the West Adams district of Los Angeles.', NULL, 'John Doe', NULL, 1, NULL),
(2686, 4, 1, 'На која земја била кралица Македа, сакана од|кралот Соломон од Обединетата монархија во Израел?', 'Абисинија', 'Зазау', 'Шиба', 'Гана', 3, 3, 4, 0, 0, 'Царицата од Сава (или Саба) (хебрејски: מַלְכַּת־שְׁבָא‎; арапски: ملكة سبأ) е кралица која се појавува во Библијата, во посета на царот Соломон за да ја тестира неговата мудрост. Последователни традиции ја именувале како Никаула (од Јосиф), Билкис (во исламот), или Македа (во Етиопија).', NULL, 'John Doe', NULL, 1, '2020-04-11 11:08:03'),
(2687, 5, 1, 'Коj светлосeн приказ на Антарктикот е предизвикан од атомско|бомбардирање од сонцето на магнетното поле на Земјата?', 'Аурора Бореалис', 'Аурора Аустралис', 'Јужен Крст', 'Шинтер', 2, 2, 7, 0, 0, 'На Северниот пол овој ефект е познат како aurora borealis (или северна светлина), именувана по Аурора, римската божица на зората и грчкото име за северен ветер, Бореј. Нејзината јужна двојничка, aurora australis (или јужна светлина), има слични својства и е видлива во јужните географски широчини на Антарктикот, Јужна Америка и Австралија.', NULL, 'John Doe', NULL, 1, '2020-03-23 18:48:59'),
(2688, 5, 1, 'Која земја беше поделена со 17-та паралела со|договорот направен во Женева во 1954 година?', 'Кореја', 'Виетнам', 'Крит', 'Тимор', 2, 2, 4, 0, 0, 'It was decided that Vietnam would be divided at the 17th parallel until 1956, when democratic elections would be held under international supervision.', NULL, 'John Doe', NULL, 1, NULL),
(2689, 6, 1, 'Во која земја владеела групата именувана како Хиксос|во вториот милениум п.н.е?', 'Палестина', 'Индија', 'Египет', 'Сирија', 3, 3, 4, 0, 0, 'The Hyksos were a people of mixed origins, possibly from Western Asia, who settled in the eastern Nile Delta some time before 1650 BC. The arrival of the Hyksos led to the end of the Thirteenth Dynasty and initiated the Second Intermediate Period of Egypt. In the context of Ancient Egypt, the term \"Asiatic\" – which is often used for the Hyksos – may refer to any people native to areas east of Egypt.', NULL, 'John Doe', NULL, 1, NULL),
(2690, 4, 1, 'Според Библијата, во која област застанала Ноевата арка,|каде и денес научниците го пребаруваат ова место?', 'Арденската Шума', 'Трансилванските Алпи', 'врвот Мон Блан', 'планината Арарат', 4, 11, 1, 0, 0, 'Христијаните и муслиманите кои буквално веруваат во постоењето на арката и потопот, ги бараат физичките остатоци од арката, со што би се потврдиле нивните мислења за разни теми, како што се геологијата и еволуцијата. Пребарувањата по Ноевата арка и денес се одвиваат на и околу планината Арарат во Турција.', NULL, 'John Doe', NULL, 1, NULL),
(2691, 2, 1, 'Што сте „фрлиле“ во лице оној кој|сте го предизвикале на двобој?', 'ракавица', 'капа', 'шал', 'чизма', 1, 4, 6, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2692, 4, 1, 'Во светот на коктелите, „Слободна Куба“|не може да се направи без...', 'текила', 'вермут', 'виски', 'рум', 4, 19, 5, 0, 0, 'Koktel Cuba Libre je jedan od najpopularnijih koktela današnjice i vrlo jednostavno ga možete napraviti. U laganom prevodu znači “slobodna Kuba“. Početkom sedamdesetih ovo piće je doživelo neverovatan uspeh najviše zahvaljujući jako dobrom marketingu Baccardi-ja i Coca Cola-e. Potrebni sastojci: soka od limuna, belog ruma, coca-cola, limeta za dekoraciju', '', 'John Doe', '', 1, '2020-03-14 15:41:19'),
(2693, 5, 1, 'Чии војници во 1923 ја окупирале цела Рухрска област,|по што Германија престанала со плаќање репарации?', 'австро-унгарските', 'англо-американските', 'француско-белгиските', 'советските', 3, 3, 1, 0, 0, 'Kada je Njemačka, nakon zaključenja Rapalskog ugovora sa Sovjetskim Savezom 1922., proglasila moratorij i prestala plaćati reparacije, francusko-belgijske postrojbe okupirale su u siječnju 1923. cijelo Ruhrsko područje (tzv. politika produktivne pljačke).', NULL, 'John Doe', NULL, 1, NULL),
(2694, 5, 1, 'Кој го порази Борис Бекер на Вимблдон 1991|и си ја обезбеди својата прва Гренд Слем титула? ', 'Михаел Штих', 'Ерик Јелен', 'Карл-Уве Штеб', 'Андреас Маурер', 1, 14, 4, 0, 0, 'Germany Michael Stich defeated Germany Boris Becker, 6–4, 7–6(7–4), 6–4. It was Stich''s 1st career Grand Slam title and his 1st Wimbledon title.', NULL, 'John Doe', NULL, 1, NULL),
(2695, 5, 1, 'Во која држава живеат|најголем број шиитски муслимани?', 'во Иран', 'во Саудиска Арабија', 'во Пакистан', 'во Египет', 1, 2, 3, 0, 0, 'The Shia majority countries are Iran, Iraq, Azerbaijan, and Bahrain. They also form the plurality (the largest group, but not the majority) in Lebanon. Shias constitute 36.3% of entire local population and 38.6% of the local Muslim population of the Middle East.', NULL, 'John Doe', NULL, 1, NULL),
(2696, 6, 1, 'Кои облаци „летаат највисоко“?', 'цирокумулуси', 'алтокумулуси', 'стратокумулуси', 'кумулонимбуси', 1, 7, 1, 0, 0, 'Ne nalaze se svi oblaci na istim visinama, nego ih možemo svrstati u tri visinska kata: Visoki : Ci, Cc, Cs - sasvim ledeni oblaci, s temperaturama nižima od -35°C i nisu oštro ograničeni (Cirusi, Cirokumulusi, Cirostratusi) // Srednji: Ac, As (Altokumulusi, Altostratusi) // Niski: Ns, Sc, St, Cu, Cb (Nimbostratusi, Stratokumulusi, Stratusi, Kumulusi, Kumulonimbusi)', NULL, 'John Doe', NULL, 1, NULL),
(2697, 6, 1, 'Која „црна Венера“ на сцената неретко|се појавувала само во суќња од банана?', 'Лова Мур', 'Жан Аврил', 'Џозефин Бејкер', 'Луиз Вебер', 3, 20, 3, 0, 0, 'And there, wearing little more than strings of pearls, wrist cuffs, and a skirt made of 16 rubber bananas, Josephine Baker descended from a palm tree onstage, and began to dance. ', NULL, 'John Doe', NULL, 1, NULL),
(2698, 4, 1, 'За кој филмски жанр Вес Крејвен е еден од|највлијателните режисери?', 'хорор', 'вестерн', 'комедија', 'мјузикл', 1, 8, 5, 0, 0, 'Визли Ерл \"Вес\" Крејвен (енгл. Wesley Earl \"Wes\" Craven) био је амерички режисер, писац, продуцент и глумац. Најпознатији је по својим филмовима Страва у Улици брестова, Врисак, Брда имају очи и Последња кућа са леве стране.', NULL, 'John Doe', NULL, 1, NULL),
(2699, 4, 1, 'И писателот и главниот лик на романот|„Степскиот волк“ ги имаат иницијалите...', 'Х.Х.', 'Б.Б.', 'В.В.', 'Ј.Ј.', 1, 4, 1, 4, 2, 'Степскиот Волк (германски: Der Steppenwolf) е роман на германско–швајцарскиот писател Херман Хесе, првично објавен во Германија, во 1927 година. Насловот на оваа „вистинска“ книга во книга е „Сведоштвата на Хари Халер (Само за лудаци)“.', NULL, 'John Doe', NULL, 1, NULL),
(2700, 4, 1, 'Која држава името може да и се|преведе како Источно Царство?', 'Јапонија', 'Унгарија', 'Кина', 'Австрија', 4, 2, 1, 2, 8, 'Ime Austrijanci iskovano je kod nas od imena države Austrije. Svoju zemlju Austrijanci nazivaju Österreich (ili istočno carstvo ''rajh''; izv. ''Reich''). Porijeklo mu je u starogermanskom Ostarrîchi.', NULL, 'John Doe', NULL, 1, NULL),
(2701, 5, 1, 'Каде се наоѓа црквата каде Леонардо да Винчи|ја насликал „Тајната вечера“?', 'во Рим', 'во Париз', 'во Венеција', 'во Милано', 4, 1, 2, 0, 0, 'Тајната вечера е ѕидна слика во доминиканската црква „Санта Марија дела Грација“ во Милано, сликана од 1494 до 1498 година. „Тајната вечера“ го прикажува клучниот момент на последниот оброк што Исус им го поделил на 12-те апостоли. Сликана е од врвниот уметник Леонардо да Винчи по порачка на кнезот на Милано, Лудовико Сфорца.', NULL, 'John Doe', NULL, 1, NULL),
(2702, 5, 1, 'Кој гас поради голема количина предизвикува|бананите да презреат и да станат кафеави? ', 'етилен', 'метан', 'бензен', 'пропан', 1, 7, 2, 7, 3, 'ethylene // Calcium carbide is also used in some countries for artificially ripening fruit. When calcium carbide comes in contact with moisture, it produces acetylene gas, which is quite similar in its effects to the natural ripening agent, ethylene. Acetylene acts like ethylene and accelerates the ripening process.', NULL, 'John Doe', NULL, 1, NULL),
(2703, 5, 1, 'Каде Линдон Џонсон ја дал претседателската заклетва|два часа по убиството на Кенеди?', 'на брод', 'во воз', 'во авион', 'во автобус', 3, 3, 2, 0, 0, 'English: Lyndon B. Johnson taking the oath of office aboard Air Force One at Love Field Airport two hours and eight minutes after the assassination of John F. Kennedy, Dallas, Texas.', NULL, 'John Doe', NULL, 1, NULL),
(2704, 4, 1, 'Како би се викало студиото на Енди Ворхол во Њу Јорк|преведено на македонски јазик?', 'Јаболко', 'Фабрика', 'Океан', 'Возвишеност', 2, 1, 1, 0, 0, 'Andy Warhol (born Andrew Warhola; August 6, 1928 – February 22, 1987) was an American artist, director and producer who was a leading figure in the visual art movement known as pop art. His New York studio, The Factory, became a well-known gathering place that brought together distinguished intellectuals, drag queens, playwrights, Bohemian street people, Hollywood celebrities, and wealthy patrons', NULL, 'John Doe', NULL, 1, '2020-03-07 16:40:48'),
(2705, 3, 1, 'Кои британски новини името го делат|со германскиот дневник „Die Zeit“?', 'The Sun', 'The Guardian', 'The Observer', 'The Times', 4, 5, 5, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-02-09 20:24:10'),
(2706, 5, 1, 'Во кој роман ликовите живеат во|парискиот пансион на госпоѓа Вокер?', 'Клетници', 'Странецот', 'Чичко Горио', 'Чума', 3, 4, 4, 0, 0, 'Чичко Горио (француски: Le Père Goriot) — роман на францускиот писател Оноре де Балзак, дел од „Студиите за општествениот живот“, во рамките на големиот циклус наречен „Човечка комедија“. Дејството на романот започнува во Париз, ноември 1819 година, во пансионот на госпоѓата Вокер. Кај неа живеат неколку потстанари, меѓу кои се: младата Викторина Тајфер чиј богат татко не ја признава за ќерка, студентот Ежен де Растињак кој потекнува од осиромашено благородничко семејство од провинцијата, господинот Вотрен и поранешниот сопственик на фабрика за тестенини, Горио.', NULL, 'John Doe', NULL, 1, NULL),
(2707, 5, 1, 'Кој дел од телото може да биде засегнат од тинитус?', 'кожата', 'очите', 'ушите', 'рацете', 3, 7, 2, 0, 0, 'Tinnitus е звук кој се јавува во внатрешното уво, а воедно е и моментална психичка состојба на чувство на присуство на звук во ушите и главата без да постои реален звук во околината.  Името tinnitus значи “ѕвонење или зуење како ѕвонче” , а доаѓа од латинскиот збор “tinn-itus” како ѕвони, буквата “i” значи исто како “присутно”. ', NULL, 'John Doe', NULL, 1, '2020-02-29 19:20:04'),
(2708, 6, 1, 'Кое од овие места се наоѓа во Мали, седмата|најголема држава на афричкиот континент?', 'Тимбукту', 'Саламанка', 'Александра', 'Аламејн', 1, 2, 4, 0, 0, 'Timbuktu, grad - oaza u zapadnoafričkoj državi Mali s 32.414 stanovnika. Grad leži oko 15 km sjeverno od rijeke Niger na južnom kraju Sahare.', '', 'John Doe', '', 1, NULL),
(2709, 4, 1, 'Кој оптички инструмент прикажува симетрични форми,|произлезени од комбинација на рефлектирачки површини?', 'кинематограф', 'телескоп', 'фонограф', 'калеидоскоп', 4, 7, 1, 7, 5, 'A kaleidoscope is an optical instrument with two or more reflecting surfaces tilted to each other in an angle, so that one or more (parts of) objects on one end of the mirrors are seen as a regular symmetrical pattern when viewed from the other end, due to repeated reflection. ', NULL, 'John Doe', NULL, 1, '2020-04-13 14:53:48'),
(2710, 6, 1, 'Од што се плаши лицето ако страда од охлофобија?', 'кучиња', 'депонии', 'гужва', 'слонови', 3, 7, 2, 0, 0, ' охлофобија- од гужва (толпа)', NULL, 'John Doe', NULL, 1, '2020-04-15 16:10:09'),
(2711, 4, 1, 'Која течност е најсоодветна за уметниците|да ги исчистат четките, ако сликаат со мрсни бои?', 'вода', 'жива', 'терпентин', 'бензин', 3, 1, 0, 0, 0, 'Both can be used to thin oil paint to effect the flow of paint onto the canvas. They can also be used to clean brushes and other tools. Commercially, the term \"paint thinner\" is rather broad, and can cover many different solvents like mineral spirits, naptha, even turpentine.', NULL, 'John Doe', NULL, 1, NULL),
(2712, 5, 1, 'Роден во замокот Кнутсторп, која националност|бил астрономот и благородник од 16 век, Тихо Брахе?', 'Германец', 'Данец', 'Британец', 'Чех', 2, 7, 1, 0, 0, 'Тихо Брахе (дан. Tycho Brahe, 14 декември 1546 – 24 октомври 1601) роден како Тихо Отесен Брахе, бил дански астроном. Студирал во Копенхаген, Лајпциг, Росток и Аугсбург.', '', 'John Doe', '', 1, '2020-04-11 11:20:42'),
(2713, 7, 1, 'Лејтон Рис, во 1978 станал првиот светски шампион во...', 'шах', 'билијард', 'табла', 'пикадо', 4, 14, 0, 0, 0, 'Leighton Thomas Rees (17 January 1940 – 8 June 2003) was the first ever World Professional Darts Champion and former World No. 1 player.', NULL, 'John Doe', NULL, 1, NULL),
(2714, 6, 1, 'Во која опера се појавува|избеганиот затвореник Анџелоти?', 'Тоска', 'Турандот', 'Арабела', 'Кармен', 1, 9, 7, 0, 0, 'Tosca is an opera in three acts by Giacomo Puccini to an Italian libretto by Luigi Illica and Giuseppe Giacosa. Cesare Angelotti, former consul of the Roman Republic and now an escaped political prisoner, runs into the church and hides in the Attavanti private chapel – his sister, the Marchesa Attavanti, has left a key to the chapel hidden at the feet of the statue of the Madonna.', NULL, 'John Doe', NULL, 1, NULL),
(2715, 6, 1, 'На која боја е нијанса селадон?', 'црвена', 'зелена', 'жолта', 'сина', 2, 19, 4, 1, 0, 'Celadon a willow-green color.', NULL, 'John Doe', NULL, 1, NULL),
(2716, 2, 1, 'Која операција треба да се изведе над броевите 10 и 5,|за да се добие резултат 50?', 'множење', 'делење', 'собирање', 'одземање', 1, 6, 1, 0, 0, '10*5=50', NULL, 'John Doe', NULL, 1, NULL);
INSERT INTO "gamequestions" ("QuestionID", "Difficulty", "Type", "Question", "Answer1", "Answer2", "Answer3", "Answer4", "CorrectAnswer", "CategoryID", "SubcategoryID", "AdditionalCategoryID", "AdditionalSubcategoryID", "MoreInformation", "Pronunciation", "QuestionCreator", "Comments", "TimesAnswered", "LastDateAnswered") VALUES
(2717, 4, 1, 'Што проучува петрологијата?', 'нафтени деривати', 'уметнички градби', 'повеќегодишни растенија', 'настанок на карпи', 4, 2, 7, 0, 0, 'Петрологија (грчки πέτρα, петра, стена; λόγος, логос, сазнање (расправа, дискусија)) је наука која се бави изучавањем стена и условима њиховог настанка. ', NULL, 'John Doe', NULL, 1, NULL),
(2718, 5, 1, 'Која од овие планети од Сончевиот систем е најмала?', 'Меркур', 'Земја', 'Сатурн', 'Јупитер', 1, 7, 1, 0, 0, 'Planets in our Solar system size comparison. Largest to smallest are pictured left to right, top to bottom: Jupiter, Saturn, Uranus, Neptune, Earth, Venus, Mars, Mercury.', NULL, 'John Doe', NULL, 1, NULL),
(2719, 4, 1, 'Кое од следниве е физичка количина|која има магнитуда, но нема насока?', 'резултанта', 'скалар', 'брзина', 'вектор', 2, 7, 4, 0, 0, 'A vector is any quantity that has magnitude and direction. A scalar is any quantity that has magnitude but no direction. Displacement and velocity are vectors, whereas distance and speed are scalars.', NULL, 'John Doe', NULL, 1, '2020-03-22 18:36:28'),
(2720, 7, 1, 'На кое место се домородци Јаганите, кои се сметаат|за најјужни домородни народи во светот?', 'Тиера дел Фуего', 'Централна Колумбија', 'Амазонската тропска шума', 'Азори', 1, 2, 2, 0, 0, 'The Yaghan, also called Yagán, Yahgan, Yámana, Yamana, or Tequenica, are one of the indigenous peoples of the Southern Cone, who are regarded as the southernmost peoples in the world. Their traditional territory includes the islands south of Isla Grande de Tierra del Fuego, extending their presence into Cape Horn. They have been there for more than 10,000 years. In the 19th century, they were known as Fuegians by the English-speaking world, but the term is now avoided as it can refer to any of the several indigenous peoples of Tierra del Fuego.', '', 'John Doe', '', 1, NULL),
(2721, 4, 1, 'Во 330 година римскиот император Константин Велики,|го преместил главниот град од Рим во...', 'Атина ', 'Византија ', 'Картагина ', 'Каиро', 2, 3, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-04-16 15:43:01'),
(2722, 5, 1, 'Што развил или открил англискиот физичар|Роберт Хук во 1635 година?', 'релација помеѓу радио бранови', 'оптички закон за рефлексија', 'принцип за еластични тела', 'хидродинамичен парадокс', 3, 7, 4, 0, 0, 'Hooke''s law is a principle of physics that states that the force (F) needed to extend or compress a spring by some distance X scales linearly with respect to that distance. That is: F = kX, where k is a constant factor characteristic of the spring: its stiffness, and X is small compared to the total possible deformation of the spring. Hooke''s spring law usually applies to any elastic object, of arbitrary complexity, as long as both the deformation and the stress can be expressed by a single number that can be both positive and negative.', NULL, 'John Doe', NULL, 1, NULL),
(2723, 4, 1, 'Кој европски град има најголемо турско население|во било кој град надвор од Турција?', 'Тел Авив, Израел', 'Рим, Италија', 'Мелбурн, Австралија', 'Берлин, Германија', 4, 2, 8, 0, 0, 'Berlin is home to over 113,000 Turkish citizens. Turks in Berlin are people of Turkish ethnicity living in Berlin where they form the largest ethnic minority group, and the largest Turkish community outside Turkey. The largest communities can be found in Kreuzberg, Neukölln, and Wedding, with substantial populations in other areas, almost exclusively those of the former West Berlin. [Update: June 2018]', NULL, 'John Doe', NULL, 1, NULL),
(2724, 9, 1, 'Каде се наоѓа гигантската бакарна статуа на маж, жена и дете, позната како|„Споменик на африканската ренесанса“, која беше претставена во април 2010 година?', 'Дакар, Сенегал', 'Хараре, Зимбабве', 'Лусака, Замбија', 'Кампала, Уганда', 1, 1, 2, 2, 4, 'The African Renaissance Monument (French: Le Monument de la Renaissance Africaine) is a 49 meter tall bronze statue located on top of one of the twin hills known as Collines des Mamelles, outside Dakar, Senegal. Originally scheduled for completion in December 2009, delays stretched into early 2010, and the formal dedication occurred on 4 April 2010, Senegal''s \"National Day\", commemorating the 50th anniversary of the country''s independence from France. It is the tallest statue in Africa.', NULL, 'John Doe', NULL, 1, '2020-04-04 17:53:53'),
(2725, 7, 1, 'Која е најкратката книга од Стариот Завет?', 'Амос', 'Обадија', 'Егзодус', 'Рут', 2, 11, 1, 0, 0, 'Obadiah-The book is one chapter divided into 21 verses, telling Obadiah''s vision concerning Edom and the restoration of Israel.', NULL, 'John Doe', NULL, 1, NULL),
(2726, 5, 1, 'Која е единствената држава во југоисточна Азија|која никогаш не била колонизирана?', 'Филипини', 'Тајланд', 'Виетнам', 'Индонезија', 2, 2, 3, 3, 3, 'Тајланд е единствената југоисточна азија која никогаш не била колонизирана, главно поради тоа што имала долга наследна состојба на владејачките владетели во 1800-тите и можела да го искористи ривалството меѓу Французите и Британците.', NULL, 'John Doe', NULL, 1, '2020-03-25 18:51:13'),
(2727, 4, 1, 'Каква форма се осумте страни на октаедарот?', 'квадрати', 'петаголници', 'триаголници', 'кружници', 3, 6, 3, 0, 0, 'In geometry, an octahedron (plural: octahedra) is a polyhedron with eight faces, twelve edges, and six vertices. The term is most commonly used to refer to the regular octahedron, a Platonic solid composed of eight equilateral triangles, four of which meet at each vertex.', NULL, 'John Doe', NULL, 1, NULL),
(2728, 6, 1, 'Симболот Sb претставува стибнум или стибнит.|Кое е модерното име на овој елемент?', 'арсеник', 'самариум', 'сиборгиум', 'антимон', 4, 7, 3, 0, 0, 'Stibnum is the old name for antimony. Be careful you don''t confuse the symbol with Sn for tin (a common tricky chemistry test question). Tin is safe enough to use to make cans for food. Antimony and most of its compounds are toxic. ', NULL, 'John Doe', NULL, 1, NULL),
(2729, 6, 1, 'Малите месојади познати како меркати или|сурикати можат да се најдат во...', 'Јужна Америка', 'Австралија', 'Азија', 'Африка', 4, 12, 2, 0, 0, 'Меркат или сурикат (науч. Suricata suricatta) — мал месојад пропадник на семејството на мунгоси (науч. Herpestidae). Станува збор за единствениот член на родот Suricata. Меркатите можат да се забележат во пустината Калахари во Боцвана, во дел од пустината Намиб во Намибија и југозападна Ангола, и во Јужна Африка.', NULL, 'John Doe', NULL, 1, NULL),
(2730, 6, 1, 'Кој ја основа Дружбата Исусова или Исусовците?', 'Вилијам Бут', 'Томас Аквинас', 'Бернард Рам', 'Игансијус Лојола', 4, 11, 1, 0, 0, 'Дружбата Исусова или Исусовците (лат. Societas Jesu, SJ или SI), а некаде и Езуити е католички црковен ред, основан од Игнасио Лојола (Ignatius Loyola) во Париз во 1534 година[2]. Основното мото на редот е Ad majorem Dei gloriam („За поголема Божја слава“). ', NULL, 'John Doe', NULL, 1, NULL),
(2731, 4, 1, 'Со што се натпреваруваат играчите во Индијанаполис 500?', 'мотори', 'автомобили', 'чамци', 'коњи', 2, 14, 7, 0, 0, 'The Indianapolis 500 is an automobile race held annually at Indianapolis Motor Speedway in Speedway, Indiana, United States, an enclave suburb of Indianapolis, Indiana.', NULL, 'John Doe', NULL, 1, NULL),
(2732, 4, 1, 'Како се нарекува атомот кој има повеќе протони од електрони?', 'молекул', 'изотоп', 'анјон', 'катјон', 4, 7, 3, 0, 0, 'If an atom has more protons than electrons, it has a net positive charge. This is a cation, which you can remember because the \"t\" in cation resembles a \"+\" sign for positive.', NULL, 'John Doe', NULL, 1, NULL),
(2733, 5, 1, 'Кој од овие е вулкан на Андите,|кој обично има снег на својот врв?', 'Котопакси', 'Титикака', 'Килауеа', 'Катла', 1, 2, 8, 2, 2, 'Cotopaxi is an active stratovolcano in the Andes Mountains, located in the Latacunga canton of Cotopaxi Province.  The crater consists of two concentric crater rims, the outer one being partly free of snow and irregular in shape. The crater interior is covered with ice cornices and rather flat. Mauna Loa is in Haiti and is also covered in snow.', NULL, 'John Doe', NULL, 1, NULL),
(2734, 7, 1, 'Кралицата Салоте Тупоу од 1918 до 1965 година|владеела со...', 'Тувалу', 'Самоа', 'Тонга', 'Вануату', 3, 3, 6, 0, 0, 'Sālote Tupou III (born Sālote Mafile‘o Pilolevu; 13 March 1900 – 16 December 1965) was the first Queen regnant and third Monarch of the Kingdom of Tonga from 1918 to her death in 1965. She reigned for nearly 48 years, longer than any other Tongan Monarch.', NULL, 'John Doe', NULL, 1, '2020-03-19 18:30:18'),
(2735, 5, 1, 'Кој измислил систем на картографија при што линиите на |географска ширина и должина се исцртани под прав агол?', 'Исак Њутн', 'Артур Едингтон', 'Галилео Галилеј', 'Герард Меркатор', 4, 2, 7, 2, 8, 'Герард Меркатор (5 март 1512 - 2 декември 1594) бил фламански картограф. Роден е во Рупелмонд во источна Фландрија. Од 1552 живеел во Дујсбург. Познат е како првиот човек којшто го има претставено светот на географска карта. Mercator projection of the world between 82°S and 82°N. The Mercator projection is a cylindrical map projection presented by the Flemish geographer and cartographer Gerardus Mercator in 1569. It became the standard map projection for nautical purposes because of its ability to represent lines of constant course, known as rhumb lines or loxodromes, as straight segments that conserve the angles with the meridians.ents that conserve the angles with the meridians. ', NULL, 'John Doe', NULL, 1, NULL),
(2736, 6, 1, 'За која религија паунот претставува важен дел?', 'спиритизам', 'јазданизам', 'шинто', 'будизам', 2, 11, 0, 0, 0, 'Jezidi ili Jesidi (The Yazidis, or Yezidis) su kurdska etnoreligijska skupina iz Iraka koju karakterizira pripadnost specifičnoj heterodoksnoj religiji odnosno sljedbi. Jesidi vjeruju u jednog Boga kao stvaratelja svijeta na koji je poslao sedam uzvišenih bića ili anđela (haft serr; „sedam zagonetki“) da ga čuvaju, a njihov vođa je Malak Taus („Paunov anđeo“)', NULL, 'John Doe', NULL, 1, NULL),
(2737, 4, 1, 'Која американска сојузна држава е|сместена најблиску до Русија?', 'Алабама', 'Аризона', 'Алјаска', 'Арканзас', 3, 2, 1, 2, 2, 'Алјаска е американска сојузна држава со главен град Џуно. САД ја купила Алјаска од Русија во 1867 и била вклучена како држава во 1959.', NULL, 'John Doe', NULL, 1, NULL),
(2738, 6, 1, 'Во алфа распаѓање, бројот на протонот на родителот нуклид...', 'се намалува за 4', 'се зголемува за 2', 'се зголемува за 1', 'се намалува за 2', 4, 7, 4, 0, 0, 'In decay the atomic number (= proton number) of the parent nuclide decreases by 2 units of charge and mass number A decreases by 4 units.', NULL, 'John Doe', NULL, 1, '2020-01-26 18:28:43'),
(2739, 2, 1, 'Која кратенка во допишувањето значи „се гледаме“?', 'CA', 'CI', 'CO', 'CU', 4, 5, 6, 0, 0, 'See You - C U', NULL, 'John Doe', NULL, 1, '2020-01-18 13:19:56'),
(2740, 4, 1, 'Кој ветер ќе дува ако на временската прогноза|најават бран од североисток?', 'маестрал', 'бура', 'југо', 'пуленат', 2, 2, 7, 0, 0, 'С-трамонтана, СИ-бура, И-леванат, ЈИ-југо, Ј-оштро, ЈЗ-лебич, З-пуленат, СЗ-мистрал. Бура (северњак, север, италјански: bora) е многу силен ветар, кој повремено дува посебно во постудените времиња од годината во северниот дел на источните брегови на Јадранското Море, а и во некои други крајеви на Земјата. ', NULL, 'John Doe', NULL, 1, NULL),
(2741, 5, 1, 'Во кој филм на Дејвид Линч, дејството започнува|со пронаоѓањето на отсечено човечко уво?', 'Човек-слон', 'Дина-песочна планета', 'Изгубената улица', 'Син сомот', 4, 8, 1, 0, 0, 'Син сомот (англиски: Blue Velvet) е американски нео-ноар, детективски трилер филм напишан и режиран од Дејвид Линч. Кајл Меклахлан, Изабела Роселини, Денис Хопер и Лора Дерн ги играат главните улоги во филмот. Дејството во филмот се одвива во малото место Ламбертон, Северна Каролина и ја раскажува приказната за студентот Џефри Бомонт, кој открива оштетено и исечено човечко уво во еден тревник во соседството. ', NULL, 'John Doe', NULL, 1, NULL),
(2742, 5, 1, 'Како во најстарото минато на планетата Земја|се нарекувало единственото море?', 'Панталаса', 'Пангеа', 'Панглоса', 'Панагија', 1, 2, 8, 0, 0, 'Struktura Zemljine kore, njezina sadašnja građa i promjene na njoj (postanak kopna, odnosno kontinenata, stvaranje planina i drugo) predmet su različitih teorija, među kojima se u novije doba izdvajaju Wegenerova teorija i teorija tektonskih ploča. Obje teorije pretpostavljaju konvekcijska strujanja tvari u plaštu. Wegenerova teorija pretpostavlja da je u najstarijoj prošlosti postojalo jedinstveno kopno (Pangea) i jedinstveno more (Panthalassa). ', NULL, 'John Doe', NULL, 1, NULL),
(2743, 5, 1, 'Како се нарекува изумителот на пушката АК-47,|популарно позната како калашников?', 'Александар', 'Фјодор', 'Николај', 'Михаил', 4, 7, 5, 0, 0, 'АК-47 или Автоматска пушка Калашников модел од 1947 година (руски: Автомат Калашникова образца 1947 года) е автоматска пушка од советско производство која се користи и во македонската армија. Ја дизајнирал Михаил Калашников и е една од најпознатите и најраспространетите автоматски пушки денес. Оваа пушка се покажала како многу добра во војната во Виетнам каде што американските војници кажувале дека АК-47 е многу поиздржлива од нивната М16 јуришна пушка. ', NULL, 'John Doe', NULL, 1, '2020-03-10 19:04:05'),
(2744, 2, 1, 'Со што се означуваат прикачените документи|во испраќањето на електронска пошта?', 'хефталка', 'молив', 'спојувалка', 'мемо хартија', 3, 7, 6, 0, 0, 'Attachment - спојувалка / spajalica', NULL, 'John Doe', NULL, 1, '2020-04-16 15:55:14'),
(2745, 4, 1, 'Тит Ливиј го напишал „Ab urbe condita“ или|„Од основањето на градот“. За кој град станува збор?', 'Атина ', 'Рим', 'Картагина ', 'Спарта', 2, 3, 1, 0, 0, 'Тит Ливиј (лат. „Titus Livius“) бил римски историчар, роден во Падова (Patavium) околу 59 година п.н.е., а умира во 17 г.н.е. Ab urbe condita literally means \"from the founding of the City\" and anno urbis conditae means \"in the year since the City''s founding\". Therefore, the traditional date of the foundation of Rome, 753 BC, would be written 1 AUC. 1 AD, or 1 CE, would be 754 AUC. The foundation of the Empire, 27 BC or 27 BCE, would be 726 AUC.', NULL, 'John Doe', NULL, 1, '2020-03-22 18:45:03'),
(2746, 4, 1, 'Во една позната бајка, Герда го спасува Кај од...', 'Белиот принц', 'Снежната кралица', 'Замрзнатиот крал', 'Црниот човек', 2, 4, 7, 0, 0, 'Snježna kraljica (danski Snedronningen) je bajka Hansa Christiana Andersena, koja je prvi puta objavljena 1845. godine i koja za tematiku ima borbu između dobra i zla, koju u priči na neki način personificiraju dječak Kay i djevojčica Gerda.', NULL, 'John Doe', NULL, 1, NULL),
(2747, 5, 1, 'Анкара е град во Турција.|Каде се наоѓа гратчето Анкаран?', 'во Босна и Херцеговина', 'во Србија', 'во Црна Гора', 'во Словенија', 4, 2, 1, 0, 0, 'Ankaran is a town in the Municipality of Ankaran, located near the border with Italy, in the Littoral region of Slovenia. It is less than 5 km from the Italian town of Muggia near Trieste, about 2.5 km from the Italian-Slovenian border, 6.5 km from Koper, and 33 km from the nearest Croatian town, Buje. In the entire municipality both Slovenian and Italian are official languages.', NULL, 'John Doe', NULL, 1, NULL),
(2748, 5, 1, 'Кој астроном Земјата ја гледал како центар на свемирот,|а центарот на неговото лице, носот, го изгубил во двобој?', 'Галилео Галилеј', 'Јоханес Кеплер', 'Тихо Брахе', 'Исак Њутн', 3, 7, 1, 0, 0, 'In 1566 Tycho Brahe left to study at the University of Rostock. Here he studied with professors of medicine at the university''s famous medical school. Here he became interested in medical alchemy and botanical medicine.[n 2] On 29 December 1566 Tycho lost part of his nose in a sword duel against a fellow Danish nobleman, Manderup Parsberg (his third cousin).', NULL, 'John Doe', NULL, 1, NULL),
(2749, 7, 1, 'Со што се занимавал Алан Форд,|пред да се приклучи на групата ТНТ?', 'маркетинг', 'градежништво', 'банкарство', 'угостителство', 1, 4, 7, 0, 0, 'Alan Ford siromašni je plavokosi momak odrastao u sirotištu. Vrlo je naivan i dobrodušan pa ga se često iskorištava. Čista je suprotnost drugom poznatom tajnom agentu Jamesu Bondu. Kao crtač reklama bez posla i praznih džepova kreće u potragu za svojim prvim poslom. Na žalost (ili sreću), radi grješku i ispisuje krivu adresu te umjesto do sastanka sa svojom prvom mušterijom dolazi do cvjećarnice, sjedišta skupine tajnih agenata, grupe TNT. Od tada počinje Alanova karijera tajnog agenta, ali istovremeno to je i početak jednog od najneobičnijih stripova. ', NULL, 'John Doe', NULL, 1, '2020-05-02 11:33:15'),
(2750, 7, 1, 'Кој излегол како победник во|битката кај Тразименското езеро?', 'Гај Јулиј Цезар', 'Ханибал', 'Саладин', 'Хадријан', 2, 3, 0, 0, 0, '', NULL, 'John Doe', NULL, 1, NULL),
(2751, 6, 1, '„Историјата на борбата за моралот против основните инстикти за|живот е најголем неморал за кој знае светот“ се зборови на...', 'Жан Пол Сартр', 'Артур Шопенхауер', 'Албер Ками', 'Фридрих Ниче', 4, 4, 8, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-14 15:32:30'),
