(2753, 3, 1, 'Што нема да најдете во туристичкиот водич|меѓу знаменитостите на Амстердам?', 'Ријксмузеј', 'Атомиум', 'куќата на Ана Франк', 'Плоштад Дам', 2, 2, 1, 0, 0, 'The Atomium is a landmark building in Brussels, originally constructed for the 1958 Brussels World''s Fair (Expo 58).', NULL, 'John Doe', NULL, 1, '2020-03-25 18:38:11'),
(2754, 4, 1, 'Како би можеле да го преведеме името на еден од|најстарите англиски фудбалски клубови?', 'Шефилд среда', 'Шефилд петок', 'Шефилд сабота', 'Шефилд недела', 1, 14, 1, 0, 0, 'Sheffield Wednesday Football Club is a professional association football club based in Sheffield, England. The team currently competes in the Championship, the second tier of the English football league system. Formed as an offshoot of The Wednesday Cricket Club in 1867, they went by the name of The Wednesday Football Club until changing to their current name in 1929.', NULL, 'John Doe', NULL, 1, NULL),
