(2756, 4, 1, 'Која владетелска „лоза“ е прекината|во 1917 година со царската абдикација?', 'Романов', 'Николаев', 'Рјурикович', 'Годунов', 1, 3, 1, 0, 0, 'Dinastija Romanov (rus. Рома́нов) je carska dinastija koja je vladala Rusijom od 1613. do rušenja monarhije 1917. u vrijeme Februarske revolucije. Po izumiranju dinastije Rjurikoviča, vlast je preuzeo ruski boljar Boris Godunov, nakon čije je smrti za cara izabran Mihajlo Fjodorovič Romanov, utemeljitelj nove carske dinastije.', NULL, 'John Doe', NULL, 1, NULL),
