(2758, 5, 1, 'Во кое дело на Ксенофонт десет илјади Грци се враќаат дома,|исто како Вориорсите на островот Кони?', 'Анафаза', 'Анабаза', 'Метафаза', 'Метаморфоза', 2, 4, 6, 4, 8, 'Xenophon of Athens was an ancient Greek philosopher, historian, soldier, mercenary, and student of Socrates. As one of the Ten Thousand (Greek mercenaries), he also participated in Cyrus the Younger''s failed campaign to claim the Persian throne from his brother Artaxerxes II of Persia and recounted the events in Anabasis, his most notable history. ', NULL, 'John Doe', NULL, 1, NULL),
(2759, 5, 1, 'Кој во 1903 година, доби половина Нобелова награда за физика,|додека другата половина ја добија Пјер и Марија Кири?', 'Вилхелм Рентген', 'Макс Планк', 'Анри Бекерел', 'Нилс Бор', 3, 7, 4, 0, 0, 'Бекерел / Пјер Кири / Марија Кири (1903) Антоан Анри Бекерел (англиски: Antoine Henri Becquerel 15 декември 1852 – 25 август 1908) — француски физичар, добитник на Нобелова награда за физика, и откривач на радиоактивностa, на ова поле работел заедно со Марија Склодовска-Кири и Пјер Кири, со кои во 1903 година ја поделил Нобеловата награда за физика. Единицата бекерел (Bq) во SI системот за радиоактивност е именувана во негова чест. Нилс Бор Нобеловата награда за физика ја доби во 1922.', NULL, 'John Doe', NULL, 1, NULL),
