(2804, 3, 1, 'Со кое хоби може да создадете нешто што е|осум илјадити дел од секундата?', 'риболов', 'витраж', 'оригами', 'фотографија', 4, 19, 4, 0, 0, 'Shutter speed deals with the period of time that the shutter remains open for exposure in both film and digital photography, and this has a very detailed effect on the image that you end up with.  The 1/8000 shutter speed is one of these extreme shutter speeds that closes the shutter so quickly that you can pick out a single still image from moving objects.', NULL, 'John Doe', NULL, 1, '2020-01-18 19:21:14'),
