(2806, 3, 1, 'Три од најчестите состојби на материјата се цврсти|материи, течности и гасови. Течноста има...', 'дефиниран волумен, но не и форма', 'дефинирана форма, но не и волумен', 'дефиниран волумен и форма', 'недефинирана форма ниту волумен', 1, 7, 3, 7, 4, 'A liquid takes the shape of its container (no defined shape), but has a fairly constant volume (at least compared to a gas). The state of matter of a substances is due to the kinetic energy of its components. With enough energy, atoms and molecules are less strongly bound to each other. ', NULL, 'John Doe', NULL, 1, '2020-01-18 13:20:30'),
(2807, 3, 1, 'Кои „браќа“ банкротираа и симболично ја започнаа|светската финансиска криза во 2008 година?', 'Браќата Ворнер', 'Браќата Стругатски', 'Браќата Леман', 'Браќата Ваховски', 3, 16, 2, 18, 2, 'Lehman Brothers Holdings Inc. was a global financial services firm. Before filing for bankruptcy in 2008, Lehman was the fourth-largest investment bank in the United States (behind Goldman Sachs, Morgan Stanley, and Merrill Lynch), doing business in investment banking, equity and fixed-income sales and trading (especially U.S. Treasury securities), research, investment management, private equity, and private banking. Lehman was operational for 158 years from its founding in 1850 until 2008.', NULL, 'John Doe', NULL, 1, NULL),
(2808, 3, 1, 'Таткото на пејачката Доли Партон не можел да чита, па затоа|поттикната од овој факт Доли донира над 100 милиони...', 'очила', 'телефони', 'телевизори', 'книги', 4, 9, 5, 0, 0, 'Dolly Parton likes to give away books. She just donated her 100 millionth. Parton said. Robert Lee Parton Sr., who died in 2000, never attended school and couldn’t read or write, Parton explained. She didn’t grow up with any books in her childhood Tennessee home, save for the Bible.', NULL, 'John Doe', NULL, 1, '2020-03-10 18:47:13'),
(2809, 5, 1, 'Кој е Мохамед Салах, кој доби преку 1 милион гласови|на изборите во Египет, притоа воопшто да не е кандидат?', 'религиозен водач', 'фудбалер на „Ливерпул“', 'угостител од Каиро', 'политички затвореник', 2, 15, 0, 14, 1, 'Some voters were so disillusioned with the Egyptian presidential elections that they spoiled their ballot papers by voting for Liverpool forward Mohamed Salah. Salah is a talismanic figure in his homeland after firing them to the 2018 World Cup, but he was obviously not among the candidates for Egypt’s top job. State media reported that Abdel Fattah el-Sisi had secured over 97% – but the election has been branded ‘farcical’ after five challengers were blocked from joining the ballot.', NULL, 'John Doe', NULL, 1, NULL),
(2810, 5, 1, 'Што од наведениве е одличен извор на супстанцата ресвератрол,|за која се смета дека може да го забави стареењето?', 'црвено вино', 'овчо млеко', 'спанаќ', 'мед', 1, 7, 2, 7, 3, 'Ресвератролот е стилбеноид, вид на природен фенол, и фитоалексин кој го синтетизираат некои видови на растенија како одговор на повреда или кога растението е нападнато од патогени како бактерии или габи. Извори на ресвератрол од храната претставуваат лушпите од грозје, боровинки, малини, црници.', NULL, 'John Doe', NULL, 1, '2020-04-11 11:19:47'),
(2811, 5, 1, 'Кое од тврдењата логично следи|од тврдењето „Сите жители се метли“?', 'Некои жители не се метли', 'Сите метли се жители ', 'Некои жители се метли', 'Сите метли не се жители', 3, 6, 4, 0, 0, 'Класична логика е класа на формалните логики кои се изучувале најисцрпно и применувале најшироко. Ако е валидно за големото-сите, валидно е и за помалиот дел-некои. Во Аристотеловиот „Органон“ се запознаваме со неговата теорија на силогизми, што е логика со ограничен облик на расудувања: тврдењата се една од четирите форми, Сите P се Q, Некои P се Q, Ниедно P не е Q и Некои P не се Q. Овие расудувања ги наоѓаме во два пара на два двојни оператора, каде секој оператор е негација на другиот, соодноси кои Аристотел ги резимира како логички квадрат на спротивности. ', NULL, 'John Doe', NULL, 1, NULL),
(2812, 5, 1, 'Што било најбројно во 1910 година?', 'телевизорите', 'микробрановите печки', 'електричните коли', 'банкоматите', 3, 17, 1, 0, 0, 'Like today, one of the challenges for early electric car owners was where to charge them. But by 1910 owners could install their own charging stations on their property, and an increasing number of car-repair shops popped up that allowed electric cars to charge overnight. At the electric car''s peak in 1912 there were roughly 30,000 zipping around on American roadways.', NULL, 'John Doe', NULL, 1, NULL),
(2813, 6, 1, 'Кој уметник го насликал „Спасителот на светот“,|слика продадена за рекордни 450 милиони долари?', 'Пабло Пикасо', 'Винсент ван Гог', 'Енди Ворхол', 'Леонардо да Винчи', 4, 1, 2, 0, 0, 'Аукциската куќа „Кристис“ соопшти дека на Министерството за култура и туризам на Абу Даби му ја предала сликата „Спасителот на светот“ (Salvator Mundi) од Леонардо да Винчи, на наддавање беше продадена за рекордни 450 милиони долари. Продажбата на ова дело го урна за речиси повеќе од двојно стариот аукциски рекорд кој го држеа „Жените од Алжир“(Les Femmes D’Alger) на Пабло Пикасо, подадена за 179,4 милиони долари во мај 2015 година. [Update: June 2018]', NULL, 'John Doe', NULL, 1, '2020-03-01 12:33:38'),
(2814, 2, 1, 'За да се заштитат од оглувување,|петлите си ги затвораат ушните канали кога...', 'кукурикаат', 'шетаат низ ливада', 'колваат просо', 'бркаат кокошки', 1, 12, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-29 12:14:05'),
