(2819, 5, 1, 'Која државна титула не постои во Русија?', 'градоначалник на главниот град', 'потпретседател', 'уставен судија', 'премиер', 2, 15, 1, 0, 0, 'The Vice President of the Russian Federation (before 25 December 1991 - Vice President of the Russian SFSR) was the first in the presidential line of succession, becoming the new President of Russia upon the death, resignation, or removal of the president. Following 1993 Russian constitutional crisis the office was abolished. The position of the Prime Minister of Russia became the second-highest ranking public office, and in the event of the president''s incapacitation, death or resignation, the prime minister would assume the presidential powers and duties as acting president. ', NULL, 'John Doe', NULL, 1, '2020-03-22 18:36:57'),
(2820, 5, 1, 'Која точка е најблиску до најголемиот остров на Земјата?', 'Северниот пол', 'Јужниот пол', 'врвот на Еверест', 'Маријанската палата', 1, 2, 8, 0, 0, 'The Canadian territory of Nunavut lies closest to the North Pole. Greenland, the world''s largest island and an independent country within the Kingdom of Denmark, is also close to the pole. The North Pole is much warmer than the South Pole.', NULL, 'John Doe', NULL, 1, NULL),
