(2823, 3, 1, 'Од каде е познатиот цитат: „И прости ни ги долговите наши,|како што ние им ги проштаваме на нашите должници…“?', 'од говорот на Мартин Лутер Кинг', 'од молитвата „Оче наш“', 'од пиесата „Макбет“', 'од песната за Коледе', 2, 11, 1, 0, 0, 'Господ рекол: „Ако им ги простите на луѓето гревовите нивни и вам ќе ви ги прости вашиот Отец небесен; ако, пак, не им ги простите гревовите на луѓето и вашиот Отец нема да ви ги прости вашите“ (Матеј 6: 14-15)', NULL, 'John Doe', NULL, 1, NULL),
(2824, 4, 1, 'Во негови зборови, кој оперски херој|„успеал“ да биде и тука и таму?', 'Отело', 'Дон Жуан', 'Фигаро', 'Каварадоси', 3, 9, 7, 0, 0, 'Figaro Here, Figaro There (Italian: Figaro qua, Figaro là) ', NULL, 'John Doe', NULL, 1, NULL),
(2825, 3, 1, 'Волумен е квантификација на тоа колку простор|зафаќа еден објект. Како е дефинирана густината?', 'маса поделена со волумен', 'маса плус волумен', 'волумен поделен со маса', 'производ на време и волумен', 1, 7, 4, 0, 0, 'The Density Calculator uses the formula p=m/V, or density (p) is equal to mass (m) divided by volume (V). The calculator can use any two of the values to calculate the third. Density is defined as mass per unit volume', NULL, 'John Doe', NULL, 1, '2020-03-10 18:45:49'),
(2826, 5, 1, 'Кое е целосното име на британскиот музичар Стинг?', 'Енди Џејмс Самерс', 'Стјуарт Армстронг Копланд', 'Хенри Падовани', 'Гордон Метју Томас Самнер', 4, 9, 4, 0, 0, 'Gordon Matthew Thomas Sumner, CBE (born 2 October 1951), known professionally as Sting, is an English singer, songwriter and actor. The Police were a British rock band formed in London in 1977.[1] For most of their history the band consisted of Sting (lead vocals, bass guitar, primary songwriter), Andy Summers (guitar) and Stewart Copeland (drums, percussion). ', NULL, 'John Doe', NULL, 1, NULL),
(2827, 8, 1, 'Каде работи Марион Крејн, љубовницата на Сем Луис|во американскиот хорор „Психо“ на Алфред Хичкок?', 'во агенција за недвижности', 'во психијатриска болница', 'во спортска гимназија', 'во фабрика за овошје', 1, 8, 5, 0, 0, 'Мерион Крејн (Џенет Ли), вработена во агенција за недвижности во Феникс зема 40.000 долари од клиент и наместо да ги пријави во банка, со своето возило се упатува кон куќата на својот љубовник Сем Лумис (Џон Гавин) во Фервеил, Калифорнија сакајќи да му помогне во финансиските проблеми наследени од татко му и од бракот, како и во бизнисот.', NULL, 'John Doe', NULL, 1, NULL),
(2828, 5, 1, 'Првиот дел од Новиот Завет го сочинуваат Евангелијата.|Според кого е четвртото евангелие?', 'Матеј', 'Марко', 'Лука', 'Јован', 4, 11, 1, 0, 0, 'Првото евангелие е според Матеј. Второто евангелие е според Марко. Третото евангелие е според Лука. Четвртото и последно евангелие е според Јован.', NULL, 'John Doe', NULL, 1, '2020-05-03 13:20:17'),
(2829, 5, 1, 'Името Европа потекнува од асирскиот збор Ереб со значење...', 'црвена полумесечина', 'заоѓање на Сонце', 'полна месечина', 'изгрејсонце', 2, 5, 3, 0, 0, 'There have been attempts to connect Eurṓpē to a Semitic term for \"west\", this being either Akkadian erebu meaning \"to go down, set\" (said of the sun) or Phoenician ''ereb \"evening, west\",[16] which is at the origin of Arabic Maghreb and Hebrew ma''arav. Michael A. Barry, professor in Princeton University''s Near Eastern Studies Department, finds the mention of the word Ereb on an Assyrian stele with the meaning of \"night, [the country of] sunset\", in opposition to Asu \"[the country of] sunrise\", i.e. Asia. ', NULL, 'John Doe', NULL, 1, NULL);
