(2830, 4, 1, 'Аденинот има голема улога во градбата на ДНК|и притоа се поврзува со комплементарната база...', 'гванин', 'цитозин', 'рибоза', 'тиамин', 4, 7, 2, 0, 0, 'Аденинот (A, Ade) е нуклеобаза (пурински дериват) со значајна улога за живите организми. Учествува во градбата на ДНК, каде се поврзува со комплементарната база тимин.', '', 'John Doe', '', 1, '2020-04-04 18:07:07'),
(2831, 5, 1, 'Енди Вајт и Џими Никол, двајцата се британци и двајцата беа...', 'тапанари на Битлс', 'голмани на Манчестер', 'победници на Роланд Гарос', 'затвореници во Гвантанамо', 1, 9, 4, 0, 0, 'Andrew White was a Scottish drummer, primarily a session musician. He was named one of the \"fifth Beatles\" as he is best known for replacing Ringo Starr on drums. James George Nicol, known professionally as Jimmie Nicol or Jimmy Nicol, is a British drummer and business entrepreneur. ', NULL, 'John Doe', NULL, 1, NULL),
(2832, 6, 1, 'Кој музичар во 1980 година ја водел кампањата за роденденот|на Мартин Лутер Кинг да стане државен празник во САД?', 'Реј Чарлс', 'Џејмс Браун', 'Стиви Вондер', 'Џими Хендрикс', 3, 9, 4, 0, 0, 'Покрај музиката, Стиви Вондер се ангажирал и во политички активности. Во 1980 година ја водел кампањата за роденденот на Мартин Лутер Кинг да стане државен празник во САД и во 2009 година, кога бил именуван како Гласник на мирот од страна на Обединетите Нации', NULL, 'John Doe', NULL, 1, NULL),
(2833, 8, 1, 'Која европска држава има химна|во која не се спомнува името на државата?', 'Белгија', 'Холандија', 'Данска', 'Финска', 2, 3, 1, 0, 0, 'The Netherlands and the United States both have national anthems which do not mention their country''s name. ', NULL, 'John Doe', NULL, 1, '2020-02-16 14:49:26'),
