(2835, 9, 1, 'Кој е првиот американски претседател роден во болница?', 'Ричард Никсон', 'Роналд Реган', 'Џералд Форд', 'Џими Картер', 4, 15, 2, 0, 0, 'James Earl \"Jimmy\" Carter, our 39th president, was born at the Wise Clinic in Plains, Ga. on October 1, 1924, making him the first U.S. president to be born in a hospital.', NULL, 'John Doe', NULL, 1, '2020-03-19 18:32:27'),
