(2838, 4, 1, 'Кој италијански град е познат како дом|на луксузните автомобили Ферари?', 'Неапол', 'Палермо', 'Маранело', 'Венеција', 3, 17, 1, 0, 0, 'Ferrari N.V.  is an Italian luxury sports car manufacturer based in Maranello. Founded by Enzo Ferrari in 1939 out of Alfa Romeo''s race division as Auto Avio Costruzioni, the company built its first car in 1940.', NULL, 'John Doe', NULL, 1, NULL),
(2839, 4, 1, 'Кој ја играше улогата на Рик|во филмскиот класик „Казабланка“?', 'Хемфри Богарт', 'Грегори Пек', 'Кери Грант', 'Џејмс Стјуарт', 1, 8, 1, 0, 0, 'Казабланка (1942) е култен американски романтичен драмски филм, чие дејство се одвива во француски-контролираното Мароко, во градот Казабланка за време на Втората светска војна. Режисер на филмот е Мајкл Куртиц а главните улоги ги имаат Хемфри Богарт како Рик Блејн и Ингрид Бергман како Илса Лунд.', NULL, 'John Doe', NULL, 1, NULL),
