(2843, 4, 1, 'Што е шумска треперка?', 'белоопашест орел', 'златна куна', 'врапчевидна птица', 'индиски паун', 3, 12, 3, 0, 0, 'Шумската треперка (науч. Anthus trivialis) е мала врапчевидна птица од фамилијата на тресиопашките (Motacillidae), родот на треперките (Anthus); која се размножува низ умерена Европа и Азија, и северозападна Африка. Ја има и во Македонија. Таа е птица преселница што зимува во тропска Африка и Азија.', NULL, 'John Doe', NULL, 1, NULL),
