(2850, 6, 1, 'Во кој месец Шведска го слави својот национален ден?', 'јануари', 'мај', 'јуни', 'декември', 3, 2, 1, 1, 1, 'National Day of Sweden (Swedish: Sveriges nationaldag) is a national holiday observed in Sweden on 6 June every year. Prior to 1983, the day was celebrated as the Swedish Flag Day (Swedish: Svenska flaggans dag). At that time, the day was renamed the Swedish national day by the Riksdag.', NULL, 'John Doe', NULL, 1, NULL),
