(2857, 5, 1, 'Кој грчки бог во песните нарекуван Непогрешлив|стрелец, Сребрен, Јасновид и Сјаен?', 'Хефест', 'Диониз', 'Посејдон', 'Аполон', 4, 10, 1, 0, 0, 'Ljudi su ga poštovali jer je bio bog svjetlosti i Sunca bez čega život ne bi bio moguć, a također i zato što je bio bog sklada i ljepote, koji čine život smislenim. Ideal je grčkoga kurosa, skladnog, razvijenog i lijepog mladića. Apolon je štitio ljude, liječio ih, brinuo se za njih, nagrađivao dobro i kažnjavao zlo. Bio je i bog streličarstva, a njegove strijele nikad nisu promašile metu, pogotovo kad su kažnjavale zlo i nosile kugu.', NULL, 'John Doe', NULL, 1, NULL),
(2858, 6, 1, 'На кој американски претседател му се припишува реченицата: |''We never dropped a bomb. We never fired a bullet. We never went to war''?', 'Џон Кенеди', 'Ричард Никсон', 'Џими Картер', 'Роналд Реган', 3, 3, 2, 0, 0, 'Jimmy Carter: ''We never dropped a bomb. We never fired a bullet. We never went to war''. What he''s most proud of, though, is that he didn''t fire a single shot. Didn''t kill a single person. Didn''t lead his country into a war – legal or illegal. \"We kept our country at peace. We never went to war. We never dropped a bomb. We never fired a bullet. But still we achieved our international goals. We brought peace to other people, including Egypt and Israel. We normalised relations with China, which had been non-existent for 30-something years. We brought peace between US and most of the countries in Latin America because of the Panama Canal Treaty. We formed a working relationship with the Soviet Union.\"', NULL, 'John Doe', NULL, 1, NULL),
