(2861, 5, 1, 'Кои две банди, белци и порториканци,|се во конфликт во „Приказна од западната страна“?', 'Patriots и Saints', 'Giants и Pirates', 'Blue Jackets и Knights', 'Jets и Sharks', 4, 8, 1, 8, 6, 'Приказна од западната страна е американски музички филм од 1961, режиран од Роберт Вајзи и Џером Робинс. Филмот претставува адаптација од истоимената Бродвејска мелодија од 1957, која, пак, била делумнo адаптирана од претставата Ромео и Јулија на Вилијам Шекспир. Во главните улоги играат Натали Вуд, Ричард Бејмер, Рас Тамблин, Рита Морено и Џорџ Чакирис. In the late summer of 1957, in the West Side''s Lincoln Square neighborhood in Manhattan, there is a growing tension between a white American street gang, the Jets, led by Riff, and a Puerto Rican gang, the Sharks, led by Bernardo.', NULL, 'John Doe', NULL, 1, '2020-03-20 20:00:29'),
