(2866, 7, 1, 'Каде се наоѓа некогаш модерното туристичко место Вароша, денес познат како|„градот на духовите“ кој е потполно напуштен по конфликтот во Кипар 1974 година?', 'кај Ларнака', 'кај Лимасола', 'кај Пафос', 'кај Фармагуста', 4, 2, 1, 0, 0, 'With the advent of the Ottoman rule, Latins lost their privileged status in Famagusta and were expelled from the city. Greek Cypriots were at first allowed to own and buy property in the city, but were banished from the walled city in 1573-74 and had to settle outside in the area that later developed into Varosha. Over time, Varosha developed into a prosperous agricultural town thanks to its location away from the marshes, whilst the walled city remained dilapidated.', NULL, 'John Doe', NULL, 1, NULL),
