(2872, 7, 1, 'Кој Иван бил рускиот цар Иван Грозни?', 'Иван IV', 'Иван III', 'Иван II', 'Иван I', 1, 3, 1, 0, 0, 'Иван IV Василевич, познат како Иван Грозни (руски: Ива́н Гро́зный) (роден 1530 во Москва – починал 1584 во Москва) бил голем кнез на Москва од 1533. Епитетот „Грозни“ повеќе се однесувал на моќта, силата и строгоста, отколку на лошотија, грдотија или суровост. Тој е првиот владетел што се прогласил за цар на цела Русија, во 1547 година.', NULL, 'John Doe', NULL, 1, NULL),
(2873, 7, 1, 'Со кои зборови почнува библискиот Стар завет?', 'Во почетокот постоеше...', 'И кажа Бог...', 'Ги немаше на почетокот...', 'Во почетокот Бог ги создаде...', 4, 11, 1, 0, 0, 'Во почетокот Бог ги создаде небото и земјата. Земјата беше безоблична и празна; и имаше темнина над бездната; Духот Божји лебдеше над водата.', NULL, 'John Doe', NULL, 1, NULL),
