(2878, 5, 1, 'Кој во 1302 бил протеран од Фиренца?', 'Галилео Галилеј', 'Џордано Бруно', 'Николо Макијавели', 'Данте Алигиери', 4, 3, 1, 7, 5, '1302 January 27, Dante is exiled from Florence. On this day, poet and politician Dante Alighieri is exiled from Florence, where he served as one of six priors governing the city. Dante’s political activities, including the banishing of several rivals, led to his own banishment, and he wrote his masterpiece, The Divine Comedy, as a virtual wanderer, seeking protection for his family in town after town.', NULL, 'John Doe', NULL, 1, NULL),
(2879, 5, 1, 'По шкотскиот изумител Чарлс Мекинтош, е наречен тип на...', 'шешир', 'џемпер', 'наметка', 'кравата', 3, 7, 5, 19, 2, 'Charles Macintosh was born in Scotland on December 29, 1766. At the beginning of his career, Macintosh worked as a clerk for a Glasgow merchant, but by the age of 19 he had already given it up to pursue his true passion: chemistry. At 20 years old Macintosh opened up his own plant in Glasgow that worked on innovative new dying methods. In 1823 Macintosh patented his new process. By sandwiching a layer of liquid rubber (made with naphtha) between two layers of fabric, Macintosh had created a new material that would be resistant to water while also remaining flexible and wearable. Resistant to wet and rainy conditions, the new fabric was perfect for making coats.', NULL, 'John Doe', NULL, 1, '2020-03-22 18:09:12'),
