(2881, 5, 1, 'Со која револуција Чехословачка|се ослободи од комунизмот?', 'кадифена', 'портокалова', 'славна', 'розова', 1, 3, 1, 0, 0, 'The Velvet Revolution (Czech: sametová revoluce) or Gentle Revolution (Slovak: nežná revolúcia) was a non-violent transition of power in what was then Czechoslovakia, occurring from 16 November to 29 December 1989. Popular demonstrations against the one-party government of the Communist Party of Czechoslovakia combined students and older dissidents. ', NULL, 'John Doe', NULL, 1, NULL),
(2882, 4, 1, 'Хитот создаден во соработка на групата|Maroon 5 и Кристина Агилера се нарекува...', 'Moves like Travolta', 'Moves like Jackson', 'Moves like Jagger', 'Moves like Lennon', 3, 9, 1, 0, 0, '\"Moves like Jagger\" is a song by American band Maroon 5 featuring singer Christina Aguilera. It was released by A&M Octone Records on June 21, 2011, as the fourth and final single from the re-release of the group''s third studio album Hands All Over (2010)', NULL, 'John Doe', NULL, 1, NULL),
(2883, 3, 1, 'Издвоете го оксиморонот!', 'рана зора', 'доаѓаат луѓе', 'ладен оган', 'мала куќичка', 3, 5, 3, 0, 0, 'Оксиморон (буквално значење - остроумна глупост) е стилска фигура којашто се создава со спојување на два противречни поими', NULL, 'John Doe', NULL, 1, NULL),
(2884, 4, 1, 'Која буква од грчкиот алфабет го означува Лудолфовиот број?', 'омега', 'пи', 'фи', 'ми', 2, 6, 2, 0, 0, 'Пи (сим. π), Лудолфов број или Архимедова константа — ирационален реален број, кој го претставува односот на обиколката на една кружница со нејзиниот пречникот во Евклидовата геометрија.', NULL, 'John Doe', NULL, 1, NULL),
(2885, 5, 1, 'Што Јудита му отсекла на Холоферн|откако бил заведен и пијан во бесознание?', 'глава', 'рака', 'нога', 'коса', 1, 10, 1, 0, 0, 'In the deuterocanonical Book of Judith, Holofernes (Greek: Ὀλοφέρνης; Hebrew הולופרנס) is an invading general of Nebuchadnezzar, who dispatched Holofernes to take vengeance on the nations of the West that had withheld their assistance to his reign. The general laid siege to Bethulia, commonly believed to be Meselieh, and the city almost surrendered. Bethulia was saved by Judith, a beautiful Hebrew widow who entered Holofernes''s camp and seduced him. Judith then beheaded Holofernes while he was drunk. She returned to Bethulia with the severed head, and the Hebrews defeated the enemy. ', NULL, 'John Doe', NULL, 1, NULL),
(2886, 4, 1, 'Кое слатко е неизоставна состојка во|подготовката на Захер тортата?', 'слатко од шипки', 'слатко од кајсии', 'слатко од јагоди', 'слатко од вишни', 2, 19, 7, 0, 0, 'Sachertorte (German pronunciation: [ˈzaxɐˌtɔʁtə] (About this sound listen)) is a specific type of chocolate cake, or torte, invented by Austrian Franz Sacher in 1832 for Prince Wenzel von Metternich in Vienna, Austria. It is one of the most famous Viennese culinary specialties. Main ingredients: Chocolate sponge cake, apricot jam, dark chocolate icing', NULL, 'John Doe', NULL, 1, '2020-03-22 18:41:39'),
(2887, 5, 1, 'Која глумица се прослави со улогата во филмот|„И господ создаде жена“?', 'Грета Гарбо', 'Мерлин Монро', 'Брижит Бардо', 'Џина Лолобриџида', 3, 8, 1, 0, 0, 'I Bog stvori ženu (ET DIEU... CRÉA LA FEMME), 1956 S ovim filmom Brigitte Bardot postala je popularna preko noći i seksualni simbol generacijama pedesetih i šezdesetih godina 20. stoljeća. ', NULL, 'John Doe', NULL, 1, NULL),
(2888, 5, 1, 'На која држава главниот град се наоѓа|во регионот Уусимаа?', 'Ирска', 'Холандија', 'Финска', 'Исланд', 3, 2, 1, 0, 0, 'Uusimaa (Finnish: [ˈuːsimɑː]; Swedish: Nyland [²nyːland]; both lit. \"new land\") is a region of Finland. It borders the regions of Southwest Finland, Tavastia Proper, Päijänne Tavastia, and Kymenlaakso. Finland’s capital and largest city, Helsinki, along with the surrounding Greater Helsinki area, are both contained in the region, which makes Uusimaa Finland''s most populous region. ', NULL, 'John Doe', NULL, 1, NULL),
(2889, 6, 1, 'Колку титански оџаци имаше Титаник?', '2', '3', '4', '5', 3, 17, 3, 0, 0, 'The 3 front smokestacks were to get rid of the smoke produced by the boilers. At that time, 4 funnels was seen as a sign of a big ship, so they added a fourth funnel to the Titanic, which was empty. That dummy funnel only served for ventilation.', NULL, 'John Doe', NULL, 1, NULL),
(2890, 6, 1, 'Во кој роман на Ернест Хемингвеј беснее|Првата светска војна?', 'За кого бијат камбаните', 'Збогум на оружјето', 'Сонцето заоѓа', 'Преку реката и во шумата', 2, 4, 4, 3, 7, 'Zbogom oružje (eng.: A Farewell to Arms) je poluautobiografski roman Ernesta Hemingwaya iz 1929. Pisan je u prvom licu, a opisuje doživljaje Frederica Henryja, Amerikanca koji kao dobrovoljac sudjeluje u talijanskog vojsci za vrijeme Prvog svjetskog rata; radnja se u velikoj mjeri oslanja na Hemingwayeva vlastita iskustva. Bavi se problemima rata, smrti, hrabrosti i ljubavi.', NULL, 'John Doe', NULL, 1, NULL),
(2891, 5, 1, 'И покрај тоа што пеел, легендарниот Сачмо најчесто свирел...', 'саксофон', 'кларинет', 'труба', 'тромбон', 3, 9, 3, 0, 0, 'Louis Daniel Armstrong (August 4, 1901 – July 6, 1971), nicknamed Satchmo,[2] Satch, and Pops, was an American trumpeter, composer, singer and occasional actor who was one of the most influential figures in jazz. ', NULL, 'John Doe', NULL, 1, '2020-04-13 14:55:30'),
(2892, 6, 1, 'Кој Уранов сателит е наречен по најмладата|ќерка на Шекспировиот крал Лир?', 'Дездемона', 'Миранда', 'Корделија', 'Титанија', 3, 4, 2, 7, 1, 'King Lear is a tragedy written by William Shakespeare. Lear – King of Britain, Goneril – Lear''s eldest daughter, Regan – Lear''s second daughter, Cordelia – Lear''s youngest daughter', '', 'John Doe', '', 1, '2020-04-11 11:23:31'),
(2893, 5, 1, 'Низ која држава тече реката Кваи?', 'Тајланд', 'Кина', 'Виетнам', 'Јапонија', 1, 2, 3, 0, 0, 'The Khwae Yai River, also known as the Si Sawat, is a river in western Thailand. It has its source in the Tenasserim Hills and flows for about 380 kilometres (240 mi) through Sangkhla Buri, Si Sawat, and Mueang Districts of Kanchanaburi Province, where it merges with the Khwae Noi to form the Mae Klong River at Pak Phraek. ', NULL, 'John Doe', NULL, 1, NULL),
(2894, 6, 1, 'Кои се поклонувале и принесувале|жртви на божицата Хатор?', 'Нордијките', 'Келтките', 'Еѓипќанките', 'Етрурките', 3, 10, 0, 0, 0, 'Во египетската митологија Хатор (на египетски значи „Куќа на Хорус“) на почеток била персонификација за Млечниот Пат, кој се сметал како млеко што тече од вимиња на небеската крава. Хатор била древна божица, обожувана како божество-крава најмалку од 2700 п.н.е., во тек на втората династија, а можно е дури и за време на владеењето на кралот Скорпија. Името Хатор упатува на нејзиното свивање во форма на Млечен Пат околу ноќното небо, а следствено на тоа и околу богот на небото Хорус.', NULL, 'John Doe', NULL, 1, NULL),
(2895, 5, 1, 'Кој фудбалски клуб за прекар го носи називот|„Стара жена“ - „La Vecchia Signora“?', 'Интер', 'Јувентус', 'Рома', 'Фиорентина', 2, 14, 1, 0, 0, 'Founded in 1897 by a group of Torinese students, the club has worn a black and white striped home kit since 1903 and has played home matches in different grounds around its city, the latest being the 41,507-capacity Allianz Stadium. Nicknamed Vecchia Signora (\"the Old Lady\"), the club has won 34 official league titles. Nicknames: La Vecchia Signora (The Old Lady), La Fidanzata d''Italia (The Girlfriend of Italy) Juventus Football Club S.p.A. (from Latin: iuventūs, \"youth\"), colloquially known as Juve is a professional Italian football club in Turin, Piedmont.', NULL, 'John Doe', NULL, 1, NULL),
(2896, 5, 1, 'Кое телевизиско кафуле го води пензионираниот|бејзбол играч Сем Малоун?', 'Nag''s Head', 'Central Perk', 'Moe''s Tavern', 'Cheers', 4, 20, 1, 0, 0, 'Samuel \"Sam\" \"Mayday\" Malone is a fictional character on the American television show Cheers, portrayed by Ted Danson and created by Glen and Les Charles. The central character of the series, Sam, a former relief pitcher for the Boston Red Sox baseball team, is the owner and bartender of the bar called \"Cheers\".', NULL, 'John Doe', NULL, 1, NULL),
(2897, 3, 1, 'Колку можности постојат доколку имате алтернатива?', 'ниту една', 'безброј', 'две', 'сто', 3, 5, 4, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-22 16:37:13'),
(2898, 4, 1, 'Кое свемирско летало го поврзуваме со повикот:|\"Uh, Houston, we''ve had a problem\"?', 'Аполо 1', 'Аполо 11', 'Аполо 13', 'Аполо 17', 3, 7, 1, 0, 0, '\"Houston, we have a problem\" is a popular but erroneous quote from the radio communications between the Apollo 13 astronaut John (\"Jack\") Swigert and the NASA Mission Control Center (\"Houston\") during the Apollo 13 spaceflight,[1] as the astronauts communicated their discovery of the explosion that crippled their spacecraft. The erroneous wording was popularized by the 1995 film Apollo 13, a dramatization of the Apollo 13 mission, in which actor Tom Hanks, portraying Mission Commander Jim Lovell, uses that wording, which became one of the film''s clichéd taglines.', NULL, 'John Doe', NULL, 1, '2020-03-20 20:00:01'),
(2899, 5, 1, 'Кој прекар турските хистографи му го|„закачиле“ на султанот Сулејман?', 'Пијаница', 'Храбар', 'Законодавец', 'Освојувач', 3, 3, 0, 0, 0, 'Сулејман I десетиот султан на Отоманската империја со која управувал во периодот од 1520 до 1566 г. и со тоа најдолго се задржал на престолот од сите султани. Во европската традиција е познат како Сулејман Величествениот, а во источната како Законодавецот (турски: Kanuni) главно поради воведување на реформи во законодавниот систем на земјата. Освен законодавни, тој спровел и административни, воени, судски, даночни и образовни реформи.', NULL, 'John Doe', NULL, 1, NULL),
(2900, 5, 1, 'На која холивудска династија припаѓа|глумецот Николас Кејџ?', 'Даглас', 'Фонда', 'Копола', 'Шин', 3, 8, 0, 0, 0, 'Francis Ford Coppola (born April 7, 1939) is an American film director, producer, screenwriter and film composer. He was a central figure in the New Hollywood wave of filmmaking. In 1986 Coppola released the comedy Peggy Sue Got Married starring Kathleen Turner, Coppola''s nephew Nicolas Cage, and Jim Carrey.', NULL, 'John Doe', NULL, 1, NULL),
(2901, 4, 1, 'Кој хемиски елемент, заедно со железото е|задолжителен состав на челикот?', 'магнезиум', 'јаглерод', 'водород', 'хлор', 2, 7, 3, 0, 0, 'Челик (тур. çelik) је метастабилно кристализована Fe-C (Fe-Fe3C) легура са садржајем угљеника мањим од 2,06%. Додавањем волфрама, хрома, молибдена, ванадијума, мангана, никла, кобалта и других метала, појединачно или у комбинацијама, добијају се легирани челици за специјалне сврхе, изузетно механички, хемијски или топлотно постојани.', NULL, 'John Doe', NULL, 1, NULL),
(2902, 6, 1, 'Кој покрај Дејвид Боуви, е потпишан како автор на|песните „China Girl“ и „Tonight“?', 'Мик Џегер', 'Сид Вишс', 'Иги Поп', 'Питер Габриел', 3, 9, 1, 0, 0, 'Tonight is the 16th studio album by David Bowie. It was originally released in September 1984, on the label EMI America. \"China Girl\" is a song written by Iggy Pop and David Bowie during their years in Berlin, first appearing on Pop''s debut solo album, The Idiot (1977). Three songs were covers of older Iggy Pop songs: \"Don''t Look Down\", \"Tonight\" and \"Neighborhood Threat\", the latter of which stands out as a track Bowie wished he had not done, with him later calling it \"disastrous\".', NULL, 'John Doe', NULL, 1, NULL),
(2903, 7, 1, 'Кој ги создаде најубавите сонети посветени|на поетесата Виторија Колона?', 'Микеланџело', 'Да Винчи', 'Ботичели', 'Рафаел', 1, 4, 5, 1, 2, 'Vittoria Colonna (April 1492[1] – 25 February 1547), marchioness of Pescara, was an Italian noblewoman and poet. As an educated, married noblewoman whose husband was in captivity, Colonna was able to develop relationships within the intellectual circles of Ischia and Naples. Her early poetry began to attract attention in the late 1510s[2] and she ultimately became one of the most popular female poets of sixteenth-century Italy. Upon the early death of her husband, she took refuge at a convent in Rome. Although she remained a laywoman, she did experience a strong spiritual renewal and remained devoutly religious for the remainder of her life. Colonna is also known to have been a spiritual mentor to Michelangelo Buonarroti, himself a poet.', NULL, 'John Doe', NULL, 1, '2020-02-29 19:37:28'),
(2904, 6, 1, 'Кој пет пати по ред го освои Вимблдон|во поединечна конкуренција?', 'Пит Семпрес', 'Штефи Граф', 'Бјорн Борг', 'Серена Вилиамс', 3, 14, 4, 0, 0, 'In June 1980 he overcame Gerulaitis, again in straight sets, for his fifth French Open title. Again, he did not drop a set. Borg won his fifth consecutive Wimbledon singles title, the 1980 Wimbledon Men''s Singles final, by defeating McEnroe in a five-set match, often cited as the best Wimbledon final ever played – the only comparable match being the 2008 Federer – Nadal final. So it''s all the more amazing that 1978, ''79 and ''80 saw Borg win both tournaments. His five consecutive Wimbledon crowns (from 1976 to 1980) is a men''s record only Roger Federer has matched. [Update: September 2018]', NULL, 'John Doe', NULL, 1, NULL),
(2905, 3, 1, 'Во филмовите со Индијана Џонс,|ги следиме авантурите на...', 'ветеринар', 'археолог', 'машински инженер', 'архитект', 2, 8, 3, 0, 0, 'A native of Princeton, New Jersey, Indiana Jones was introduced as a tenured professor of archeology in the 1981 film Raiders of the Lost Ark, set in 1936.', NULL, 'John Doe', NULL, 1, '2020-03-14 15:36:47'),
(2906, 4, 1, 'Што е наречено според латинскиот збор|кој означува „пладне“?', 'паралела', 'екватор', 'строфа', 'меридијан', 4, 5, 5, 5, 3, 'mid-14c., \"noon,\" from Old French meridien \"of the noon time, midday; the Meridian; southerner\" (12c.), and directly from Latin meridianus \"of midday, of noon, southerly, to the south,\" from meridies \"noon, south,\" from meridie \"at noon,\" altered by dissimilation from pre-Latin *medi die, locative of medius \"mid-\" (from PIE root *medhyo- \"middle\") + dies \"day\" (from PIE root *dyeu- \"to shine\"). Cartographic sense first recorded late 14c. Figurative uses tend to suggest \"point of highest development or fullest power.\" ', NULL, 'John Doe', NULL, 1, NULL),
(2907, 4, 1, 'Во која држава е направен првиот бешамел сос?', 'во Франција', 'во Шпанија', 'во Германија', 'во Португалија', 1, 19, 7, 0, 0, 'Béchamel sauce also known as white sauce, is made from a white roux (butter and flour) and milk. It has been considered, since the seventeenth century, one of the mother sauces of French cuisine.', NULL, 'John Doe', NULL, 1, NULL),
