(2909, 4, 1, 'Во кој роман Јозеф К. е уапсен, но може да се движи|„слободно“ како и до сега ако тоа го смета за слобода?', 'Преобразување', 'Дворец', 'Процес', 'Америка', 3, 4, 4, 4, 2, 'Jozef K. (ili Josef K. originalno na nemačkom) je Kafkin junak u njegovom romanu Proces (nem. Der Prozeß). U knjizi njegovo prezime nikad nije napisano do kraja. Spekuliše se da je to u stvari Kafka, kao prezime autora knjige. Obično nazivan kao K., Jozef je žrtva totalitarizma, što je glavna tema Procesa. Ime glavnog junaka, Jozef, je opet direktna asocijacija na austrijskog cara Franca Jozefa odakle se javlja još jedna povezanost sa likom Franca Kafke, odnosno Jozefa K.', NULL, 'John Doe', NULL, 1, '2020-01-26 18:36:43'),
