(2914, 4, 1, 'На која банка златните резерви од|1914 до 1918 година пораснале за 40%?', 'Британска банка', 'Германска банка', 'Шпанска банка', 'Белгиска банка', 3, 16, 3, 15, 1, 'This article focuses on the effect of the First World War on one neutral European economy, namely Spain. The First World War had an enormous impact not only on the conflicting countries but also on the economies of the neutral countries, particularly Spain, which had close economic ties with the countries at war. The consequences for the Spanish economy were even greater than in other neutral countries if we take into account its geographical location as a neighbour of France and its privileged situation with respect to the Atlantic and Great Britain, the Mediterranean and Africa. We begin our study by analysing the evolution of the principal macroeconomic factors during the period. The Spanish population grew by 15 percent between 1900 and 1920 and 7 percent between 1910 and 1920.', NULL, 'John Doe', NULL, 1, NULL),
