(2930, 6, 1, 'Од специфичноста на звукот кој излегува од нив,|белуга китовите се нарекуваат морски...', 'славејчиња', 'папагали', 'канаринци', 'колибри', 3, 12, 4, 0, 0, 'Beluga (lat. Delphinapterus leucas) je vrsta kitova iz porodice bijelih kitova. Žive u arktičkim i subarktičkim vodama, a kao ni njihov bliski srodnik narval, ni beluge nemaju leđnu, \"masnu peraju\". Upadljiva je njihova plavkasto bijela do bež boja, zbog koje su i dobili drugo ime, bijeli kit. Beluge se sporazumijevaju zvukom koji nastaje u nosnom kanalu na putu do nosnog otvora. Glasaju se vrlo različito, zvukovima koji potsjećaju na skvičanje, zviždanje, mijaukanje, kliktanje, mumljanje.... (Glasovi prodiru kroz trup brodova, pa su ih lovci na kitove nazivali \"morskim kanarincima\")', NULL, 'John Doe', NULL, 1, NULL),
(2931, 7, 1, 'Што конципирал францускиот поет и есеист Антонин Артауд?', 'театар на суровост', 'епски театар', 'театар на апсурдот', 'антитеатар', 1, 4, 5, 4, 4, 'Antonin Artaud was a member of the surrealist movement in Paris in the 1930s, and was well known as an actor, playwright, and essayist of avant-garde theatre. While Artaud would eventually break away from surrealism, the movement helped to shape his later theories on the Theatre of Cruelty. The Theatre of Cruelty (French: Théâtre de la Cruauté, also French: Théâtre cruel) is a form of theatre originally developed by avant-garde French playwright, essayist, and theorist Henry Becque.', '', 'John Doe', '', 1, '2020-01-19 12:53:18'),
