(2972, 4, 1, 'Фудбалерот роден во 1965 во Сечеле|запамтен е како Марадона од...', 'Пиринеите', 'Карпатите', 'Апенините', 'Ардените', 2, 14, 1, 0, 0, 'Săcele is a city in Brașov County, Romania, in the region of Transylvania, with a population of 30,798 inhabitants in 2011. It is adjacent to the city of Brașov, its city centre being situated 15 km away from downtown Brașov. Nicknamed \"The Maradona of the Carpathians\", Hagi is considered a hero in his homeland. He was named Romanian Footballer of the Year seven times, and is regarded as one of the best football players of his generation', NULL, 'John Doe', NULL, 1, NULL),
(2973, 4, 1, 'Како во француската пантомима се нарекува кловнот|со тажно лице облечен во бело вреќасто одело?', 'Клузо', 'Дидеро', 'Пјеро', 'Монтескје', 3, 1, 1, 0, 0, 'Пјеро́ (француски: Pierrot, изведен облик на името Пјер, француски: Pierre) — еден од типските ликови во францускиот народен саемски театар. Ликот се појавил во средината на 17 век и претставува вешт слуга, кој ги остварува своите цели, прикривајќи се со добродушност. Исполнителот на улогата на Пјеро настапувал без маска, со лице опсипано со мака, и носел широка селска кошула. Негов протоип е Педролино од италијанската Комедија дел арте (комедија со маски), кој е вешт и итар, иако често паѓа во неволја. Подоцна, во ликот на Пјеро започнале да преовладуваат црти на ожалостен љубовник на несреќниот соперник Арлекин. Традиционалниот костум на Пјеро се состои од бела кошула со жабо и големи копчиња, широки бели панталони, а на главата конусна шапка. Со овој опис, ликот на Пјеро е прикажан на сликата „Жил“ од Антоан Вато (изложена во Лувр).', NULL, 'John Doe', NULL, 1, NULL),
