(2980, 6, 1, 'Што Боб Дилан прв пат засвирел пред публика|на фестивалот во Њупорт во 1965?', 'електрична гитара', 'усна хармоника', 'тамбурина', 'виолина', 1, 9, 1, 9, 4, 'Joan Baez accompanied him on the tour, but she was never invited to play with him in concert. In fact, they did not tour together again until 1975. After this tour, Dylan was hailed as a hero of folk music, but two months later, at the 1965 Newport Folk Festival, he would alienate his fans and go electric. Dylan was the only artist apart from the Beatles to sell out the De Montfort Hall in the 1960s. Even the Rolling Stones did not sell out this venue.', NULL, 'John Doe', NULL, 1, '2020-03-28 23:53:30'),
