(3583, 10, 1, 'На кои двајца големи Германци животниот век|им се преклопува за точно единаесет месеци?', 'Бах и Гете', 'Вагнер и Шилер', 'Шуман и Рилке', 'Бетовен и Брехт', 1, 9, 7, 0, 0, 'The poet Johann Wolfgang von Goethe and composer Johann Sebastian Bach are among the great German men who shaped literature and music like no other during their lifetime. What many do not know: Their lifetimes overlap exactly eleven months a day. Johann Wolfgang von Goethe was born on August 28, 1749 in Frankfurt am Main and Johann Sebastian Bach died on June 28, 1750 at the age of 65. The composer was born on March 31, 1685 in Eisenach.', NULL, 'John Doe', NULL, 1, '2020-03-15 14:06:59'),
