(3588, 6, 1, 'Во декември 2019, тогаш 25-годишната Фалон Шерок историјата|ја запамти како прва жена која порази маж на Светски куп во ...', 'бокс', 'пикадо', 'голф', 'шах', 2, 14, 0, 0, 0, 'Born in Milton Keynes, Buckinghamshire, in 2019, Sherrock became the first female to win a match, and subsequently two consecutive matches, at the PDC World Championships, first by beating Ted Evetts 3–2 in the first round, and then Mensur Suljović 3–1 in the second round, before eventually losing 4–2 to Chris Dobey in the third round.', NULL, 'John Doe', NULL, 1, '2020-03-17 20:04:05'),
