(3607, 4, 1, 'Без кое овошје не можете да направите ракија комовица?', 'сливи', 'дуња', 'грозје', 'кајсии', 3, 19, 5, 0, 0, 'Коминарка, комовица или комова ракија – вид ракија добиена од комина. Коминарката е нуспроизвод во процесот на правење вино. Комовица се произведува со дестилација на превриена комина од свежо грозје.', NULL, 'John Doe', NULL, 1, '2020-03-14 20:31:51'),
(3608, 6, 1, 'На која од овие држави главниот град е сместен|на најголема надморска височина?', 'Шпанија', 'Швајцарија', 'Босна и Херцеговина', 'Македонија', 1, 2, 1, 0, 0, '', NULL, 'John Doe', NULL, 1, '2020-03-15 14:27:54'),
(3609, 8, 1, 'Во кој филм Џејмс Бонд прв пат нарачува мартини,|протресен, но не промешан?', 'Голдфингер', 'Доктор Но', 'Дијамантите се вечни', 'Само два пати се живее', 3, 8, 3, 8, 5, 'The phrase first appears in the novel Diamonds Are Forever (1956), though Bond himself does not actually say it until Dr. No (1958), where his exact words are \"shaken and not stirred.\" In the film adaptations of Fleming''s novels, the phrase is first uttered by the villain, Dr. Julius No, when he offers the drink in Dr. No (1962), and it is not uttered by Bond himself (played by Sean Connery) until Goldfinger (1964).', NULL, 'John Doe', NULL, 1, '2020-03-15 14:00:44'),
(3610, 6, 1, 'Од кое потекло се сите четири членови на американската|хеви-метал група System of a Down?', 'ерменско', 'француско', 'грчко', 'шпанско', 1, 9, 6, 0, 0, 'System of a Down is an Armenian-American heavy metal band formed in Glendale, California in 1994. The band currently consists of Serj Tankian (lead vocals, keyboards), Daron Malakian (vocals, guitar), Shavo Odadjian (bass, backing vocals) and John Dolmayan (drums).', NULL, 'John Doe', NULL, 1, '2020-03-15 14:25:05'),
