(3617, 5, 1, 'Кај кои „врати“ 300 Спартанци војувале со|бројчано надмоќната персиска војска?', 'кај Лавјите врати', 'кај Камените врати', 'кај Коралните врати', 'кај Жешките врати', 4, 3, 1, 0, 0, 'Битката кај Термопилите — битка со времетраење од три дена, којашто се водела меѓу сојузот на грчките градови-држави, предводени од Спартанскиот крал Леонид I, и Персискиот владетел, Ксеркс I, за време на втората персиска инвазија на Стара Грција. It took place in 480 BC, at the narrow coastal pass of Thermopylae (\"The Hot Gates\"). ', '', 'John Doe', NULL, 1, '2020-03-30 17:04:12'),
(3618, 5, 1, 'Кој град не е „во границите“ на индустриското Рурско подрачје?', 'Гелзенкирхен', 'Бохум', 'Есен', 'Бремен', 4, 2, 1, 0, 0, 'Ruhr se ubraja u najgušće naseljena područja Europe; na 1 km² prosječno živi 1199 st., a mjestimično i 20 000 st. Najveća je koncentracija velikih gradova između srednjeg i donjega toka rijeka Ruhr i Emscher (Bochum, Dortmund, Duisburg, Essen, Gelsenkirchen, Herne, Oberhausen, Recklinghausen); predgrađa im se često stapaju stvarajući jedinstven urbani pojas.', '', 'John Doe', '', 1, '2020-04-04 13:13:21'),
(3619, 5, 1, 'Со кој вид на рбетници, птеросаурот, од сите|изумрени рептили, е најблиску поврзан?', 'со рибите', 'со водоземците', 'со цицачите', 'со птиците', 4, 12, 3, 0, 0, 'Pterosaurs (from Greek pteron and sauros, meaning \"wing lizard\") were flying reptiles of the extinct clade or order Pterosauria. ', '', 'John Doe', NULL, 1, '2020-04-02 18:43:57'),
(3620, 5, 1, 'Кои се најбројни добитници на Нобелова награда за економија?', 'Американците', 'Французите', 'Јапонците', 'Русите', 1, 16, 3, 0, 0, 'As of October 2018, the institution with the most affiliated laureates in economic sciences is the University of Chicago, which has 32 affiliated laureates. [Update 2020]', '', 'John Doe', NULL, 1, '2020-03-21 19:10:02'),
