(3653, 6, 1, 'На која битка последица е основањето на Црвениот крст?', 'Битката кај Маренга', 'Битката кај Солферино', 'Битката кај Трокадеро', 'Битката кај Седан', 2, 3, 1, 13, 1, 'Во јуни 1859, швајцарскиот бизнисмен Анри Динан патувал во Италија за да се сретне со францускиот император Наполеон III. Кога пристигнал до малиот град Солферино, вечерта на 24 јуни, бил сведок на Битката од Солферино, судир во Австро-Сардиниската војна. Во еден ден, околу 40.000 војници на двете страни загинале или останале ранети на бојното поле. На 9 февруари 1863 во Женева, Анри Динан го основал „Петчлениот комитет“ (заедно со 4 други водечки личности од видни семејства од Женева), како анкетна комисија на Женевското здружение за јавна благосостојба.', '', 'John Doe', NULL, 1, '2020-04-19 14:54:48'),
