(3800, 8, 1, 'Во која наука често се користи „Обратната полска нотација“?', 'математика', 'картографија', 'лигвистика', 'музичка теорија', 1, 6, 1, 0, 0, 'Polish postfix notation or simply postfix notation, is a mathematical notation in which operators follow their operands, in contrast to Polish notation (PN), in which operators precede their operands. It does not need any parentheses as long as each operator has a fixed number of operands. The description \"Polish\" refers to the nationality of logician Jan Lukasiewicz, who invented Polish notation in 1924. In reverse Polish notation, the operators follow their operands; for instance, to add 3 and 4, one would write 3 4 + rather than 3 + 4.', '', 'John Doe', NULL, 0, NULL),
